INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, 'Parapet wewnętrzny z konglomeratu w kolorze Perlato Royal, o wymiarach 122 cm x 30 cm x 2 cm, firmy Knap. Przeznaczony do montażu wewnątrz pomieszczeń. Dzięki zastosowaniu wysokiej jakości materiału parapet jest wyjątkowo odporny na zarysowania. Stanowi doskonałą alternatywę dla parapetów marmurowych i z granitu.', '', 'knap-parapet-z-konglomeratu-perlato-royal-122-cm-x-30-cm-x-2-cm', '', '', '', 'Knap Parapet z konglomeratu Perlato Royal 122 cm x 30 cm x 2 cm', '', '', '', ''),
(2, 1, 1, 'Parapet wewnętrzny laminowany firmy Biuro Styl. Wykonany z płyty wiórowej pokrytej wysokociśnieniowym laminatem dekoracyjnym. Parapet posiada wysoką klasę wytrzymałości, jego klasyczny wygląd podkreśli elegancję pomieszczenia. Ponad to cechuje się łatwością w konserwacji.  Parapet docinany zgodnie z życzeniem klienta. Maksymalna długość: 305 cm', '', 'parapet-laminowany-deska-karaibska-30-x-28-x-305-cm', '', '', '', 'Parapet laminowany deska karaibska 30 x 28 x 305 cm', '', '', '', ''),
(3, 1, 1, 'Parapet wewnętrzny z konglomeratu w kolorze Botticino, o wymiarach 92 cm x 30 cm x 2 cm, firmy Knap. Przeznaczony do montażu wewnątrz pomieszczeń. Dzięki zastosowaniu wysokiej jakości materiału parapet jest wyjątkowo odporny na zarysowania. Stanowi doskonałą alternatywę dla parapetów marmurowych i z granitu.', '', 'knap-parapet-z-konglomeratu-botticino-92-cm-x-30-cm-x-2-cm', '', '', '', 'Knap Parapet z konglomeratu Botticino 92 cm x 30 cm x 2 cm', '', '', '', ''),
(4, 1, 1, 'Parapet wewnętrzny z konglomeratu w kolorze Arabescato Bianco, o wymiarach 152 cm x 30 cm x 2 cm, firmy Knap. Przeznaczony do montażu wewnątrz pomieszczeń. Dzięki zastosowaniu wysokiej jakości materiału parapet jest wyjątkowo odporny na zarysowania. Stanowi doskonałą alternatywę dla parapetów marmurowych i z granitu.', '', 'knap-parapet-z-konglomeratu-arabescato-bianco-152-cm-x-30-cm-x-2-cm', '', '', '', 'Knap Parapet z konglomeratu Arabescato Bianco 152 cm x 30 cm x 2 cm', '', '', '', ''),
(5, 1, 1, 'Parapet wewnętrzny PVC, w kolorze białym. Charakteryzuje się odpornością na działanie wody, wysoką temperaturę oraz na promieniowanie UV. Powierzchnia pokryta wysokiej jakości folią okleinową jest łatwa do utrzymania w czystości. Grubość: 4,2 cm. Szerokość: 25 cm. Maksymalna długość: 298 cm.', '', 'parapet-wewnetrzny-pvc-bialy-25-cm-x-42-cm', '', '', '', 'Parapet wewnętrzny PVC biały, 25 cm x 4,2 cm', '', '', '', ''),
(6, 1, 1, 'Nawiewnik okienny ciśnieniowy biały 23x430x21mm Nawiewnik naramowy manualny zapewniaja optymalny przepływ powietrza. Możliwość montażu w stolarce PCV, aluminiowej i drewnianej. Czerpnia posiada siatkę chroniącą przed owadami.', '', 'nawiewnik-okienny-cisnieniowy-bialy-23x430x21mm', '', '', '', 'Nawiewnik okienny ciśnieniowy biały 23x430x21mm', '', '', '', ''),
(7, 1, 1, 'Parapet wewnętrzny PVC, w kolorze orzech. Charakteryzuje się odpornością na działanie wody, wysoką temperaturę oraz na promieniowanie UV. Powierzchnia pokryta wysokiej jakości folią okleinową jest łatwa do utrzymania w czystości. Grubość: 4,2 cm. Szerokość: 25 cm. Długość: 156 cm.', '', 'parapet-wewnetrzny-pvc-orzech-156-cm-x-25-cm-x-42-cm', '', '', '', 'Parapet wewnętrzny PVC orzech, 156 cm x 25 cm x 4,2 cm', '', '', '', ''),
(8, 1, 1, 'Parapet wewnętrzny świerk marki Eruotaxpol Jest to wysokiej klasy parapet wewnętrzny wykonany z drewna dębowego. Charakteryzuje się wytrzymałością i eleganckim wyglądem, swoje zastosowanie znajdzie w pomieszczeniach mieszkalnych i użyteczności publicznej. Powierzchnia jest bardzo łatwa w pielęgnacji i przyjemna w dotyku.', '', 'eurotaxpol-parapet-swierk-182-cm-x-30-cm-x-27-cm', '', '', '', 'Eurotaxpol Parapet świerk 182 cm x 30 cm x 2,7 cm', '', '', '', ''),
(9, 1, 1, 'Parapet wewnętrzny laminowany firmy Biuro Styl. Wykonany z płyty wiórowej pokrytej wysokociśnieniowym laminatem dekoracyjnym. Parapet posiada wysoką klasę wytrzymałości, jego klasyczny wygląd podkreśli elegancję pomieszczenia. Ponad to cechuje się łatwością w konserwacji.  Parapet docinany zgodnie z życzeniem klienta. Maksymalna długość: 305 cm', '', 'parapet-laminowany-piemonte-30-x-28-x-305-cm', '', '', '', 'Parapet laminowany Piemonte 30 x 28 x 305 cm', '', '', '', ''),
(10, 1, 1, 'Parapet wewnętrzny PVC, w kolorze białym. Charakteryzuje się odpornością na działanie wody, wysoką temperaturę oraz na promieniowanie UV. Powierzchnia pokryta wysokiej jakości folią okleinową jest łatwa do utrzymania w czystości. Grubość: 4,2 cm. Szerokość: 30 cm. Maksymalna długość: 298 cm.', '', 'parapet-wewnetrzny-pvc-bialy-30-cm-x-42-cm', '', '', '', 'Parapet wewnętrzny PVC biały, 30 cm x 4,2 cm', '', '', '', ''),
(11, 1, 1, 'Parapet wewnętrzny świerk marki Eruotaxpol Jest to wysokiej klasy parapet wewnętrzny wykonany z drewna dębowego. Charakteryzuje się wytrzymałością i eleganckim wyglądem, swoje zastosowanie znajdzie w pomieszczeniach mieszkalnych i użyteczności publicznej. Powierzchnia jest bardzo łatwa w pielęgnacji i przyjemna w dotyku.', '', 'eurotaxpol-parapet-swierk-122-cm-x-30-cm-x-27-cm', '', '', '', 'Eurotaxpol Parapet świerk 122 cm x 30 cm x 2,7 cm', '', '', '', ''),
(12, 1, 1, '', '', 'contrio-rhr-roleta-przyciemniajaca-bezowy-78-cm-x-118-cm', '', '', '', 'Contrio RHR Roleta Przyciemniająca Beżowy 78 cm x 118 cm', '', '', '', ''),
(13, 1, 1, 'Parapet granitowy w kolorze Indy Black o wymiarach 92 cm x 30 cm x 2 cm, firmy Knap. Przeznaczony do montażu zarówno wewnątrz, jak i na zewnątrz pomieszczeń. Materiał, z którego został wykonany, zapewnia wyjątkową odporność na ścieranie i działanie czynników zewnętrznych. Grubość parapetu wynosi 20 mm +/- 2 mm wynikająca z charakteru obróbki materiału.', '', 'knap-parapet-granitowy-indy-black-92-cm-x-30-cm-x-2-cm', '', '', '', 'Knap Parapet granitowy Indy Black 92 cm x 30 cm x 2 cm', '', '', '', ''),
(14, 1, 1, 'Nakładka na parapet PVC, w kolorze marmur, marki Vilo. Umożliwia w prosty sposób odnowienie starego parapetu. Jest estetyczna, trwała i łatwa do utrzymania w czystości. Grubość: 5,5 cm. Szerokość: 38 cm. Długość: 200 cm.', '', 'vilo-nakladka-parapetowa-marmur-200-cm-x-38-cm-x-55-cm', '', '', '', 'Vilo Nakładka parapetowa marmur, 200 cm x 38 cm x 5,5 cm', '', '', '', ''),
(15, 1, 1, 'Parapet wewnętrzny świerk marki Eruotaxpol Jest to wysokiej klasy parapet wewnętrzny wykonany z drewna dębowego. Charakteryzuje się wytrzymałością i eleganckim wyglądem, swoje zastosowanie znajdzie w pomieszczeniach mieszkalnych i użyteczności publicznej. Powierzchnia jest bardzo łatwa w pielęgnacji i przyjemna w dotyku.', '', 'eurotaxpol-parapet-swierk-152-cm-x-30-cm-x-27-cm', '', '', '', 'Eurotaxpol Parapet świerk 152 cm x 30 cm x 2,7 cm', '', '', '', ''),
(16, 1, 1, 'Parapet wewnętrzny PVC, w kolorze białym. Charakteryzuje się odpornością na działanie wody, wysoką temperaturę oraz na promieniowanie UV. Powierzchnia pokryta wysokiej jakości folią okleinową jest łatwa do utrzymania w czystości. Grubość: 4,2 cm.', '', 'parapet-wewnetrzny-pvc-bialy-186-cm-x-25-cm-x-42-cm', '', '', '', 'Parapet wewnętrzny PVC biały, 186 cm x 25 cm x 4,2 cm', '', '', '', ''),
(17, 1, 1, 'Okno do pomieszczeń niemieszkalnych, białe, 100 cm x 60 cm, marki ACO Kipp. Okno wykonane z wysokiej jakości tworzywa PVC, przeznaczone do pomieszczeń gospodarczych: piwnic, garaży, domków letniskowych, budynków inwentarskich, a także do małych łazienek w domkach jednorodzinnych. Posiada ościeżnicę o wysokiej sztywności, wykonaną z trójkomorowych, izolowanych termicznie profili i uchylne, wyjmowane od wewnątrz skrzydło z 3 ustawieniami otwarcia. Okno oszklone jest pojedynczą szybą o grubości 5 mm (Uv = 5,6 W/m2K). Specjalne uszczelki z materiału odpornego na działanie światła i czynników atmosferycznych zapewniają optymalną szczelność połączeń. Kształt profili ogranicza osadzanie się zanieczyszczeń. Okno wyposażone jest w system odwadniający, odprowadzający wodę na zewnątrz przez ramę ościeżnicy. Może być montowane za pomocą zwykłych kotew budowlanych. Nowoczesne, proste wzornictwo sprawia, że okno ACO Kipp jest nie tylko funkcjonalne, ale też podwyższa walory estetyczne pomieszczeń i ścian budynków.', '', 'aco-okno-gospodarcze-aco-kipp-biale-100-cm-x-60-cm', '', '', '', 'ACO Okno gospodarcze ACO Kipp białe 100 cm x 60 cm', '', '', '', ''),
(18, 1, 1, 'Parapet wewnętrzny PVC, w kolorze białym. Charakteryzuje się odpornością na działanie wody, wysoką temperaturę oraz na promieniowanie UV. Powierzchnia pokryta wysokiej jakości folią okleinową jest łatwa do utrzymania w czystości. Grubość: 4,2 cm.', '', 'parapet-wewnetrzny-pvc-bialy-126-cm-x-30-cm-x-42-cm', '', '', '', 'Parapet wewnętrzny PVC biały, 126 cm x 30 cm x 4,2 cm', '', '', '', ''),
(19, 1, 1, 'Nakładka na parapet PVC, w kolorze orzech, marki Vilo. Umożliwia w prosty sposób odnowienie starego parapetu. Jest estetyczna, trwała i łatwa do utrzymania w czystości. Grubość: 5,5 cm. Szerokość: 38 cm. Długość: 200 cm.', '', 'vilo-nakladka-parapetowa-orzech-200-cm-x-38-cm-x-55-cm', '', '', '', 'Vilo Nakładka parapetowa orzech, 200 cm x 38 cm x 5,5 cm', '', '', '', ''),
