(21, 1, 1, 'Parapet granitowy w kolorze Bianco New Crystal, o wymiarach 92 cm x 30 cm x 2 cm, firmy Knap. Przeznaczony do montażu zarówno wewnątrz, jak i na zewnątrz pomieszczeń. Materiał, z którego został wykonany, zapewnia wyjątkową odporność na ścieranie i działanie czynników zewnętrznych. Grubość parapetu wynosi 20 mm +/- 2 mm wynikająca z charakteru obróbki materiału.', '', 'knap-parapet-granitowy-bianco-new-crystal-92-cm-x-30-cm-x-2-cm', '', '', '', 'Knap Parapet granitowy Bianco New Crystal 92 cm x 30 cm x 2 cm', '', '', '', ''),
