(48, 1, 1, 'Drabina wielofunkcyjna TG-DW 3 x 7 szczebli marki Bayersystem wyróżnia się wielością zastosowań. Jest wykonana z lekkiego, trwałego aluminium, co ułatwia przenoszenie i transport urządzenia. Aluminiowe drabiny mogą być używane zarówno wewnątrz, jak i na zewnątrz budynków. Ta aluminiowa drabina wielofunkcyjna jest doskonałym wyborem dla profesjonalistów i hobbystów.  Wiele zastosowań, drabina 3-elementowa Lekka, aluminiowa drabina wielofunkcyjna Bayersystem składa się z 3 elementów, dzięki którym urządzenie może pełnić więcej niż jedną funkcję:  - drabina rozstawna, czyli konstrukcja z dwoma parami ramion, które mogą stać samodzielnie, bez konieczności opierania ich o ścianę. Wyróżnia ją stabilność i uniwersalność. Są często wybierane podczas drobnych napraw, prac remontowych oraz porządkowych. Kształtem przypomina literę \"A\". Drabina TG-DW to model wysokiej jakości ze stopniami z dwóch stron. Drabina rozstawna ma mechanizm, umożliwiający łatwe i bezpieczne składanie i rozkładanie. Kolejnym istotnym elementem jest zabezpieczenie rozstawu, które zapobiega nadmiernemu rozsuwaniu się drabiny w trakcie prac.  - drabina przystawna, czyli drabina klasyczna. Jej konstrukcja składa się z dwóch elementów: podłużnic i szczebli. Podłużnice to pionowe części drabiny, w których mocowane są poziome szczeble. Na takim stelażu opiera się cały ciężar. Aby użyć takiej drabiny, należy ją oprzeć, np. o ścianę lub regał domowej biblioteki. Drabina przystawna umożliwia dostanie się do trudno dostępnych miejsc, jak dach budynku.  - drabina wolnostojąca powstaje dzięki rozsuwanemu elementowi. Ostatni element trzyczęściowej drabiny można użytkować osobno. Odłączenie elementu od pełnej konstrukcji pozwala uzyskać dodatkową drabinę, którą charakteryzuje lekkość, nieduży rozmiar i trwałość. Natomiast jako drabina wolnostojąca wysuwna sprawdzi się w pomieszczeniu z wysokimi sufitami, do których ciężko sięgnąć.    Atutem drabiny jest możliwość wyboru rozstawienia. Wykonanie z trwałego aluminium zapewnia możliwość korzystania z urządzenia przez lata. Przy jej pomocy można przeprowadzać małe i duże prace na określonej wysokości. Ta 3 elementowa drabina pozwalana na podejmowanie prac naprawczych, remontowych i konserwacyjnych. Dzięki niej można pracować na znacznie wyższych wysokościach niż mogą to zaoferować tradycyjne drabiny dwuelementowe. Maksymalna wysokość robocza, jaką można osiągnąć podczas pracy, wykonywanej na drabinie Bayersystem 3 x 7 to ok. 4,7 m.  Bezpieczeństwo i stabilność Korzystanie z drabiny wielofunkcyjnej TG-DW 3 x 7 szczebli marki Bayersystem jest bezpieczne. Wyposażono ją w system blokujący oraz hak, który zabezpiecza zsunięcie się elementu wysuwanego. Stabilne ustawienie drabiny zapewniają stopki antypoślizgowe, znajdujące się u podstawy podłużnic. Stopki ograniczają możliwość przypadkowego rozsunięcia się drabiny. Bezpieczną pracę na wysokości umożliwiają stopnie o antypoślizgowej powierzchni.  Dla hobbystów i profesjonalistów Drabina przemysłowa Bayersystem to narzędzie profesjonalne. Spełnia normę EN 131, co stanowi o sprzęcie bezpiecznym w użytkowaniu i zgodnym z przepisami. To wielofunkcyjne narzędzie o szerokim zastosowaniu jest doskonałym wyborem dla firm i osób prywatnych. Ten model wyróżnia najwyższa jakość wykonania, gwarantując wysoki poziom bezpieczeństwa podczas użytkowania na wysokości. Każdy moduł jest wyposażony w siedem stopni o nośności 150 kg. Po zakończeniu pracy drabinę Bayersystem można łatwo i szybko złożyć, co ułatwia transport oraz przechowywanie. Długość transportowa wynosi ok. 1,9 m.', '', 'bayersystem-drabina-wielofunkcyjna-tg-dw-3-x-7-szczebli', '', '', '', 'Bayersystem Drabina wielofunkcyjna TG-DW 3 x 7 szczebli', '', '', '', ''),
(49, 1, 1, 'Pianka montażowa, marki CMI. Jest to jednokomponentowa piana poliuretanowa w wersji z aplikatorem wężykowym do montażu, uszczelniania i wygłuszania. Charakteryzuje się dużą wytrzymałością mechaniczną i doskonałą przyczepnością do typowych materiałów konstrukcyjnych takich jak: cegła, beton, tynk, drewno, szkło, metale, styropian, twarde PCV i sztywne piany PUR.', '', 'cmi-pianka-montazowa-wezykowa-750-ml', '', '', '', 'CMI Pianka montażowa wężykowa 750 ml', '', '', '', ''),
(50, 1, 1, 'Taczka spawana Skiva SV-T1. Grubość kosza: 1,0 mm Pojemność: 90l Materiał: stal Waga: 17 kg Koło : pompowane na łożysku', '', 'skiva-taczka-spawana-90l', '', '', '', 'Skiva Taczka spawana 90L', '', '', '', ''),
(51, 1, 1, 'Aluminiowe rusztowanie robocze ClimTec 7m do szybkiego i elastycznego zastosowania wewnątrz pomieszczeń oraz na zewnątrz.  - Atestowane przez TÜV, nośność 200 kg/m , zgodne z PN EN 1004-1 - Wcześniejsze zamocowanie systemu poręczy GuardMatic przed zawieszeniem pomostu gwarantuje bezpieczeństwo montażu. Przy wchodzeniu na pomost, mamy już zainstalowany komplet poręczy i tym samym pełne zabezpieczenie przed upadkiem - Zintegrowanie stężeń ukośnych z systemem GuardMatic zapewnia łatwy i bezpieczny montaż. Na czas transportu i przechowywania poręcze GuardMatic można złożyć w celu zaoszczędzenia miejsca - Innowacyjny kształt stężeń ukośnych zapewnia maksymalną przestrzeń użytkową na pomoście - 6-punktowe mocowanie poręczy zapewnia maksymalną stabilność na wysokości - Każdy pakiet wyposażony jest w pomost, a maksymalna odległość pomiędzy kolejnymi pomostami wynosi 2 m - Szybki, beznarzędziowy montaż przez zastosowanie specjalnych połączeń zaciskowych oraz nasadzanych elementów ram - Rama podstawy z dolną częścią w kształcie litery V zwiększa powierzchnię podparcia w kierunku wzdłużnym i poprzecznym, gwarantując wysoki poziom bezpieczeństwa oraz pracę blisko ścian - Wchodzenie od wewnętrznej strony rusztowania jest bezpieczne dzięki antypoślizgowym, profilowanym szczeblom zamontowanym na ramie pionowej - Rusztowanie ClimTec może być stosowane także na schodach lub stopniach - Wysokość robocza 7m, wysokość pomostu 5m', '', 'krause-rusztowanie-climtec-komplet-012-kondygnacja-7-m', '', '', '', 'Krause Rusztowanie ClimTec komplet 0+1+2 kondygnacja 7 m', '', '', '', ''),
(52, 1, 1, 'Drabina wielofunkcyjna TG-DW 3 x 9 szczebli marki Bayersystem wyróżnia się wielością zastosowań. Jest wykonana z trwałego aluminium, które wpływa na wytrzymałość oraz odporność na uszkodzenia. Ponadto aluminium jest materiałem lekkim, dzięki czemu drabinę łatwo przestawić lub przetransportować. Aluminiowe drabiny mogą być używane zarówno wewnątrz, jak i na zewnątrz budynków.  Do profesjonalnego użytku przemysłowego Drabina przemysłowa Bayersystem to narzędzie profesjonalne. Spełnia normę EN 131, co stanowi o sprzęcie bezpiecznym w użytkowaniu i zgodnym z przepisami. Norma ta reguluje dopuszczenie urządzenia do użytku w przedsiębiorstwach oraz środowiskach pracy. Z drabiny o szerokim zastosowaniu mogą również korzystać osoby prywatne. Ten model wyróżnia najwyższa jakość wykonania, gwarantując wysoki poziom bezpieczeństwa. Drabina, na której można osiągnąć 6,01 m wysokości roboczej sprawdzi się podczas prac ogrodowych lub elewacyjnych.  Bezpieczeństwo i stabilność Korzystanie z drabiny wielofunkcyjnej TG-DW 3 x 9 szczebli marki Bayersystem jest bezpieczne. Wyposażono ją w system blokujący oraz hak, który zabezpiecza zsunięcie się elementu wysuwanego. Stabilne ustawienie drabiny zapewniają stopki antypoślizgowe, znajdujące się u podstawy podłużnic. Stopki ograniczają możliwość przypadkowego rozsunięcia się drabiny. Bezpieczną pracę na wysokości umożliwiają stopnie o antypoślizgowej powierzchni. Każdy moduł jest wyposażony w stopnie o nośności 150 kg. Po zakończeniu pracy drabinę Bayersystem można łatwo i szybko złożyć, co ułatwia transport oraz przechowywanie. Długość transportowa wynosi ok. 2,4 m.    Trzyelementowa konstrukcja - trzy sposoby użytkowania Wielofunkcyjna aluminiowa drabina przemysłowa Bayersystem składa się z 3 elementów, które umożliwiają wykorzystywanie urządzenia na kilka sposobów:  - drabina rozstawna, czyli konstrukcja z dwoma parami ramion, które mogą stać samodzielnie, bez konieczności opierania ich o ścianę. Wyróżnia ją stabilność i uniwersalność. Są często wybierane podczas drobnych napraw, prac remontowych oraz porządkowych. Kształtem przypomina literę \"A\". Drabina TG-DW to model wysokiej jakości ze stopniami z dwóch stron. Drabina rozstawna ma mechanizm, umożliwiający łatwe i bezpieczne składanie i rozkładanie. Kolejnym istotnym elementem jest zabezpieczenie rozstawu, które zapobiega nadmiernemu rozsuwaniu się drabiny w trakcie prac.  - drabina przystawna, czyli drabina klasyczna. Jej konstrukcja składa się z dwóch elementów: podłużnic i szczebli. Podłużnice to pionowe części drabiny, w których mocowane są poziome szczeble. Na takim stelażu opiera się cały ciężar. Aby użyć takiej drabiny, należy ją oprzeć, np. o ścianę. Drabina przystawna umożliwia dostanie się do trudno dostępnych miejsc, jak dach budynku.  - drabina wolnostojąca dwuelementowa i drabina jednoelementowa przystawna powstają dzięki rozsuwanemu elementowi. Ostatni element trzyczęściowej drabiny można użytkować osobno. Odłączenie elementu od pełnej konstrukcji pozwala uzyskać dwie drabiny. Dodatkowa drabina jednoelementowa jest drabiną przystawną, którą charakteryzuje lekkość i nieduży rozmiar. Drabina dwuelementowa jest wolnostojąca.  Atutem drabiny jest możliwość wyboru rozstawienia. Wykonanie z trwałego aluminium zapewnia możliwość korzystania z urządzenia przez lata. Przy jej pomocy można przeprowadzać wiele różnych prac w firmach budowlanych, przeprowadzkowych czy usługowych.Dzięki niej można pracować na znacznie wyższych wysokościach niż mogą to zaoferować tradycyjne drabiny dwuelementowe. Maksymalna wysokość robocza, jaką można osiągnąć podczas pracy, wykonywanej na drabini', '', 'bayersystem-drabina-wielofunkcyjna-tg-dw-3-x-9-szczebli', '', '', '', 'Bayersystem Drabina wielofunkcyjna TG-DW 3 x 9 szczebli', '', '', '', ''),
(53, 1, 1, 'Drabina przemysłowa TG-DJ 1 x 10 szczebli, firmy Bayersystem. Lekka, aluminiowa, jednoczęściowa drabina przystawna do wszechstronnych zastosowań. Posiada profilowane szczeble, zapewniające bezpieczne wchodzenie i schodzenie. Dolne końce podłużnic wyposażone są w antypoślizgowe stopki, gwarantujące pewne ustawienie. Maksymalne obciążenie: 150 kg. Gwarancja producenta: 2 lata.', '', 'bayersystem-drabina-przystawna-tg-dj-1-x-10-szczebli', '', '', '', 'Bayersystem Drabina przystawna TG-DJ 1 x 10 szczebli', '', '', '', ''),
(54, 1, 1, '', '', 'krause-drabina-wielofunkcyjna-3x7-corda', '', '', '', 'KRAUSE Drabina wielofunkcyjna 3x7 CORDA', '', '', '', ''),
(55, 1, 1, 'Drabina rozstawna DRL-6 Lux. Klasyczna drewniana drabina 6-szczeblowa, lakierowana. Przeznaczona do użytku przy wszelkich pracach remontowych i malarskich. Wyposażona jest w stalowe, mocne zawiasy i łańcuch ograniczający rozstaw. Charakteryzuje się solidnością wykonania, jest mocna, stabilna i wygodna w użyciu. Maksymalne obciążenie 150 kg.', '', 'daniel-drabina-rozstawna-lakierowana-drl-6-lux', '', '', '', 'Daniel Drabina rozstawna lakierowana DRL-6 Lux', '', '', '', ''),
(56, 1, 1, '', '', 'krause-drabina-wielofunkcyjna-3x9-corda', '', '', '', 'KRAUSE Drabina wielofunkcyjna 3x9 CORDA', '', '', '', ''),
(57, 1, 1, 'Drabina wielofunkcyjna 3x11 CORDA marki KRAUSE to 3-elementowa drabina zapewnia wygodną i bezpieczną pracę na wysokości. Dzięki wysuwanemu odcinkowi drabina osiąga długość maksymalną 6,45 m.  Mocna stabilizacja Drabina wielofunkcyjna 3x11 Corda firmy Krause jest aluminiowa i służy jako drabina przystawna, rozsuwana lub wolnostojąca z wysuwanym elementem. Prowadnice drabiny są stalowe, powlekane proszkowo. Dzięki nim łatwo rozsunąć drabinę. Podstawa drabiny zakończona jest szerokim, mocnym stabilizatorem z antypoślizgowymi stopami, zapewniającym sztywne ustawienie, bez wahań i przechyłów. Stopki dwukomponentowe skutecznie utrzymują drabinę w miejscu. Ponadto drabina wielofunkcyjna jest wyposażona w samozabezpieczające zapadki, wykluczające przypadkowe złożenie się drabiny w trakcie użytkowania i rozsuwanie w czasie transportu.    Zastosowanie Drabinę można ustawić w 3 konfiguracjach jako: drabinę przystawną, rozsuwaną lub wolnostojącą z wysuniętym elementem, co pozwala na jej wszechstronne zastosowanie. Budowa 3 elementowa pozwala na zachowanie kompaktowych wymiarów podczas transportu oraz dużego zasięgu pracy przy maksymalnym rozłożeniu drabiny. Wysokość rozłożonej drabiny przystawnej/wolnostojącej wynosi 3,1/2,95 m. Wysokość drabiny wolnostojącej z wysuniętym elementem wynosi 4,55 m. Natomiast długość drabiny przystawnej z maksymalnie rozsuniętymi elementami wynosi 6,45 m.', '', 'krause-drabina-wielofunkcyjna-3x11-corda', '', '', '', 'KRAUSE Drabina wielofunkcyjna 3x11 CORDA', '', '', '', ''),
(58, 1, 1, 'Pianka montażowa z aplikatorem Genius Gun marki Soudal jest przeznaczona do wielokrotnych prac uszczelniających. Wyposażona jest w aplikator Genius Gun i formułę, która umożliwia aplikację w temperaturach do -10°C. Aplikator pozwala na wielokrotne użycie pianki montażowej w dłuższym okresie czasu, a wygodny uchwyt zapewnia precyzyjne i oszczędne dozowanie niczym profesjonalny pistolet.    Zastosowanie Pianka montażowa z aplikatorem Genius Gun jest stosowana do uszczelniania stolarki okiennej i drzwiowej z drewna, PCV i aluminium, parapetów, stopni schodów, rolet, brodzików, wanien. Ponadto pianka uszczelnia złącza dachowe, ścienne i stropowe oraz systemy chłodzące. Łączy prefabrykowane elementy drewniane w konstrukcjach szkieletowych, wypełnia przepusty rurowe. Stanowi też izolację elementów instalacji c.o. i wodnokanalizacyjnych oraz izolację termiczną dachów i stropodachów.  Aplikator Genius Gun Innowacyjny aplikator wężykowy Genius Gun umożliwia precyzyjne dozowanie pianki montażowej. Sprawia, że praca staje się bardziej komfortowa i bezpieczna. Dzięki Genius Gun napoczętą puszkę z pianką można długotrwale przechowywać bez ryzyka zablokowania zaworu. Piankę można aplikować wiele razy od momentu pierwszego zastosowania pianki.  Przechowywanie i odporność termiczna Pianka montażowa z aplikatorem Genius Gun marki Soudal może być przechowywana przez okres 18 miesięcy w zamkniętym opakowaniu, w chłodnym i suchym pomieszczeniu, w temperaturze od + 5°C do + 25°C. Pozostawienie niezabezpieczonej utwardzonej pianki spowoduje utratę jej właściwości izolacyjnych. Utwardzona pianka Soudal jest odporna na temperatury od - 40°C do + 100°C. Natomiast temperatura aplikacji powinna wynosić od -10°C do +30°C.', '', 'soudal-pianka-montazowa-z-aplikatorem-genius-gun-750-ml', '', '', '', 'Soudal Pianka montażowa z aplikatorem Genius Gun 750 ml', '', '', '', ''),
(59, 1, 1, '', '', 'krause-drabina-wielofunkcyjna-3x7-corda-tr-z-funkcja-ustawienia-na-schodach', '', '', '', 'KRAUSE Drabina wielofunkcyjna 3x7 CORDA TR z funkcją ustawienia na schodach', '', '', '', ''),
(60, 1, 1, 'Pianka montażowa poliuretanowa wielorazowego użytku, z aplikatorem Genius Gun, marki Soudal. Przeznaczona jest do różnego rodzaju prac budowlanych. Dzięki specjalnej formule o obniżonej rozprężalności, jest bezpieczna dla delikatnych elementów. Idealnie nadaje się do uszczelniania i łączenia drewnianych elementów w konstrukcjach szkieletowych, uszczelniania stolarki drzwiowej i okiennej, wygłuszania, uszczelniania oraz montażu parapetów, rolet, schodów, uszczelniania w systemach chłodzących, termoizolacji armatury łazienkowej, sieci wodnokanalizacyjnej itp. Charakteryzuje się tym, iż jest precyzyjna i oszczędna w aplikacji, istnieje możliwość przerwania pracy w dogodnym momencie. Wygodny uchwyt umożliwia pełną kontrolę ilości wypuszczanej z puszki pianki. Niewątpliwą zaletą pianki jest jej doskonała przyczepność do typowych podłoży budowlanych z drewna, PCV, betonu, cegły, powierzchni szkliwionych, aluminium i innych metali.', '', 'soudal-pianka-montazowa-z-aplikatorem-genius-gun-300-ml', '', '', '', 'Soudal Pianka montażowa z aplikatorem Genius Gun 300 ml', '', '', '', ''),
(61, 1, 1, 'Plandeka zielona 80 g/m2. Plandeka budowlana świetnie nada się do przykrywania oraz zabezpieczania powierzchni oraz różnego rodzaju przedmiotów. Została wykonana z polietylenu, dzięki czemu jest niezwykle trwała i zachowuje swoją funkcjonalność przez długi okres użytkowania. Wymiary: 2 m x 3 m. Posiada metalowe oczka do mocowania. Chroni powierzchnię oraz przedmioty w trakcie prac budowlanych oraz malarskich.', '', 'lux-plandeka-80-g-m2-zielona-2-m-x-3-m', '', '', '', 'LUX Plandeka 80 g/m2 zielona 2 m x 3 m', '', '', '', ''),
(62, 1, 1, 'Pianka izolacyjna Isoplus 750 mm Doskonałej jakości pianka izolacyjna która swoje zastosowanie znajdzie podczas izolacji ternicznych ścian, stropów, dachów sufitów podwieszanych i podłóg wewnątrz pomieszczeń. Pianka Isoplus cechuje ię łatwą aplikacją ( nie wymaga dodatkowego sprzętu, ani specjalnych umiejętności), odpornością na pękanie i kurczenie się i doskonałą przyczepnością do wszystkich materiałów budowlanych z wyjątkiem polietylenu, polipropylenu i teflonu.  Najważniejsze cechy: - Stosować w temperaturze od 5 do 40 stopni Celcjusza - Czas całkowitego utwardzenia wynosi od 12 do 24 godzin(W zależności od temperatury i wilgotności otoczenia) - Kolejne warstwy można nakładać po upływie 20 minut', '', 'pianka-iozuplus-izolacja-termiczna-750-ml', '', '', '', 'Pianka Iozuplus izolacja termiczna 750 ml', '', '', '', ''),
(63, 1, 1, 'LUX Plandeka 120 g/m2 w zielonym kolorze o wymiarach 6 x 8 m łączą ze sobą cechy lekkiej plandeki z dużą wytrzymałością i odpornością mechaniczną, jaką wyróżniają się plandeki ciężkie. Plandeka o gramaturze 120 g/m2 jest wykonana z polietylenu. Stanowi doskonały wybór do przykrycia przedmiotów bez wysiłku podczas rozpościerania plandeki.  Wodoszczelność i pyłoszczelność Wodoodporny materiał plandeki zapewnia niezawodną ochronę wielu przedmiotów. Można ją wykorzystać do przykrycia piaskownic, rowerów, pojazdów, przyczep, zabawek, mebli ogrodowych, drewna, materiałów budowlanych czy pojemników. Zielona plandeka LUX może być również używana profesjonalnie, na przykład jako ochrona przed wiatrem, słońcem podczas biwakowania.    Zmywalna i odporna na warunki atmosferyczne Wytrzymały polietylen zapewnia ochronę przed wilgocią, brudem i pleśnią. Plandeka jest zmywalna i odporna na warunki atmosferyczne. Trzeba jednak pamiętać, że nawet najmocniejsza plandeka nie jest przystosowana do warunków ekstremalnych, jakimi są np. silne porywy wiatru typu huragan i może zostać rozerwana.    Mocowanie za pomocą oczek Na krawędziach plandeki znajdują się metalowe oczka, które umożliwiają mocowanie za pomocą sznurka. Służą do zastosowań wewnątrz pomieszczenia, jak i na zewnątrz. Aby zielona plandeka 120g/m2 po rozłożeniu pozostała na swoim miejscu należy ją przymocować do podłoża. Montaż do podłoża zabezpiecza plandekę przed uniesieniem przez podmuchy wiatru.', '', 'lux-plandeka-120-g-m2-zielona-6-m-x-8-m', '', '', '', 'LUX Plandeka 120 g/m2 zielona, 6 m x 8 m', '', '', '', ''),
(64, 1, 1, '', '', 'krause-drabina-wielofunkcyjna-tribilo-3x14-monto', '', '', '', 'KRAUSE Drabina wielofunkcyjna Tribilo 3x14 MONTO', '', '', '', ''),
(65, 1, 1, 'Piana montażowa z aplikatorem Genius Gun 500ml + 20% gratis, marki Soudal.  Przeznaczona jest do różnego rodzaju prac budowlanych. Dzięki specjalnej formule o obniżonej rozprężalności, jest bezpieczna dla delikatnych elementów. Idealnie nadaje się do uszczelniania i łączenia drewnianych elementów w konstrukcjach szkieletowych, uszczelniania stolarki drzwiowej i okiennej, wygłuszania, uszczelniania oraz montażu parapetów, rolet, schodów, uszczelniania w systemach chłodzących, termoizolacji armatury łazienkowej, sieci wodnokanalizacyjnej itp. Charakteryzuje się tym, iż jest precyzyjna i oszczędna w aplikacji, istnieje możliwość przerwania pracy w dogodnym momencie. Wygodny uchwyt umożliwia pełną kontrolę ilości wypuszczanej z puszki pianki. Niewątpliwą zaletą pianki jest doskonała przyczepność do typowych podłoży budowlanych z drewna, PCV, betonu, cegły, powierzchni szkliwionych, aluminium i innych metali.  Oferta obowiązuje do 30.06.2021 r. lub do wyczerpania zapasów.', '', 'soudal-piana-montazowa-z-aplikatorem-genius-gun-500ml-20-gratis', '', '', '', 'Soudal Piana montażowa z aplikatorem Genius Gun 500ml + 20% gratis', '', '', '', ''),
(66, 1, 1, 'Drabina wielofunkcyjna 3 x 7 szczebli, firmy Skiva . Lekka, aluminiowa drabina wielofunkcyjna do wszechstronnych zastosowań. Może pełnić funkcję drabiny rozstawnej, przystawnej i wolnostojącej. Posiada hak zabezpieczający przed zsunięciem się wysuwanego elementu oraz system blokujący. Dolne końce podłużnic wyposażone są w antypoślizgowe stopki, gwarantujące pewne ustawienie. Drabina wielofunkcyjna 3 x 7 szczebli, firmy Skiva . Lekka, aluminiowa drabina wielofunkcyjna do wszechstronnych zastosowań. Może pełnić funkcję drabiny rozstawnej, przystawnej i wolnostojącej. Posiada hak zabezpieczający przed zsunięciem się wysuwanego elementu oraz system blokujący. Dolne końce podłużnic wyposażone są w antypoślizgowe stopki, gwarantujące pewne ustawienie.', '', 'skiva-drabina-wielofunkcyjna-3-x-7-szczebli', '', '', '', 'Skiva Drabina wielofunkcyjna 3 x 7 szczebli', '', '', '', ''),
(67, 1, 1, 'Pianka montażowa poliuretanowa z aplikatorem Genius Gun zimowa, marki Soudal. Przeznaczona jest do różnego rodzaju prac budowlanych. Dzięki specjalnej formule o obniżonej rozprężalności, jest bezpieczna dla delikatnych elementów. Idealnie nadaje się do uszczelniania i łączenia drewnianych elementów w konstrukcjach szkieletowych, uszczelniania stolarki drzwiowej i okiennej, wygłuszania, uszczelniania oraz montażu parapetów, rolet, schodów, uszczelniania w systemach chłodzących, termoizolacji armatury łazienkowej, sieci wodnokanalizacyjnej itp. Charakteryzuje się tym, iż jest precyzyjna i oszczędna w aplikacji, istnieje możliwość przerwania pracy w dogodnym momencie. Wygodny uchwyt pozwala na pełną kontrolę wypuszczanej pianki. Ze względu na swoją wyjątkową formułę, daje możliwość pracy w niskich temperaturach do -10 st.C. Niewątpliwą zaletą pianki jest wyjątkowo dobra przyczepność do podłoży z drewna, PCV, aluminium i innych metali.', '', 'soudal-pianka-montazowa-z-aplikatorem-genius-gun-zimowa-750-ml', '', '', '', 'Soudal Pianka montażowa z aplikatorem Genius Gun zimowa 750 ml', '', '', '', ''),
(68, 1, 1, 'Pianka montażowa pistoletowa Okna &amp; Drzwi marki Soudal jest przeznaczona do wszelkich prac wykończeniowych instalacyjnych w temperaturze powyżej 0°C. Pianka poliuretanowa charakteryzuje się obniżoną rozprężalnością, krótkim czasem utwardzania i przyczepnością do większości materiałów budowlanych, takich jak: cegła, beton, kamień, tynk, drewno, PCV, aluminium. Sprawdzi się jako materiał termoizolacyjny i dźwiękoszczelny do prac montażowych i wykończeniowych.    Zastosowanie Pianka montażowa Soudal uszczelnia ościeżnice okienne i drzwiowe, parapety, stopnie schodów, rolety, złącza dachowe, ścienne i stropowe. Łączy prefabrykowane elementy drewniane w konstrukcjach szkieletowych, a także wypełnia przepusty rurowe. Stanowi też izolację elementów instalacji c.o. i wodnokanalizacyjnych oraz izolację termiczną dachów i stropodachów.  Przechowywanie i odporność termiczna Pianka montażowa pistoletowa Okna &amp; Drzwi marki Soudal może być przechowywana przez okres 24 miesięcy w zamkniętym opakowaniu, w chłodnym i suchym pomieszczeniu, w temperaturze od + 5°C do + 25°C. Utwardzona pianka Soudal jest odporna na temperatury od - 40°C do + 100°C. Natomiast temperatura aplikacji powinna wynosić od +5°C do +35°C.', '', 'soudal-pianka-montazowa-pistoletowa-okna-drzwi-750-ml', '', '', '', 'Soudal Pianka montażowa pistoletowa Okna & Drzwi 750 ml', '', '', '', ''),
(69, 1, 1, 'LUX Plandeka 120 g/m2 w białym kolorze o wymiarach 3 x 4 m łączą ze sobą cechy lekkiej plandeki z dużą wytrzymałością i odpornością mechaniczną, jaką wyróżniają się plandeki ciężkie. Plandeka o gramaturze 120 g/m2 jest wykonana z polietylenu. Stanowi doskonały wybór do przykrycia przedmiotów bez wysiłku podczas rozpościerania plandeki.  Wodoszczelność i pyłoszczelność Wodoodporny materiał plandeki zapewnia niezawodną ochronę wielu przedmiotów. Można ją wykorzystać do przykrycia piaskownic, rowerów, pojazdów, przyczep, zabawek, mebli ogrodowych, drewna, materiałów budowlanych czy pojemników. Biała plandeka LUX może być również używana profesjonalnie, na przykład jako ochrona przed wiatrem, słońcem podczas biwakowania.  Zmywalna i odporna na warunki atmosferyczne Wytrzymały polietylen zapewnia ochronę przed wilgocią, brudem i pleśnią. Plandeka jest zmywalna i odporna na warunki atmosferyczne. Trzeba jednak pamiętać, że nawet najmocniejsza plandeka nie jest przystosowana do warunków ekstremalnych, jakimi są np. silne porywy wiatru typu huragan i może zostać rozerwana.  Mocowanie za pomocą oczek Na krawędziach plandeki znajdują się metalowe oczka, które umożliwiają mocowanie za pomocą sznurka. Służą do zastosowań wewnątrz pomieszczenia, jak i na zewnątrz. Aby biała plandeka 120g/m2 po rozłożeniu pozostała na swoim miejscu należy ją przymocować do podłoża. Montaż do podłoża zabezpiecza plandekę przed uniesieniem przez podmuchy wiatru.', '', 'lux-plandeka-120-g-m2-biala-3-m-x-4-m', '', '', '', 'LUX Plandeka 120 g/m2 biała, 3 m x 4 m', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(70, 1, 1, 'Druga kondygnacja rusztowania Clim Tec marki Krause to lekkie rusztowanie wykonane z aluminium. Jest doskonałe do prac remontowych i modernizacji wewnątrz i na zewnątrz budynków. Rusztowanie kolumnowe zapewnia komfort i stabilność pracy na wysokościach.    Rusztowanie kolumnowe Rusztowanie kolumnowe składa się z podstawy i 2 kondygnacji. Podstawa rusztowania umożliwia prace na wysokości 3 metrów i stanowi bazowy element rusztowania kolumnowego, do którego montuje się kolejne kondygnacje. Pierwsza kondygnacja rusztowania zwiększa wysokość roboczą na 5 metrów. Kondygnacja druga to ostatni, najwyższy element pełnej konstrukcji, który pozwala pracować na wysokości 7 metrów.  Podstawę rusztowania Clim Tec wraz z pierwszą kondygnacją należy dokupić osobno.    Lekkie rusztowanie aluminiowe Aluminium to lekkie tworzywo, dzięki czemu łatwo podnieść bądź przestawić rusztowanie w dowolne miejsce. Pełna konstrukcja: podstawa + pierwsza kondygnacja + druga kondygnacja są wykonane z tego samego materiału. Podstawę można doposażyć wzestaw rolek jezdnych, dzięki którym rusztowanie staje się mobilne. Rolki należy dokupić osobno. Połączone ze sobą elementy można bez problemu przesuwać bez konieczności demontażu wyższych kondygnacji. Jest to doskonałe rozwiązanie do remontów i modernizacji dachów czy elewacji. Ponadto konstrukcja Clim Tec może być stosowana także na schodach lub stopniach.    Bezpieczeństwo i stabilność Rusztowanie jest wyposażone w pomost z możliwością regulacji wysokości. Możliwość przestawiania wysokości pomostu co szczebel gwarantuje brak problemów przy kompensowaniu różnic wysokości podłoża, np. na schodach lub innych nierównościach. Szczeble zamontowane w pionowej ramie od wewnętrznej strony rusztowania są antypoślizgowe i profilowane, co zapewnia bezpieczeństwo podczas wchodzenia na rusztowanie. Ponadto podstawa rusztowania jest stabilna, dzięki ramie zaprojektowanej w kształcie litery V, która zwiększa powierzchnię podparcia i znacząco poprawia stabilność pełnej konstrukcji. Dlatego pracując na wysokości 7 metrów, możesz czuć się bezpiecznie. Dla jeszcze większego bezpieczeństwa i poprawy komfortu stabilnej pracy można doposażyć rusztowanie w podporę do rusztowania Clim Tec. Aluminiowe rusztowanie wyposażono w specjalne połączenia zaciskowe oraz nasadzane elementy ram, co przyśpiesza i ułatwia montaż bez użycia narzędzi. Maksymalne obciążenie rusztowania wynosi 200 kg/m2. Rusztowanie Krause Clim Tec jest zgodne z normą PN EN 1004-1 i atestowane przez TUV. Producent udziela 2 lat gwarancji.', '', 'krause-aluminiowe-rusztowanie-robocze-clim-tec-2-kondygnacja-7-m', '', '', '', 'Krause Aluminiowe rusztowanie robocze Clim Tec 2. kondygnacja 7 m', '', '', '', ''),
(71, 1, 1, '', '', 'krause-drabina-wielofunkcyjna-tribilo-3x10-monto', '', '', '', 'KRAUSE Drabina wielofunkcyjna Tribilo 3x10 MONTO', '', '', '', ''),
(72, 1, 1, 'Worek na gruz, marki Fola. Wykonany z polipropylenu mocny worek o ładowności 50 kg. Przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych. Idealny również do pakowania piasku, ziemi, drewna, węgla, miału, brykietów, ziemniaków, warzyw i owoców.', '', 'fola-worek-na-gruz-65-cm-x-105-cm', '', '', '', 'Fola Worek na gruz 65 cm x 105 cm', '', '', '', ''),
(73, 1, 1, 'Jednoskładnikowa pistoletowa biała piana poliuretanowa firmy Ceresit o pojemności 750 ml. 4 x bardziej zwarta struktura zwiększa własciwości termoizolacyjne i dźwiękoszczelne. Optymalna niskoprężność zabezpiecza min. przed wypaczaniem profili drzwi i okien Pianka zapewnia zwiększenie dźwiękoszczelności nawet do -63 dB. Produkt wyróznia się wysoką elastycznością oraz 4 x większą odpornościa na promienie UV.', '', 'ceresit-piana-whiteteq-pistoletowa-750-ml', '', '', '', 'Ceresit Piana Whiteteq pistoletowa, 750 ml', '', '', '', ''),
(74, 1, 1, 'LUX Plandeka 120 g/m2 w zielonym kolorze o wymiarach 4 x 6 m łączą ze sobą cechy lekkiej plandeki z dużą wytrzymałością i odpornością mechaniczną, jaką wyróżniają się plandeki ciężkie. Plandeka o gramaturze 120 g/m2 jest wykonana z polietylenu. Stanowi doskonały wybór do przykrycia przedmiotów bez wysiłku podczas rozpościerania plandeki.  Wodoszczelność i pyłoszczelność Wodoodporny materiał plandeki zapewnia niezawodną ochronę wielu przedmiotów. Można ją wykorzystać do przykrycia piaskownic, rowerów, pojazdów, przyczep, zabawek, mebli ogrodowych, drewna, materiałów budowlanych czy pojemników. Zielona plandeka LUX może być również używana profesjonalnie, na przykład jako ochrona przed wiatrem, słońcem podczas biwakowania.    Zmywalna i odporna na warunki atmosferyczne Wytrzymały polietylen zapewnia ochronę przed wilgocią, brudem i pleśnią. Plandeka jest zmywalna i odporna na warunki atmosferyczne. Trzeba jednak pamiętać, że nawet najmocniejsza plandeka nie jest przystosowana do warunków ekstremalnych, jakimi są np. silne porywy wiatru typu huragan i może zostać rozerwana.    Mocowanie za pomocą oczek Na krawędziach plandeki znajdują się metalowe oczka, które umożliwiają mocowanie za pomocą sznurka. Służą do zastosowań wewnątrz pomieszczenia, jak i na zewnątrz. Aby zielona plandeka 120g/m2 po rozłożeniu pozostała na swoim miejscu należy ją przymocować do podłoża. Montaż do podłoża zabezpiecza plandekę przed uniesieniem przez podmuchy wiatru.', '', 'lux-plandeka-120-g-m2-zielona-4-m-x-6-m', '', '', '', 'LUX Plandeka 120 g/m2 zielona, 4 m x 6 m', '', '', '', ''),
(75, 1, 1, 'LUX Plandeka 120 g/m2 w zielonym kolorze o wymiarach 3 x 5 m łączą ze sobą cechy lekkiej plandeki z dużą wytrzymałością i odpornością mechaniczną, jaką wyróżniają się plandeki ciężkie. Plandeka o gramaturze 120 g/m2 jest wykonana z polietylenu. Stanowi doskonały wybór do przykrycia przedmiotów bez wysiłku podczas rozpościerania plandeki.  Wodoszczelność i pyłoszczelność Wodoodporny materiał plandeki zapewnia niezawodną ochronę wielu przedmiotów. Można ją wykorzystać do przykrycia piaskownic, rowerów, pojazdów, przyczep, zabawek, mebli ogrodowych, drewna, materiałów budowlanych czy pojemników. Zielona plandeka LUX może być również używana profesjonalnie, na przykład jako ochrona przed wiatrem, słońcem podczas biwakowania.    Zmywalna i odporna na warunki atmosferyczne Wytrzymały polietylen zapewnia ochronę przed wilgocią, brudem i pleśnią. Plandeka jest zmywalna i odporna na warunki atmosferyczne. Trzeba jednak pamiętać, że nawet najmocniejsza plandeka nie jest przystosowana do warunków ekstremalnych, jakimi są np. silne porywy wiatru typu huragan i może zostać rozerwana.    Mocowanie za pomocą oczek Na krawędziach plandeki znajdują się metalowe oczka, które umożliwiają mocowanie za pomocą sznurka. Służą do zastosowań wewnątrz pomieszczenia, jak i na zewnątrz. Aby zielona plandeka 120g/m2 po rozłożeniu pozostała na swoim miejscu należy ją przymocować do podłoża. Montaż do podłoża zabezpiecza plandekę przed uniesieniem przez podmuchy wiatru.', '', 'lux-plandeka-120-g-m2-zielona-3-m-x-5-m', '', '', '', 'LUX Plandeka 120 g/m2 zielona, 3 m x 5 m', '', '', '', ''),
(76, 1, 1, 'Rusztowanie bazowe Clim Tec marki Krause to lekkie rusztowanie wykonane z aluminium. Jest doskonałe do prac remontowych i modernizacji wewnątrz i na zewnątrz budynków. Rusztowanie aluminiowe zapewnia komfort i stabilność pracy na wysokościach.  Rusztowanie aluminiowe Podstawa rusztowania Krause Clim Tec jest doskonałym rozwiązaniem do remontów i modernizacji wnętrz. Ponadto konstrukcja Clim Tec może być stosowana także na schodach lub stopniach. Ponadto do podstawy można osobno dokupić zestaw rolek jezdnych, dzięki którym rusztowanie staje się mobilne. To pozwala z łatwością ustawić rusztowanie w dowolnym miejscu i przesuwać je przez otwory drzwiowe.  Bezpieczeństwo i stabilność Rusztowanie jest wyposażone w pomost z możliwością regulacji wysokości. Możliwość przestawiania wysokości pomostu co szczebel gwarantuje brak problemów przy kompensowaniu różnic wysokości podłoża, np. na schodach lub innych nierównościach. Szczeble zamontowane w pionowej ramie od wewnętrznej strony rusztowania są antypoślizgowe i profilowane, co zapewnia bezpieczeństwo podczas wchodzenia na rusztowanie. Ponadto rama podstawy została zaprojektowana z myślą o stabilności. Dolna część ramy jest w kształcie litery V, co zwiększa powierzchnię podparcia. Ponadto aluminiowe rusztowanie wyposażono w specjalne połączenia zaciskowe oraz nasadzane elementy ram, co przyśpiesza i ułatwia montaż bez użycia narzędzi. Maksymalne obciążenie rusztowania wynosi 200 kg/m2. Rusztowanie Krause Clim Tec jest zgodne z normą PN EN 1004-1 i atestowane przez TUV. Producent udziela 2 lat gwarancji.   Rusztowanie kolumnowe Rusztowanie kolumnowe składa się z podstawy i 2 kondygnacji. Podstawa rusztowania umożliwia prace na wysokości 3 metrów. Kolejnymi elementami do kupienia osobno są 1 i 2 kondygnacja rusztowania kolumnowego. Pierwsza kondygnacja rusztowania zwiększa wysokość roboczą na 5 metrów, a kondygnacja druga pozwala pracować na wysokości 7 metrów.', '', 'krause-rusztowanie-bazowe-clim-tec', '', '', '', 'Krause Rusztowanie bazowe Clim Tec', '', '', '', ''),
(77, 1, 1, 'Betoniarka SB-100 o mocy 550 W, marki Skiva to wolnospadowa betoniarka bębnowa o napędzie elektrycznym, która jest przeznaczona do produkcji mieszanek betonowych o konsystencji ciekłej, półciekłej i plastycznej oraz zapraw cementowych i cementowo-wapiennych. Może być używana również do mieszania materiałów sypkich. Jest niezbędnym sprzętem podczas drobnych i średnich prac remontowo-budowlanych.    Pojemność zbiornika i prędkość obrotowa Skiva Betoniarka SB-100 posiada wieniec wykonany z żeliwa o wysokiej klasie ścieralności oraz koło o średnicy 52 cm, które umożliwia przechył bębna. Prędkość obrotowa wynosi 32 rpm, a pojemność robocza 85 l. Betoniarka SB-100 o mocy 550 W waży 44 kg. Zbiornik mieści 100 l, z czego pojemność mieszania to 80 l. Natężenie hałasu podczas prac z betoniarką wynosi 82 dB.  Mobilność Konstrukcja betoniarki SB-100 550 W marki Skiva jest stabilna. Sprzęt u podstawy z jednej strony jest zakończony podpórką, zapewniającą stabilność. Natomiast z drugiej posiada 2 koła, które zapewniają mobilność. Mobilność nie tylko ułatwia dowolne ustawienie betoniarki, ale również transport. Wystarczy unieść betoniarkę za pomocą uchwytu i przesunąć sprzęt.', '', 'skiva-betoniarka-sb-100-550-w', '', '', '', 'Skiva Betoniarka SB-100 550 W', '', '', '', ''),
(78, 1, 1, 'Taczka spawana SPC-T2, firmy Skiva. Taczka jest niezawodnym pomocnikiem zarówno na budowie jak i w ogrodzie. Posiada wygodne uchwyty transportowe a koryto wykonane ze stali o grubości 2 mm, spawana, zapewnia wysoką trwałość. Pojemność taczki wynosi 90L, posiada koło pompowane na łożysku co zwiększa wygodę użytkowania.', '', 'skiva-taczka-spawana-spc-t2-90-l', '', '', '', 'Skiva Taczka spawana SPC-T2 90 L', '', '', '', ''),
(79, 1, 1, 'Płyn czyszczący do pianki i pistoletów Gun &amp; Foam, marki Soudal. Jest to gotowy do użycia, skuteczny płyn do czyszczenia pistoletów aplikacyjnych do pianki poliuretanowej. Opakowanie wyposażone zostało w standardowy gwint lub złącze typu click, które pozwala na czyszczenie standardowych pistoletów do pianki oraz gniazda i zaworu puszki. Płyn skutecznie i szybko usuwa też, świeże zbrudzenia nieutwardzonej pianki z rąk, narzędzi oraz tworzyw sztucznych odpornych na rozpuszczalniki. Może być również stosowany do odtłuszczania powierzchni metalowych, przed zastosowaniem poliuretanów.', '', 'soudal-plyn-czyszczacy-gun-foam-cleaner-500-ml', '', '', '', 'Soudal Płyn czyszczący Gun & Foam Cleaner 500 ml', '', '', '', ''),
(80, 1, 1, 'Pierwsza kondygnacja rusztowania Clim Tec marki Krause to lekkie rusztowanie wykonane z aluminium. Jest doskonałe do prac remontowych i modernizacji wewnątrz i na zewnątrz budynków. Rusztowanie kolumnowe zapewnia komfort i stabilność pracy na wysokościach.  Rusztowanie kolumnowe Rusztowanie kolumnowe składa się z podstawy i 2 kondygnacji. Podstawa rusztowania umożliwia prace na wysokości 3 metrów i stanowi bazowy element rusztowania kolumnowego, do którego montuje się kolejne kondygnacje. Pierwsza kondygnacja rusztowania zwiększa wysokość roboczą na 5 metrów, a kondygnacja druga pozwala pracować na wysokości 7 metrów.  Zarówno podstawę rusztowania Clim Tec, jak i druga kondygnację należy dokupić osobno.    Lekkie rusztowanie aluminiowe Aluminium to lekkie tworzywo, dzięki czemu łatwo podnieść bądź przestawić rusztowanie w dowolne miejsce. Podstawa połączona z pierwszą kondygnacją są wykonane z tego samego materiału, więc rusztowanie w pełnej konstrukcji wciąż pozostaje lekkie. Jest to doskonałe rozwiązanie do remontów i modernizacji wnętrz. Ponadto konstrukcja Clim Tec może być stosowana także na schodach lub stopniach.    Bezpieczeństwo i stabilność Rusztowanie jest wyposażone w pomost z możliwością regulacji wysokości. Możliwość przestawiania wysokości pomostu co szczebel gwarantuje brak problemów przy kompensowaniu różnic wysokości podłoża, np. na schodach lub innych nierównościach. Szczeble zamontowane w pionowej ramie od wewnętrznej strony rusztowania są antypoślizgowe i profilowane, co zapewnia bezpieczeństwo podczas wchodzenia na rusztowanie. Ponadto podstawa rusztowania jest stabilna, dzięki ramie zaprojektowanej w kształcie litery V, która zwiększa powierzchnię podparcia i znacząco poprawia stabilność pełnej konstrukcji. Dlatego pracując na wysokości 5 metrów, możesz czuć się bezpiecznie. Dla jeszcze większego bezpieczeństwa i poprawy komfortu stabilnej pracy można doposażyć rusztowanie w podporę do rusztowania Clim Tec. Aluminiowe rusztowanie wyposażono w specjalne połączenia zaciskowe oraz nasadzane elementy ram, co przyśpiesza i ułatwia montaż bez użycia narzędzi. Maksymalne obciążenie rusztowania wynosi 200 kg/m2. Rusztowanie Krause Clim Tec jest zgodne z normą PN EN 1004-1 i atestowane przez TUV. Producent udziela 2 lat gwarancji.', '', 'krause-aluminiowe-rusztowanie-robocze-clim-tec-1-kondygnacja-5-m', '', '', '', 'Krause Aluminiowe rusztowanie robocze Clim Tec 1. kondygnacja 5 m', '', '', '', ''),
(81, 1, 1, 'LUX Plandeka 80 g/m2 w zielonym kolorze o wymiarach 3 x 4 m łączą ze sobą cechy lekkiej plandeki z dużą wytrzymałością i odpornością mechaniczną, jaką wyróżniają się plandeki ciężkie. Plandeka o gramaturze 80 g/m2 jest wykonana z polietylenu. Stanowi doskonały wybór do przykrycia przedmiotów bez wysiłku podczas rozpościerania plandeki.  Wodoszczelność i pyłoszczelność Wodoodporny materiał plandeki zapewnia niezawodną ochronę wielu przedmiotów. Można ją wykorzystać do przykrycia piaskownic, rowerów, pojazdów, przyczep, zabawek, mebli ogrodowych, drewna, materiałów budowlanych czy pojemników. Zielona plandeka LUX może być również używana profesjonalnie, na przykład jako ochrona przed wiatrem, słońcem podczas biwakowania.    Zmywalna i odporna na warunki atmosferyczne Wytrzymały polietylen zapewnia ochronę przed wilgocią, brudem i pleśnią. Plandeka jest zmywalna i odporna na warunki atmosferyczne. Trzeba jednak pamiętać, że nawet najmocniejsza plandeka nie jest przystosowana do warunków ekstremalnych, jakimi są np. silne porywy wiatru typu huragan i może zostać rozerwana.    Mocowanie za pomocą oczek Na krawędziach plandeki znajdują się metalowe oczka, które umożliwiają mocowanie za pomocą sznurka. Służą do zastosowań wewnątrz pomieszczenia, jak i na zewnątrz. Wymiary plandeki wynoszą 3 x 4 m, dzięki czemu z łatwością pokryje nawet duże powierzchnie. Aby zielona plandeka 80g/m2 po rozłożeniu pozostała na swoim miejscu należy ją przymocować do podłoża. Montaż do podłoża zabezpiecza plandekę przed uniesieniem przez podmuchy wiatru.', '', 'lux-plandeka-80-g-m2-zielona-3-m-x-4-m', '', '', '', 'LUX Plandeka 80 g/m2 zielona, 3 m x 4 m', '', '', '', ''),
(82, 1, 1, 'Drewniana drabina wykonana z litego drewna sosnowego. Idealna na czas remontów i prac domowych. Dodatkowym atutem jes tmechanizm zabezpieczający przed rozsunięciem, pozwalający na bezpieczną i komfortową pracę.', '', 'drabina-drewniana-2-elementowa-2-x-5', '', '', '', 'Drabina drewniana 2 elementowa 2 x 5', '', '', '', ''),
(83, 1, 1, 'Pianka montażowa pistoletowa zimowa, marki Soudal. Jest to, profesjonalna, wysokowydajna, pianka poliuretanowa o obniżonej rozprężalności. Pianka polecana jest do wszelkich prac wykończeniowych i instalacyjnych. Dzięki specjalnej formule jest bezpieczna dla delikatnych elementów. Charakteryzuje się tym, iż jest precyzyjna i oszczędna w aplikacji, istnieje możliwość przerwania pracy w dogodnym momencie. Ze względu na swoją wyjątkową formułę, daje możliwość pracy w niskich temperaturach. Niewątpliwą zaletą pianki jest, krótki czas utwardzania.', '', 'soudal-pianka-montazowa-pistoletowa-okna-drzwi-zimowa-750-ml', '', '', '', 'Soudal Pianka montażowa pistoletowa Okna & Drzwi zimowa 750 ml', '', '', '', ''),
(84, 1, 1, 'Zestaw rolek jezdnych Krause ClimTec, 4 sztuki. Rolki o średnicy 125 mm z regulowaną wysokością w zakresie 150 mm do rusztowania Krause ClimTec. Rusztowanie wyposażone w rolki jezdne może być przesuwane w stanie zmontowanym. Umożliwia to łatwe i szybkie zmienianie stanowiska pracy, co znacznie przyspiesza czas i ułatwia prace remontowe, malarskie czy ogrodnicze.', '', 'zestaw-rolek-jezdnych-krause-climtec', '', '', '', 'Zestaw rolek jezdnych Krause ClimTec', '', '', '', ''),
(85, 1, 1, 'Mini rusztowanie Corda marki Krause jest sprzętem używanym przez profesjonalistów z branży budowlanej. Mini rusztowanie sprawdza się doskonale podczas wszelkich domowych remontów, pracach wykończeniowych oraz konserwatorskich. Sprawdzi się zarówno w pomieszczeniach, jak i przy pracach na świeżym powietrzu. Mini rusztowanie Corda można ustawiać na stopniach schodów, podmurówkach oraz innych nierównościach.    Antypoślizgowa platforma Mini rusztowanie Krause pozwala na komfortową pracę. Składa się z 2 siedmioszczeblowych drabin, poprzeczek oraz platformy. Platforma wykonana z sitodrukowo naniesionej żywicy fenolowej jest odporna na wilgoć i antypoślizgowa, co zwiększa bezpieczeństwo użytkownika. Komfort oraz bezpieczeństwo bezpośrednio wpływają na szybkość pracy.  Mobilność rusztowania Praca na wysokościach jest łatwiejsza, kiedy bez problemu można dotrzeć do trudno dostępnych miejsc. Jedna z dwóch drabin została wyposażona w kółka, które zwiększają mobilność mini rusztowania Krause. Przesunięcie sprzętu w dowolne miejsce nie wymaga demontażu. Mini rusztowanie wyróżnia się wytrzymałością i nośnością, dzięki wykonaniu z aluminium. Ponadto niewielkie rozmiary złożonego mini rusztowania pozwalają na zmieszczenie się w większości otworów wejściowych.  Wysokość robocza i obciążenie Aluminiowe mini rusztowanie Corda marki Krause o stabilnej konstrukcji umożliwia maksymalny zasięg prac na wysokości 3 m. Sprzęt można szybko i łatwo zmontować bez użycia narzędzi. Maksymalne dopuszczalne obciążenie rusztowania wynosi 150 kg. Producent udziela 2 lat gwarancji na mini rusztowanie Corda Krause.', '', 'krause-mini-rusztowanie-corda', '', '', '', 'Krause Mini rusztowanie Corda', '', '', '', ''),
(86, 1, 1, 'Worek na gruz Big Bag. Wykonany z polipropylenu mocny worek o ładowności 1000 kg i o uniwersalnym zastosowaniu. Przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych (w tym szkła). Idealny również do pakowania piasku, ziemi, drewna, węgla, miału, brykietów, ziemniaków, warzyw i owoców.', '', 'worek-na-gruz-big-bag-91-x-91-x-120-cm', '', '', '', 'Worek na gruz Big Bag 91 x 91 x 120 cm', '', '', '', ''),
(87, 1, 1, 'Pianka montażowa poliuretanowa, pistoletowa Soudafoam low expansion, marki Soudal. Charakteryzuje się doskonałą przyczepnością do typowych podłoży budowlanych, takich jak: beton, cegły, kamień, PCV, aluminium, drewno itp. Piankę cechuje krótki czas tworzenia naskórka i utwardzania, co znacznie ułatwia pracę i daje pełną kontrolę dozowania. Niskorozprężna formuła pianki, daje gwarancję bezpieczeństwa dla delikatnych elementów, ponieważ kontrolowane zwiększanie objętości eliminuje prawdopodobieństwo pojawienia się deformacji. Dużym udogodnieniem jest szybkie i pewne mocowanie bagnetowe puszki w gnieździe pistoletu. Pianka zapewnia m.in.: idealne uszczelnianie, wygłuszanie i wypełnianie pustych przestrzeni w konstrukcjach szkieletowych oraz najwyższą izolacyjność termiczną i akustyczną nawet do 58 dB. Dodatkową zaletą pianki jest to, iż nie zawiera gazów szkodliwych dla warstwy ozonowej.', '', 'soudal-pianka-montazowa-pistoletowa-soudafoam-low-expansion-750-ml', '', '', '', 'Soudal Pianka montażowa pistoletowa Soudafoam Low Expansion 750 ml', '', '', '', ''),
(88, 1, 1, 'Pianka montażowa pistoletowa Soudafoam Maxi, marki Soudal. Jest to ekonomiczna, wydajna piana montażowo - uszczelniająca, z opatentowanym bagnetowym systemem Click&amp;Fix. Charakteryzuje się doskonałą przyczepnością do typowych podłoży budowlanych, takich jak: beton, cegły, kamień, PCV, aluminium, drewno itp. Idealnie nadaje się do uszczelniania, wypełniania. Gwarantuje też wysoką izolacyjność termiczno - akustyczną. Dodatkowe zalety pianki to krótki czas utwardzania i precyzyjność dozowania.', '', 'soudal-pianka-montazowa-pistoletowa-soudafoam-maxi-870-ml', '', '', '', 'Soudal Pianka montażowa pistoletowa Soudafoam Maxi 870 ml', '', '', '', ''),
(89, 1, 1, 'Betoniarka MIX-130ŻKE o mocy 550 W marki Altrad Poland to wolnospadowa betoniarka bębnowa o napędzie elektrycznym, która jest przeznaczona do produkcji mieszanek betonowych o konsystencji ciekłej, półciekłej i plastycznej oraz zapraw cementowych i cementowo-wapiennych. Może być używana również do mieszania materiałów sypkich.    Pojemność zbiornika i prędkość obrotowa Betoniarka MIX-130ŻKE o mocy 550 W marki Altrad Poland posiada wieniec wykonany z żeliwa o wysokiej klasie ścieralności oraz koło z hamulcem nożnym, które umożliwia przechył bębna. Betoniarka MIX-130ŻKE o mocy 550 W waży 50 kg. Zbiornik mieści 130 l, z czego pojemność mieszania to 100 l. Układ przenoszenia napędu o zasilaniu 230 V zapewnia doskonałą trakcję oraz redukcję hałasu.  Mobilność Konstrukcja betoniarki MIX-130ŻKE jest stabilna. Sprzęt u podstawy z jednej strony jest zakończony podpórką, zapewniającą stabilność. Natomiast z drugiej posiada 2 koła, które zapewniają mobilność. Mobilność nie tylko ułatwia dowolne ustawienie betoniarki, ale również transport. Wystarczy unieść betoniarkę za pomocą uchwytu i przesunąć sprzęt.', '', 'altrad-poland-betoniarka-mix-130-zke-550-w', '', '', '', 'Altrad Poland Betoniarka MIX-130/ŻKE 550 W', '', '', '', ''),
(90, 1, 1, 'Pianka montażowa Soudafoam EX-TRA 66, marki Soudal. Jest to wężykowa pianka montażowa o wysokiej wydajności. Dzięki specjalnej budowie aplikatora wężykowego oraz nowoczesnej formule chemicznej, jest łatwa w aplikacji nawet dla niedoświadczonych osób. Specjalny aplikator z końcówką spieniającą znacznie ułatwia pracę w miejscach trudno dostępnych. Piankę charakteryzuje niskorozprężna formuła, dająca gwarancję bezpieczeństwa dla delikatnych elementów, ponieważ kontrolowane zwiększanie objętości eliminuje prawdopodobieństwo pojawienia się deformacji. Dzięki swoim właściwościom, ma doskonałą przyczepność do typowych podłoży budowlanych, takich jak: PCV, drewno, materiały drewnopodobne, aluminium i inne metale, beton, cegła, powierzchnie szkliwione itp. Pianka idealnie nadaje się do: wygłuszania i wypełniania pustych przestrzeni w konstrukcjach szkieletowych, izolacji termicznej i akustycznej, uszczelniania stolarki okiennej i drzwiowej, parapetów, schodów itp.', '', 'soudal-pianka-montazowa-wezykowa-soudafoam-ex-tra-66-750-ml', '', '', '', 'Soudal Pianka montażowa wężykowa Soudafoam EX-TRA 66 750 ml', '', '', '', ''),
(91, 1, 1, 'Pianka montażowa Soudafoam 2K, marki Soudal. Jest to specjalistyczna, dwuskładnikowa pianka poliuretanowa o wysokiej gęstości i wytrzymałości mechanicznej. Charakteryzuje się doskonalą przyczepnością do typowych podłoży budowlanych, takich jak: beton, cegły, kamień, PCV, aluminium, drewno, powierzchni szkliwionych itp. Piankę cechuje bardzo krótki czas utwardzania, dalsza obróbka możliwa jest już po 30 minutach. Pianka zapewnia m.in.: idealne uszczelnianie podczas montażu parapetów, rolet, ościeżnic okiennych i drzwiowych, schodów, wygłuszanie i wypełnianie ścian działowych, izolację i wypełnianie przepustów kablowych i rurowych, wypełnianie przestrzeni zamkniętych bez dostępu wilgoci oraz izolację termiczną i akustyczną podłóg, poddaszy, systemów klimatyzacyjnych, dachów. Dzięki specjalnej budowie aplikatora wężykowego jest łatwa w aplikacji nawet dla niedoświadczonych osób. Niewątpliwą zaletą pianki jest duża gęstość i sztywność, dzięki czemu może być stosowana do montażu stolarki wewnętrznej, bez użycia łączników mechanicznych.', '', 'soudal-pianka-montazowa-wezykowa-soudafoam-2k-400-ml', '', '', '', 'Soudal Pianka montażowa wężykowa Soudafoam 2K 400 ml', '', '', '', ''),
(92, 1, 1, 'Podest z blachy perforowanej 12-A/B, firmy Rew-Ton. Element konstrukcyjny rusztowania kolumnowego typu warszawskiego 1-A/B. Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak i wewnątrz budynków. Umożliwia wykonywanie prac na wysokości do 8,2 m. Jest przejezdne, bezpieczne, łatwe i szybkie w montażu. Odznacza się lekkością konstrukcji. Wymiary podestu: 160 cm x 30 cm, waga 8 kg.', '', 'rew-ton-podest-z-blachy-perforowanej-12-a-b', '', '', '', 'Rew-Ton Podest z blachy perforowanej 12-A/B', '', '', '', ''),
(93, 1, 1, 'Worek na gruz Big Bag, marki Fola. Wykonany z poliestru mocny worek o ładowności 1000 kg i o uniwersalnym zastosowaniu. Przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych. Idealny również do pakowania piasku, ziemi, drewna, węgla, miału, brykietów, ziemniaków, warzyw i owoców.', '', 'fola-worek-na-gruz-big-bag-91-cm-x-91-cm-x-120-cm', '', '', '', 'Fola Worek na gruz Big Bag 91 cm x 91 cm x 120 cm', '', '', '', ''),
(94, 1, 1, 'Niskorozprężna superelastyczna pistoletowa pianka montażowo-uszczelniająca nowej generacji. Formuła umożliwia pracę w zakresie temperatur od -10°C do +30°C Uwaga! Piana o kolorze niebieskim', '', 'soudal-flexifoam-pianka-superelastyczna-750-ml', '', '', '', 'Soudal Flexifoam - pianka superelastyczna 750 ml', '', '', '', ''),
(95, 1, 1, 'Drabina przegubowa Corda 4x3 z platformą firmy Krause.  Aluminiowa drabina wielofunkcyjna, do użytku jako drabina przystawna, dwustronna wolnostojąca i pomost roboczy. Podstawy drabiny zakończone są szerokimi, mocnymi stabilizatorami z antypoślizgowymi stopami, zapewniającymi sztywne ustawienie, bez wahań i przechyłów. Stopki dwukomponentowe skutecznie utrzymują drabinę w miejscu. Budowa 4 elementowa pozwoliła na zachowanie kompaktowych wymiarów podczas transportu oraz dużego zasięgu pracy przy maksymalnym rozłożeniu drabiny. Wysokość rozłożonej drabiny przystawnej: 3,5 m. Wysokość drabiny wolnostojącej: 1,7 m. Maksymalne obciążenie: 150 kg.', '', 'krause-drabina-przegubowa-z-platforma-corda-4x3', '', '', '', 'Krause Drabina przegubowa z platformą Corda 4x3', '', '', '', ''),
(96, 1, 1, 'Betoniarka B1610 o mocy 1000 W marki Altrad to wolnospadowa betoniarka bębnowa o napędzie elektrycznym, która jest przeznaczona do produkcji mieszanek betonowych o konsystencji ciekłej, półciekłej i plastycznej oraz zapraw cementowych i cementowo-wapiennych. Może być używana również do mieszania materiałów sypkich.   br&gt;Pojemność zbiornika i prędkość obrotowa Betoniarka B1610 o mocy 1000 W marki Altrad posiada wieniec wykonany z żeliwa o wysokiej klasie ścieralności oraz koło, które umożliwia przechył bębna. Betoniarka B1610 o mocy 1000 W waży 56 kg. Zbiornik mieści 160 l, z czego pojemność mieszania to 130 l. Układ przenoszenia napędu o zasilaniu 230 V zapewnia doskonałą trakcję oraz redukcję hałasu.  Mobilność Konstrukcja betoniarki B1610 jest stabilna. Sprzęt u podstawy z jednej strony jest zakończony podpórką, zapewniającą stabilność. Natomiast z drugiej posiada 2 koła, które zapewniają mobilność. Mobilność nie tylko ułatwia dowolne ustawienie betoniarki, ale również transport. Wystarczy unieść betoniarkę za pomocą uchwytu i przesunąć sprzęt.', '', 'altrad-betoniarka-b1610-1000-w', '', '', '', 'Altrad Betoniarka B1610 1000 W', '', '', '', ''),
(97, 1, 1, 'Membrana dachowa Expert marki Fola przeznaczona jest do wykonywania zewnętrznej hydroizolacji dachów. Wykonana z wielowarstwowej włókniny polipropylenowej, jest paroprzepuszczalna, eliminuje problem zawilgocenia, pleśni i grzybów.', '', 'fola-membrana-dachowa-expert-15-m-x-50-m-180-g-m2', '', '', '', 'Fola Membrana dachowa Expert 1,5 m x 50 m 180 g / m2', '', '', '', ''),
(98, 1, 1, 'Betoniarka SB-140 o mocy 550 W, marki Skiva. to wolnospadowa betoniarka bębnowa o napędzie elektrycznym, która jest przeznaczona do produkcji mieszanek betonowych o konsystencji ciekłej, półciekłej i plastycznej oraz zapraw cementowych i cementowo-wapiennych. Może być używana również do mieszania materiałów sypkich. Jest niezbędnym sprzętem podczas drobnych i średnich prac remontowo-budowlanych.    Pojemność zbiornika i prędkość obrotowa Skiva Betoniarka SB-140 posiada wieniec wykonany z żeliwa o wysokiej klasie ścieralności oraz koło o średnicy 52 cm, które umożliwia przechył bębna. Prędkość obrotowa wynosi 28 rpm, a pojemność robocza 120 l. Betoniarka SB-140 o mocy 550 W waży 52 kg. Zbiornik mieści 140 l, z czego pojemność mieszania to 120 l. Natężenie hałasu podczas prac z betoniarką wynosi 82 dB. Układ przenoszenia napędu o zasilaniu 230 V zapewnia doskonałą trakcję oraz redukcję hałasu.    Mobilność Konstrukcja betoniarki SB-140 550 W marki Skiva jest stabilna. Sprzęt u podstawy z jednej strony jest zakończony podpórką, zapewniającą stabilność. Natomiast z drugiej posiada 2 koła, które zapewniają mobilność. Mobilność nie tylko ułatwia dowolne ustawienie betoniarki, ale również transport. Wystarczy unieść betoniarkę za pomocą uchwytu i przesunąć sprzęt.', '', 'skiva-betoniarka-sb-140-550-w', '', '', '', 'Skiva Betoniarka SB-140 550 W', '', '', '', ''),
(99, 1, 1, 'Jednokomponentowa piana poliuretanowa w wersji z aplikatorem pistoletowym przeznaczona jest do profesjonalnego montażu, uszczelniania i wygłuszania. Polecana do montażu okien i drzwi, wypełniania szczelin w izolacji termicznej przy ocieplaniu budynków. Charakteryzuje się dużą wytrzymałością mechaniczną i doskonałą przyczepnością do typowych materiałów konstrukcyjnych takich jak: cegła, beton, tynk, drewno, metale, styropian, twarde PCV i sztywne piany PUR. Wykazuje doskonałe parametry termoizolacyjne oraz dźwiękochłonne. Utwardza się pod wpływem wilgoci zawartej w powietrzu atmosferycznym. Odporna na powstawanie pleśni i grzybów.', '', 'piana-pistoletowa-expert-line-750-ml', '', '', '', 'Piana pistoletowa EXPERT LINE 750 ml', '', '', '', ''),
(100, 1, 1, 'Jednokomponentowa piana poliuretanowa w wersji z aplikatorem wężykowym przeznaczona do montażu, uszczelniania i wygłuszania. Piana dostępna w wersji zimowej. Stosowana w montażu okien i drzwi, izolacji cieplnej sieci wodnych, kanalizacyjnych, centralnego ogrzewania, uszczelnianiu i wygłuszaniu kabin w pojazdach mechanicznych, wypełnianiu szczelin w izolacji termicznej przy ocieplaniu budynków. Charakteryzuje się dużą wytrzymałością mechaniczną i doskonałą przyczepnością do typowych materiałów konstrukcyjnych takich jak: cegła, beton, tynk, drewno, metale, styropian, twarde PCV i sztywne piany PUR. Wykazuje doskonałe parametry termoizolacyjne oraz dźwiękochłonne, odporna na powstawanie pleśni i grzybów. Zalecana temperatura pracy (podłoża): od +5°C do +30°C Temperatura puszki: +20°C Odporność termiczna (po utwardzeniu): od -50°C do +90°C Palność: B3 (DIN 4102) Czas tworzenia naskórka: 5-10 min. (20°C / RH 90%) Czas pełnego utwardzenia: 24 h Wydajność: do 45 litrów (w zależności od temperatury i wilgotności powietrza) Termin ważności: 12 miesięcy', '', 'piana-montazowa-expert-line-750-ml', '', '', '', 'Piana montażowa EXPERT LINE 750 ml', '', '', '', ''),
(101, 1, 1, '', '', 'krause-drabina-wielofunkcyjna-tribilo-3x12-monto', '', '', '', 'KRAUSE Drabina wielofunkcyjna Tribilo 3x12 MONTO', '', '', '', ''),
(102, 1, 1, 'Poliuretanowa piana Expert Line Thermofoam jest jednoskładnikową, elastyczną pianą o zwiększonej wydajności i znakomitej termoizolacyjności. Charakteryzuje się dużą wytrzymałością mechaniczną i doskonałą przyczepnością do większości materiałów stosowanych w budownictwie. Formuła piany eliminuje możliwość wypaczeń profili okiennych i drzwiowych oraz wykazuje doskonałe parametry termoizolacyjne i dźwiękochłonne. Szczególnie polecana do montażu stolarki w domach drewnianych i konstrukcji szkieletowej, gdzie występują zmiany geometrii.', '', 'expert-line-piana-pistoletowa-thermofoam-white-750-ml', '', '', '', 'Expert Line Piana pistoletowa ThermoFoam White 750 ml', '', '', '', ''),
(103, 1, 1, 'Wiadro 16 l o wymiarach 33 cm x 28 cm, firmy Mapei.  Dzięki wykorzystaniu do produkcji wysokoelastycznych tworzyw, wiadro jest odporne na uszkodzenia mechaniczne. Jest stabilne i nie odkształca się podczas użytkowania. Posiada metalowy uchwyt, ułatwiający przenoszenie. Wiadro budowlane stanowi praktyczne i wygodne narzędzie, niezbędne przy pracach budowlanych i remontowych.', '', 'mapei-wiadro-16-l', '', '', '', 'Mapei Wiadro 16 l', '', '', '', ''),
(104, 1, 1, 'Worek na gruz Big Bag . Wykonany z polipropylenu mocny worek o ładowności 500 kg i o uniwersalnym zastosowaniu. Przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych. Idealny również do pakowania piasku, ziemi, drewna, węgla, miału, brykietów, ziemniaków, warzyw i owoców.', '', 'worek-na-gruz-big-bag-70-cm-x-70-cm-x-70-cm', '', '', '', 'Worek na gruz Big Bag 70 cm x 70 cm x 70 cm', '', '', '', ''),
(105, 1, 1, 'Pianka montażowa Soudafoam, marki Soudal. Jest to specjalistyczna, ognioodporna i dymoszczelna pianka poliuretanowa, o odporności ogniowej do EI 240. Charakteryzuje się doskonalą przyczepnością do typowych podłoży budowlanych. Idealna do ogniochronnego wypełniania, szczelin i złączy liniowych w przegrodach: murowanych z cegły, betonowych, żelbetowych i innych. Posiada doskonałą charakterystykę rozprężenia, co gwarantuje brak skurczu i rozprężeń następczych. Dzięki specjalnej budowie aplikatora wężykowego, jest łatwa w aplikacji nawet dla niedoświadczonych osób. Dodatkową zaletą pianki jest to, iż nie zawiera gazów szkodliwych dla warstwy ozonowej.', '', 'soudal-piana-ognioochronna-soudafoam-750-ml', '', '', '', 'Soudal Piana ognioochronna Soudafoam 750 ml', '', '', '', ''),
(106, 1, 1, 'Przeznaczona do zabezpieczania stanowisk pracy, materiałów budowlanych, wykopów. Może być wykorzystana do czasowego zabezpieczenia izolacji termicznej i akustycznej przed zawilgoceniem.', '', 'folia-zolta-12-m-x-8-m', '', '', '', 'Folia żółta 1,2 m x 8 m', '', '', '', ''),
(107, 1, 1, 'Pianka montażowa poliuretanowa z aplikatorem Genius Gun, marki Soudal. Przeznaczona jest do różnego rodzaju prac budowlanych. Dzięki specjalnej formule o obniżonej rozprężalności, jest bezpieczna dla delikatnych elementów. Idealnie nadaje się do uszczelniania i łączenia drewnianych elementów w konstrukcjach szkieletowych, uszczelniania stolarki drzwiowej i okiennej, wygłuszania, uszczelniania oraz montażu parapetów, rolet, schodów, uszczelniania w systemach chłodzących, termoizolacji armatury łazienkowej, sieci wodnokanalizacyjnej itp. Charakteryzuje się tym, iż jest precyzyjna i oszczędna w aplikacji, istnieje możliwość przerwania pracy w dogodnym momencie. Wygodny uchwyt umożliwia pełną kontrolę ilości wypuszczanej z puszki pianki. Niewątpliwą zaletą pianki jest doskonała przyczepność do typowych podłoży budowlanych z drewna, PCV, betonu, cegły, powierzchni szkliwionych, aluminium i innych metali.', '', 'soudal-pianka-montazowa-z-aplikatorem-genius-gun-500-ml', '', '', '', 'Soudal Pianka montażowa z aplikatorem Genius Gun 500 ml', '', '', '', ''),
(108, 1, 1, 'Plandeka budowlana zielona 120g/m2 Zielona plandeka budowlana świetnie nada się do przykrywania oraz zabezpieczania powierzchni oraz różnego rodzaju przedmiotów. Została wykonana z polietylenu, dzięki czemu jest niezwykle trwała i zachowuje swoją funkcjonalność przez długi okres użytkowania. Wymiary plandeki wynoszą 2 m x 3 m, przez co z łatwością pokryje nawet duże powierzchnie. Posiada metalowe oczka do mocowania. Chroni powierzchnię oraz przedmioty w trakcie prac budowlanych oraz malarskich.', '', 'lux-plandeka-120-g-m2-zielona-2-m-x-3-m', '', '', '', 'LUX Plandeka 120 g/m2 zielona 2 m x 3 m', '', '', '', ''),
(109, 1, 1, 'Pianka montażowa Comfort z aplikatorem Genius Gun, marki Soudal. Wielosezonowa pianka montażowa wielorazowego użytku z opatentowanym aplikatorem Genius Gun. Zapewnia wielokrotne użycie, umożliwia przerwanie i wznowienie pracy w dowolnym momencie bez ryzyka zablokowania zaworu. Przeznaczona jest do wypełniania pustych przestrzeni w konstrukcjach szkieletowych oraz do termoizolacji instalacji centralnego ogrzewania i wodno-kanalizacyjnej, armatury łazienkowej, wanien, brodzików itp. A także do uszczelnienia przy montażu stolarki okiennej i drzwiowej, z drewna, PVC i aluminium oraz montażu i uszczelniania parapetów, rolet, progów, stopni schodów itp. Charakteryzuje się doskonałą przyczepnością do drewna i materiałów drewnopochodnych, PVC, aluminium i innych metali (również pokrytych powłokami lakierniczymi), betonu, cegły, powierzchni szkliwionych itp.', '', 'soudal-pianka-comfort-genius-gun-montazowa-750-ml', '', '', '', 'Soudal Pianka Comfort Genius Gun montażowa 750 ml', '', '', '', ''),
(110, 1, 1, 'Piana poliuretanowa 65 PVC szczególnie plecana przy montażu okien i drzwi PCV i aluminium. Odznacza się bardzo dobrą przyczepnością i wytrzymałością mechaniczną. Ze względu na podwyższoną elastyczność piana może być stosowana do wypełniania dylatacji. Utwardza się pod wpływem wilgoci z powietrza atmosferycznego. Po utwardzeniu wykazuje doskonałe parametry termoizolacyjne oraz dźwiekochłonne. Odporna na powstawanie pleśni i grzybów. Wydajność na wysokim poziomie 30-45 l.', '', 'piana-pistoletowa-65-pvc-expert-line-professional-840-ml', '', '', '', 'Piana pistoletowa 65 PVC EXPERT LINE Professional 840 ml', '', '', '', ''),
(111, 1, 1, 'Betoniarka MK-185 PROFI 145 l firmy Altrad Poland. Wolnospadowa betoniarka bębnowa o napędzie elektrycznym, przeznaczona do produkcji mieszanek betonowych o konsystencji ciekłej, półciekłej i plastycznej oraz zapraw cementowych i cementowo-wapiennych. Może być używana również do mieszania materiałów sypkich. Posiada wieniec wykonany z żeliwa o wysokiej klasie ścieralności. Przechył bębna odbywa się za pomocą korby. Wyposażona jest w dwa kółka ułatwiające przemieszczanie betoniarki oraz podpórkę. Wzmocniona rama oraz metalowa osłona silnika zwiekszaja żywotnośc betoniarki. Pojemność całkowita: 145 l. Moc: 900 W. Zasilanie: 230 V. Produkt polski.', '', 'altrad-poland-betoniarka-mk-185-profi-145l-korba', '', '', '', 'Altrad Poland Betoniarka MK-185 PROFI 145l korba', '', '', '', ''),
(112, 1, 1, 'Pianka montażowa z aplikatorem Genius Gun marki Soudal jest przeznaczona do wielokrotnych prac uszczelniających. Wyposażona jest w aplikator Genius Gun i formułę, która umożliwia aplikację w temperaturach do -10°C. Aplikator pozwala na wielokrotne użycie pianki montażowej w dłuższym okresie czasu, a wygodny uchwyt zapewnia precyzyjne i oszczędne dozowanie niczym profesjonalny pistolet.    Zastosowanie Pianka montażowa z aplikatorem Genius Gun jest stosowana do uszczelniania stolarki okiennej i drzwiowej z drewna, PCV i aluminium, parapetów, stopni schodów, rolet, brodzików, wanien. Ponadto pianka uszczelnia złącza dachowe, ścienne i stropowe oraz systemy chłodzące. Łączy prefabrykowane elementy drewniane w konstrukcjach szkieletowych, wypełnia przepusty rurowe. Stanowi też izolację elementów instalacji c.o. i wodnokanalizacyjnych oraz izolację termiczną dachów i stropodachów.  Aplikator Genius Gun Innowacyjny aplikator wężykowy Genius Gun umożliwia precyzyjne dozowanie pianki montażowej. Sprawia, że praca staje się bardziej komfortowa i bezpieczna. Dzięki Genius Gun napoczętą puszkę z pianką można długotrwale przechowywać bez ryzyka zablokowania zaworu. Piankę można aplikować wiele razy od momentu pierwszego zastosowania pianki.  Przechowywanie i odporność termiczna Pianka montażowa z aplikatorem Genius Gun marki Soudal może być przechowywana przez okres 18 miesięcy w zamkniętym opakowaniu, w chłodnym i suchym pomieszczeniu, w temperaturze od + 5°C do + 25°C. Pozostawienie niezabezpieczonej utwardzonej pianki spowoduje utratę jej właściwości izolacyjnych. Utwardzona pianka Soudal jest odporna na temperatury od - 40°C do + 100°C. Natomiast temperatura aplikacji powinna wynosić od -10°C do +30°C.', '', 'soudal-pianka-montazowa-z-aplikatorem-genius-gun-600-ml', '', '', '', 'Soudal Pianka montażowa z aplikatorem Genius Gun 600 ml', '', '', '', ''),
(113, 1, 1, 'Membrana dachowa Strong marki Fola przeznaczona jest do wykonywania zewnętrznej hydroizolacji dachów. Wykonana z wielowarstwowej włókniny polipropylenowej, jest paroprzepuszczalna, eliminuje problem zawilgocenia, pleśni i grzybów.', '', 'fola-membrana-dachowa-strong-15-m-x-50-m-150-g-m2', '', '', '', 'Fola Membrana dachowa Strong 1,5 m x 50 m 150 g / m2', '', '', '', ''),
(114, 1, 1, '', '', 'krause-pomost-roboczy-2x6-corda', '', '', '', 'KRAUSE Pomost roboczy 2x6 CORDA', '', '', '', ''),
(115, 1, 1, 'Pianka montażowa Soudafoam, marki Soudal. Jest to specjalistyczna, ognioodporna i dymoszczelna pianka poliuretanowa, o odporności ogniowej do EI 240. Charakteryzuje się doskonalą przyczepnością do typowych podłoży budowlanych. Idealna do ogniochronnego wypełniania, szczelin i złączy liniowych w przegrodach: murowanych z cegły, betonowych, żelbetowych i innych. Posiada doskonałą charakterystykę rozprężenia, co gwarantuje brak skurczu i rozprężeń następczych. Dodatkową zaletą pianki jest to, iż nie zawiera gazów szkodliwych dla warstwy ozonowej.', '', 'soudal-piana-ognioochronna-soudafoam-pistolet-750-ml', '', '', '', 'Soudal Piana ognioochronna Soudafoam pistolet 750 ml', '', '', '', ''),
(116, 1, 1, 'Ściereczki czyszczące SWIPEX XXL, marki Soudal. Są to doskonale czyszczące, niepylące, wytrzymałe mechanicznie ściereczki do czyszczenia różnego rodzaju zabrudzeń. Skutecznie i szybko usuwają świeże zbrudzenia z: pianki poliuretanowej, silikonów, klejów, farb, polimerów MS, atramentu, tłuszczu i oleju. Idealnie nadają się do czyszczenia: rąk, narzędzi i wszelkich powierzchni nieporowatych. Są nasączone specjalną mieszaniną rozpuszczalników, nowoczesnych środków powierzchniowo czynnych i środków ochrony skóry, co zapewnia ich skuteczność. Ściereczki są nieszkodliwe dla środowiska. Zostały umieszczone w wygodnym opakowaniu, zapobiegającym wysychaniu zawartości.', '', 'soudal-sciereczki-czyszczace-swipex-xxl-80-sztuk', '', '', '', 'Soudal Ściereczki czyszczące SWIPEX XXL 80 sztuk', '', '', '', ''),
(117, 1, 1, 'Ściereczki czyszczące SWIPEX XXL, marki Soudal. Są to doskonale czyszczące, niepylące, wytrzymałe mechanicznie ściereczki do czyszczenia różnego rodzaju zabrudzeń. Skutecznie i szybko usuwają świeże zbrudzenia z pianki poliuretanowej, silikonów, klejów, farb, polimerów MS, atramentu, tłuszczu i oleju. Idealnie nadają się do czyszczenia rąk, narzędzi i wszelkich powierzchni nieporowatych. Są nasączone specjalną mieszaniną rozpuszczalników, nowoczesnych środków powierzchniowo czynnych i środków ochrony skóry, co zapewnia ich skuteczność. ściereczki są nieszkodliwe dla środowiska. Zostały mieszczone w wygodnym opakowaniu, zapobiegającym wysychaniu zawartości.', '', 'soudal-sciereczki-czyszczace-swipex-xxl-20-sztuk', '', '', '', 'Soudal Ściereczki czyszczące SWIPEX XXL 20 sztuk', '', '', '', ''),
(118, 1, 1, 'Miska do gipsu 500 ml, marki Patrol Group. Wykonany z elastycznego tworzywa sztucznego pojemnik o średnicy 150 mm i wysokości 53 mm. Idealny do doraźnego przygotowywania niewielkich ilości zapraw szpachlowych, klejących i tynkarskich. Niezbędny przy drobnych pracach remontowych.', '', 'patrol-group-miska-na-gips-500-ml', '', '', '', 'Patrol Group Miska na gips 500 ml', '', '', '', ''),
(119, 1, 1, 'Sito z podporą 115 cm x 70 cm, firmy Unicell. Sito murarskie z podporą służące do przesiewania materiałów sypkich, takich jak piach, żwir czy materiał tynkarski. Materiał, który był przepuszczony przez sito cechuje się znacznie równiejszą wielkością i kształtem, dzięki czemu po dodaniu na przykład do zaprawy murarskiej, znacznie łatwiej jest ją rozrobić. Nie powstają też w niej grudki. Sito wyposażone jest w wygodną podporę, która ułatwia proces przesiewania. Ustawienie sita w pozycji ukośnej sprawia, że przesiew jest szybszy, a materiał właściwy dobrze oddziela się od zanieczyszczonego lub wilgotnego. Ponieważ sito wykonane zostało ze stali, jego prześwit może osiągnąć bardzo małe rozmiary, pozwalając Ci przesiać nawet najdrobniejszy materiał. Stalowe oczka wielkości 8 mm są też bardzo odporne na zatykanie, dzięki czemu praca będzie przebiegać sprawniej.', '', 'unicell-sito-115-cm-x-70-cm-x-8-mm-z-podpora', '', '', '', 'Unicell Sito 115 cm x 70 cm x 8 mm z podporą', '', '', '', ''),
(120, 1, 1, 'Pianka montażowa poliuretanowa, pistoletowa Soudafoam low expansion zimowa, marki Soudal. Charakteryzuje się doskonałą przyczepnością do typowych podłoży budowlanych, takich jak: beton, cegły, kamień, PCV, aluminium, drewno itp. Ze względu na swoje wyjątkowe właściwości, pozwala na pracę w niskich temperaturach do -10 st.C. Niskorozprężna formuła pianki daje gwarancję bezpieczeństwa dla delikatnych elementów, ponieważ kontrolowane zwiększanie objętości eliminuje prawdopodobieństwo pojawienia się deformacji. Pracę ułatwia szybkie i pewne mocowanie bagnetowe puszki w gnieździe pistoletu. Pianka zapewnia m.in.: idealne wygłuszanie i wypełnianie pustych przestrzeni w konstrukcjach szkieletowych, uszczelnianie i najwyższą izolacyjność termiczną i akustyczną nawet do 58 dB. Dodatkową zaletą pianki jest to, iż nie zawiera gazów szkodliwych dla warstwy ozonowej.', '', 'soudal-pianka-montazowa-pistoletowa-soudafoam-low-expansion-zimowa-750-ml', '', '', '', 'Soudal Pianka montażowa pistoletowa Soudafoam Low Expansion zimowa 750 ml', '', '', '', ''),
(121, 1, 1, 'Pianka montażowa poliuretanowa z aplikatorem Genius Gun zimowa, marki Soudal. Przeznaczona jest do różnego rodzaju prac budowlanych. Dzięki specjalnej formule o obniżonej rozprężalności, jest bezpieczna dla delikatnych elementów. Idealnie nadaje się do uszczelniania i łączenia drewnianych elementów w konstrukcjach szkieletowych, uszczelniania stolarki drzwiowej i okiennej, wygłuszania, uszczelniania oraz montażu parapetów, rolet, schodów, uszczelniania w systemach chłodzących, termoizolacji armatury łazienkowej, sieci wodnokanalizacyjnej itp. Charakteryzuje się tym, iż jest precyzyjna i oszczędna w aplikacji, istnieje możliwość przerwania pracy w dogodnym momencie. Wygodny uchwyt pozwala na pełną kontrolę wypuszczanej z puszki pianki. Ze względu na swoją wyjątkową formułę, daje możliwość pracy w niskich temperaturach do -10 st.C. Niewątpliwą zaletą pianki jest wyjątkowo dobra przyczepność do podłoży z drewna, PCV, aluminium i innych metali.', '', 'soudal-pianka-montazowa-z-aplikatorem-genius-gun-zimowa-500-ml', '', '', '', 'Soudal Pianka montażowa z aplikatorem Genius Gun zimowa 500 ml', '', '', '', ''),
(122, 1, 1, 'Pianka montażowa pistoletowa Soudafoam Classic zimowa o pojemności 750 ml, marki Soudal. Jest to profesjonalna, wysokowydajna, pianka poliuretanowa o obniżonej rozprężalności. Pianka polecana jest do wszelkich prac wykończeniowych i instalacyjnych. Dzięki specjalnej formule o obniżonej rozprężalności, jest bezpieczna dla delikatnych elementów. Idealnie nadaje się do uszczelniania i łączenia drewnianych elementów w konstrukcjach szkieletowych, uszczelniania stolarki drzwiowej i okiennej, wygłuszania, uszczelniania oraz montaż parapetów, rolet, schodów, uszczelniania w systemach chłodzących, termoizolacja armatury łazienkowej, sieci wodnokanalizacyjnej itp. Charakteryzuje się tym, iż jest precyzyjna i oszczędna w aplikacji, istnieje możliwość przerwania pracy w dogodnym momencie. Ze względu na swoją wyjątkową formułę, daje możliwość pracy w niskich temperaturach do -10 °C. Niewątpliwą zaletą pianki jest jej, krótki czas utwardzania.', '', 'soudal-pianka-montazowa-pistoletowa-soudafoam-classic-zimowa-750-ml', '', '', '', 'Soudal Pianka montażowa pistoletowa Soudafoam Classic zimowa 750 ml', '', '', '', ''),
(123, 1, 1, 'Kurtyna przeciwkurzowa 100 cm x 215 cm, firmy Brik. Uniwersalna kurtyna służy do odseparowania pomieszczeń, w których wykonywane są prace budowlane. Zapobiega przedostawaniu się pyłu i kurzu. Umożliwia zamontowanie w ościeżnicy drzwiowej, a zamek błyskawiczny pozwala na łatwe przemieszczanie się, bez konieczności demontażu zabezpieczenia. Kurtyna jest prosta do zamontowania, zapewnia domownikom komfort podczas remontu. Nadaje się do wielokrotnego użycia.', '', 'kurtyna-przeciwkurzowa-100-cm-x-215-cm', '', '', '', 'Kurtyna przeciwkurzowa 100 cm x 215 cm', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(124, 1, 1, 'Pianka montażowa pistoletowa, poliuretanowa Soudafoam Classic, marki Soudal. Przeznaczona jest do różnego rodzaju prac budowlanych. Dzięki specjalnej formule o obniżonej rozprężalności, jest bezpieczna dla delikatnych elementów. Piankę cechuje krótki czas utwardzania, co znacznie ułatwia pracę. Niewątpliwą zaletą pianki jest doskonała przyczepność do typowych podłoży budowlanych z drewna, PCV, betonu, cegły, powierzchni szkliwionych, aluminium i innych metali. Idealnie nadaje się do uszczelniania i łączenia drewnianych elementów w konstrukcjach szkieletowych, uszczelniania stolarki drzwiowej i okiennej, wygłuszania, uszczelniania oraz montażu parapetów, rolet, schodów, uszczelniania w systemach chłodzących, termoizolacji armatury łazienkowej, sieci wodnokanalizacyjnej itp. Dodatkową zaletę pianki stanowi fakt, iż nie zawiera gazów szkodliwych dla warstwy ozonowej.', '', 'soudal-pianka-montazowa-pistoletowa-soudafoam-classic-750-ml', '', '', '', 'Soudal Pianka montażowa pistoletowa Soudafoam Classic 750 ml', '', '', '', ''),
(125, 1, 1, 'Przęsło konstrukcyjne 1101 marki Rew-Ton jest wykonane z rur stalowych. To element rusztowania kolumnowego typu warszawskiego, umożliwiający montaż kolumn, które zapewniają bezpieczeństwo i komfort wykonywania prac na wysokościach.    Zastosowanie Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak remont elewacji budynku lub dachu oraz wewnątrz budynków przemysłowych i domów jednorodzinnych. Umożliwia wykonywanie prac na wysokości do 3 m.    Lekka konstrukcja Przęsło konstrukcyjne jest lekkie i stabilne. Ponadto montaż konstrukcji przebiega szybko i łatwo, co daje więcej czasu na bezproblemową pracę na wysokościach. Stabilna i sztywna konstrukcja zapewniają bezpieczeństwo pracy. Przęsło rusztowania jest wykonane z rury o średnicy 26,9 mm i waży 5 kg. Wymiary przęsła 1101 Rew-Ton wynoszą 100 x 80 cm.  Rusztowanie typ warszawski Rusztowanie kolumnowe typu warszawskiego charakteryzuje się stabilnością i prostym montażem, podczas którego ciężko o pomyłkę. Przęsło konstrukcyjne jest pokryte farbą korozyjną, która wydłuża jego żywotność i przeciwdziała wilgoci. Rusztowanie kolumnowe Rew-Ton 1101 tak samo wewnątrz, jak i na zewnątrz powinno stać na stabilnej podstawie i utwardzonym podłożu. Podstawa może być regulowana lub śrubowa. Nie należy stawiać go na trawie, grząskim gruncie, drewnie ani cegłach. Rusztowanie może być wyposażone w kółka i umożliwiać przesuwanie kolumny wzdłuż ściany bez konieczności demontażu całej konstrukcji.', '', 'rew-ton-przeslo-konstrukcyjne-1101-1-m', '', '', '', 'Rew-Ton Przęsło konstrukcyjne 1101 1 m', '', '', '', ''),
(126, 1, 1, 'Worek na gruz z usługą odbioru GruzBag jest idealnym rozwiązaniem na pozbycie się zalegającego gruzu. Lekki i prosty kontener GruzBag to doskonałe rozwiązanie zarówno przy mniejszych, jak i większych remontach. Decydując się na zbiornik, kupujesz, ładujesz, a my odbieramy. Wymiary worka to 90x90x115 cm, a waga wynosi 1,2 kg. Wymiary pustego worka po złożeniu to zaledwie 30x20x10 cm.  Zastosowanie Wykonany z mocnego polipropylenu LDPE worek z uszami jest przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych. Maksymalna ładowność wynosi 1000 kg. Idealny do pakowania pokruszonego betonu, płytek, kamienia, cegły, dachówki, elementów sanitariów oraz umywalek. Zabrania się natomiast umieszczania takich materiałów, jak: azbest, papy, opony, wełna mineralna, substancje niebezpieczne i żrące, styropian, odpady opakowaniowe. Worka nie można przeładowywać. Powinien być napełniony do wysokości, umożliwiającej spięcie górnych zaczepów załadunkowych.  Usługa odbioru gruzu dostępna tylko w marketach: - Bielany - Wrocławskie: ul. Czekoladowa 5 - Bytom: ul. Chorzowska 86, ul. Strzelców Bytomskich 96 - Częstochowa: ul. Okulickiego 16/18 - Czeladź: ul. Będzińska 80 - Dąbrowa Górnicza: ul. Jana III Sobieskiego 6a - Jabłonna: ul. Zegrzyńska 9 - Katowice: ul. Rolna 4 - Kraków: ul. Wielicka 259, al. Bora-Komorowskiego 31, ul. Stawowa 68, al. Pokoju 67 - Lublin: ul. Chemiczna 2, ul. Zwycięska 6 - Łódź: ul. Rokicińska 192, ul. Szparagowa 3/5, ul. Brzezińska 27/29, ul. Henryka Wieniawskiego 1/3 - Poznań: ul. Szwedzka 2 - Tychy: ul. Towarowa 2B - Tychy: Al. Bielska 109 - Warszawa: Al. Krakowska 102, ul. Puławska 427, Radzymińska 166 - Wrocław: ul. Długa 29-35 - Zabrze: al. Korfantego 13, ul. Szkubacza 1 - Ząbki: ul. Radzymińska 303 - Mysiadło ul. Kuropatwy 41 - Częstochowa ul.Kisielewskiego 8/16', '', 'gruzbag-worek-na-gruz-z-usluga-odbioru', '', '', '', 'GruzBag Worek na gruz z usługą odbioru', '', '', '', ''),
(127, 1, 1, 'Drabina wielofunkcyjna BS-DW 3 x 11 szczebli marki Bayersystem wyróżnia się wielością zastosowań. Jest wykonana z trwałego aluminium, które wpływa na wytrzymałość oraz odporność na uszkodzenia. Ponadto aluminium jest materiałem lekkim, dzięki czemu drabinę łatwo przestawić lub przetransportować. Aluminiowe drabiny mogą być używane zarówno wewnątrz, jak i na zewnątrz budynków.  Do profesjonalnego użytku przemysłowego Drabina przemysłowa Bayersystem to narzędzie profesjonalne. Spełnia normę EN 131, co stanowi o sprzęcie bezpiecznym w użytkowaniu i zgodnym z przepisami. Norma ta reguluje dopuszczenie urządzenia do użytku w przedsiębiorstwach oraz środowiskach pracy. Z drabiny o szerokim zastosowaniu mogą również korzystać osoby prywatne. Ten model wyróżnia najwyższa jakość wykonania, gwarantując wysoki poziom bezpieczeństwa. Drabina, na której można osiągnąć 6,99 m wysokości roboczej sprawdzi się podczas prac ogrodowych lub elewacyjnych.  Bezpieczeństwo i stabilność Korzystanie z drabiny wielofunkcyjnej BS-DW 3 x 11 szczebli marki Bayersystem jest bezpieczne. Wyposażono ją w system blokujący oraz hak, który zabezpiecza zsunięcie się elementu wysuwanego. Stabilne ustawienie drabiny zapewniają stopki antypoślizgowe, znajdujące się u podstawy podłużnic. Stopki ograniczają możliwość przypadkowego rozsunięcia się drabiny. Bezpieczną pracę na wysokości umożliwiają stopnie o antypoślizgowej powierzchni. Każdy moduł jest wyposażony w stopnie o nośności 150 kg. Po zakończeniu pracy drabinę Bayersystem można łatwo i szybko złożyć, co ułatwia transport oraz przechowywanie. Długość transportowa wynosi ok. 2,9 m.    Trzyelementowa konstrukcja - trzy sposoby użytkowania Wielofunkcyjna aluminiowa drabina przemysłowa Bayersystem składa się z 3 elementów, które umożliwiają wykorzystywanie urządzenia na kilka sposobów:  - drabina rozstawna, czyli konstrukcja z dwoma parami ramion, które mogą stać samodzielnie, bez konieczności opierania ich o ścianę. Wyróżnia ją stabilność i uniwersalność. Są często wybierane podczas drobnych napraw, prac remontowych oraz porządkowych. Kształtem przypomina literę \"A\". Drabina BS-DW to model wysokiej jakości ze stopniami z dwóch stron. Drabina rozstawna ma mechanizm, umożliwiający łatwe i bezpieczne składanie i rozkładanie. Kolejnym istotnym elementem jest zabezpieczenie rozstawu, które zapobiega nadmiernemu rozsuwaniu się drabiny w trakcie prac.  - drabina przystawna, czyli drabina klasyczna. Jej konstrukcja składa się z dwóch elementów: podłużnic i szczebli. Podłużnice to pionowe części drabiny, w których mocowane są poziome szczeble. Na takim stelażu opiera się cały ciężar. Aby użyć takiej drabiny, należy ją oprzeć, np. o ścianę. Drabina przystawna umożliwia dostanie się do trudno dostępnych miejsc, jak dach budynku.  - drabina wolnostojąca dwuelementowa i drabina jednoelementowa przystawna powstają dzięki rozsuwanemu elementowi. Ostatni element trzyczęściowej drabiny można użytkować osobno. Odłączenie elementu od pełnej konstrukcji pozwala uzyskać dwie drabiny. Dodatkowa drabina jednoelementowa jest drabiną przystawną, którą charakteryzuje lekkość i nieduży rozmiar. Drabina dwuelementowa jest wolnostojąca.  Atutem drabiny jest możliwość wyboru rozstawienia. Wykonanie z trwałego aluminium zapewnia możliwość korzystania z urządzenia przez lata. Przy jej pomocy można przeprowadzać wiele różnych prac w firmach budowlanych, przeprowadzkowych czy usługowych.Dzięki niej można pracować na znacznie wyższych wysokościach niż mogą to zaoferować tradycyjne drabiny dwuelementowe. Maksymalna wysokość robocza, jaką można osiągnąć podczas pracy, wykonywanej na drabi', '', 'bayersystem-drabina-wielofunkcyjna-bs-dw-3-x-11-szczebli', '', '', '', 'Bayersystem Drabina wielofunkcyjna BS-DW 3 x 11 szczebli', '', '', '', ''),
(128, 1, 1, 'Pianka montażowa zimowa, marki CMI. Jest to pianka przeznaczona do wszelkich prac wykończeniowych i instalacyjnych. Dzięki specjalnej \"zimowej\" formule pozwala na pracę w niskich temperaturach do -10 st. C. Charakteryzuje się wysoką wydajnością i stabilnością wymiarów oraz niezwykle krótkim czasem utwardzania (do 60 minut). Formuła o obniżonej rozprężalności jest bezpieczna dla delikatnych profili z PCV.', '', 'cmi-pianka-montazowa-wezykowa-zimowa-750-ml', '', '', '', 'CMI Pianka montażowa wężykowa zimowa 750 ml', '', '', '', ''),
(129, 1, 1, 'Pianka montażowa pistoletowa, marki CMI. Jest to pianka o krótkim czasie utwardzania i doskonałej przyczepności do PCV, drewna, aluminium i typowych podłoży budowlanych. Specjalna formuła o obniżonej rozprężalności zapewnia profesjonalne uszczelnienie przy montażu wszelkiego typu stolarki budowlanej, również z wielokomorowych, kolorowych profili PCV. Pianka charakteryzuje się bardzo dobrymi parametrami izolacyjnymi, regularnością struktury i dużą gęstością oraz stabilnością wymiarów.', '', 'cmi-pianka-montazowa-pistoletowa-750-ml', '', '', '', 'CMI Pianka montażowa pistoletowa 750 ml', '', '', '', ''),
(130, 1, 1, 'Betoniarka SB-120, marki Skiva. Wolnospadowa betoniarka bębnowa o napędzie elektrycznym, przeznaczona do produkcji mieszanek betonowych o konsystencji ciekłej, półciekłej i plastycznej oraz zapraw cementowych i cementowo-wapiennych. Może być używana również do mieszania materiałów sypkich. Posiada wieniec wykonany z żeliwa o wysokiej klasie ścieralności. Przechył bębna odbywa się za pomocą koła. Układ przenoszenia napędu zapewnia doskonałą trakcję oraz redukcję hałasu. Betoniarka wyposażona jest w dwa kółka, ułatwiające przemieszczanie i podpórkę, zapewniającą stabilność podczas pracy. Pojemność całkowita: 120 l. Pojemność robocza: 100 l. Moc: 550 W. Zasilanie: 230 V. Waga: 46 kg.', '', 'skiva-betoniarka-sb-120-550-w', '', '', '', 'Skiva Betoniarka SB-120 550 W', '', '', '', ''),
(131, 1, 1, 'Piana pistoletowa szczególnie polecana do montażu okien i drzwi i wypełniania szczelin w izolacji termicznej przy ocieplaniu budynków. Charakteryzuje się dużą wytrzymałością mechaniczną i doskonałą przyczepnością do typowych materiałów konstrukcyjnych takich jak: cegła, beton, tynk, drewno, metale, styropian, twarde PVC i sztywne piany PUR. Wykazuje doskonałe parametry termoizolacyjne oraz dźwiękochłonne. Utwardza się pod wpływem wilgoci zawartej w powietrzu atmosferycznym. Piana jest odporna na powstawanie pleśni i grzybów.', '', 'partner-fix-pianka-montazowa-750-ml', '', '', '', 'Partner Fix Pianka montażowa 750 ml', '', '', '', ''),
(132, 1, 1, 'Piana pistoletowa szczególnie plecana przy montażu okien i drzwi. Odznacza się bardzo dobrą przyczepnością i wytrzymałością mechaniczną. Utwardza się pod wpływem wilgoci z powietrza atmosferycznego. Po utwardzeniu wykazuje doskonałe parametry termoizolacyjne oraz dźwiekochłonne. Wydajność na wysokim poziomie 30-45 l.', '', 'piana-pistoletowa-partner-fix-700-ml', '', '', '', 'Piana pistoletowa PARTNER FIX 700 ml', '', '', '', ''),
(133, 1, 1, 'Wiadro budowlane 20 l, marki Patrol Group. Dzięki wykorzystaniu do produkcji elastycznych tworzyw, wiadro jest odporne na uszkodzenia mechaniczne. Posiada spód wzmocniony dodatkowym ożebrowaniem, co sprawia, że jest stabilne i nie odkształca się podczas użytkowania. Ma też metalowy uchwyt z tulejką, ułatwiający przenoszenie. Wiadro budowlane stanowi praktyczne i wygodne narzędzie, niezbędne przy pracach budowlanych i remontowych.', '', 'patrol-group-wiadro-budowlane-profi-bez-lejka-20l', '', '', '', 'Patrol Group Wiadro budowlane Profi bez lejka 20l', '', '', '', ''),
(134, 1, 1, 'Kastra budowlana prostokątna 40 l, marki Patrol Group. Wykonany z niezwykle wytrzymałego materiału pojemnik, przeznaczony do mieszania i transportu zapraw suchych i mokrych. Dzięki wykorzystaniu do produkcji wysokoelastycznych tworzyw, jest odporny na uszkodzenia mechaniczne. Stanowi niezastąpione narzędzie na każdej budowie. Idealne do przygotowywania różnego rodzaju zapraw cementowych i tynkarskich.', '', 'patrol-group-kastra-budowlana-prostokatna-40-l', '', '', '', 'Patrol Group Kastra budowlana prostokątna 40 l', '', '', '', ''),
(135, 1, 1, 'Kastra budowlana okrągła 40 l, marki Patrol Group. Wykonany z niezwykle wytrzymałego materiału pojemnik, przeznaczony do mieszania i transportu zapraw suchych i mokrych. Dzięki wykorzystaniu do produkcji wysokoelastycznych tworzyw, jest odporny na uszkodzenia mechaniczne. Stanowi niezastąpione narzędzie na każdej budowie. Idealne do przygotowywania różnego rodzaju zapraw cementowych i tynkarskich.', '', 'patrol-group-kastra-budowlana-okragla-40-l', '', '', '', 'Patrol Group Kastra budowlana okrągła 40 l', '', '', '', ''),
(136, 1, 1, 'Wiadro budowlane 5 l, marki Patrol Group. Dzięki wykorzystaniu do produkcji elastycznych tworzyw, wiadro jest odporne na uszkodzenia mechaniczne. Posiada spód wzmocniony dodatkowym ożebrowaniem, co sprawia, że jest stabilne i nie odkształca się podczas użytkowania. Wiadro wyposażone jest też w dwa praktyczne udogodnienia: lejek, zmniejszający prawdopodobieństwo rozlania się płynu podczas przelewania i podziałkę do odmierzania ilości użytej zaprawy. Ma też metalowy uchwyt, ułatwiający przenoszenie. Wiadro budowlane stanowi praktyczne i wygodne narzędzie, niezbędne przy pracach budowlanych i remontowych.', '', 'patrol-group-wiadro-budowlane-z-lejkiem-5-l', '', '', '', 'Patrol Group Wiadro budowlane z lejkiem 5 l', '', '', '', ''),
(137, 1, 1, 'Wiadro budowlane 20 l, marki Patrol Group. Dzięki wykorzystaniu do produkcji wysokoelastycznych tworzyw, wiadro jest odporne na uszkodzenia mechaniczne. Posiada spód wzmocniony dodatkowym ożebrowaniem, co sprawia, że jest stabilne i nie odkształca się podczas użytkowania. Wiadro wyposażone jest też w dwa praktyczne udogodnienia: lejek, zmniejszający prawdopodobieństwo rozlania się płynu podczas przelewania i podziałkę do odmierzania ilości użytej zaprawy. Ma też metalowy uchwyt, ułatwiający przenoszenie. Wiadro budowlane stanowi praktyczne i wygodne narzędzie, niezbędne przy pracach budowlanych i remontowych.', '', 'patrol-group-wiadro-budowlane-z-lejkiem-20-l', '', '', '', 'Patrol Group Wiadro budowlane z lejkiem 20 l', '', '', '', ''),
(138, 1, 1, 'Klej do styropianu Soudatherm Fasada, marki Soudal. Jest to wodoodporny, niepalny klej poliuretanowy o wysokiej sile mocowania wstępnego. Charakteryzuje się doskonałą przyczepnością do typowych podłoży budowlanych z żywic fenolowych, polistyrenu, poliuretanu, cegły, betonu, materiałów ceramicznych, drewna, papy, metali itp. Doskonały do mocowania płyt izolacyjnych do ścian oraz uszczelniania szpar i spoin. Dzięki doskonałej izolacyjności nie powoduje powstawania mostów akustycznych i termicznych. Niewątpliwą zaletę kleju stanowi fakt, że skraca czas pracy i znacznie obniża wagę wykonywanego ocieplenia.', '', 'soudal-klej-do-styropianu-soudatherm-fasada-750-ml', '', '', '', 'Soudal Klej do styropianu Soudatherm Fasada 750 ml', '', '', '', ''),
(139, 1, 1, 'Wiadro budowlane 12 l, marki Patrol Group. Dzięki wykorzystaniu do produkcji wysokoelastycznych tworzyw, wiadro jest odporne na uszkodzenia mechaniczne. Posiada spód wzmocniony dodatkowym ożebrowaniem co sprawia, że jest stabilne i nie odkształca się podczas użytkowania. Wiadro wyposażone jest też w praktyczne udogodnienie - podziałkę do odmierzania ilości użytej zaprawy. Ma też metalowy uchwyt, ułatwiający przenoszenie. Wiadro budowlane stanowi praktyczne i wygodne narzędzie, niezbędne przy pracach budowlanych i remontowych.', '', 'patrol-group-wiadro-budowlane-bez-lejka-12-l', '', '', '', 'Patrol Group Wiadro budowlane bez lejka 12 l', '', '', '', ''),
(140, 1, 1, 'Folia budowlana atestowana - czarna, marki Fola. Stanowi doskonałą barierę izolacyjną dla pary wodnej znajdującej się w środku budynku. Chroni przed zjawiskiem skraplania się pary wodnej z wewnątrz budynku podczas zetknięcia się z elementem o odpowiednio niższej temperaturze, zapewniając swobodną cyrkulację powietrza. Zabezpiecza przed zawilgoceniem izolacji termicznej lub akustycznej. Wykonanie z wysokiej jakości tworzywa zapewnią zwiększoną odporność na rozrywanie.', '', 'fola-folia-budowlana-atestowana-czarna-030-mm', '', '', '', 'Fola Folia budowlana atestowana czarna 0,30 mm', '', '', '', ''),
(141, 1, 1, 'Worek budowlany, 5 sztuk, marki Fola. Wykonany z polipropylenu, mocny worek o ładowności 160 l. Przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych, gruzu. Idealny również do pakowania piasku, ziemi, drewna, węgla, miału, brykietów, ziemniaków, warzyw i owoców.', '', 'fola-worek-budowlany-czarny-160-l-5-sztuk', '', '', '', 'Fola Worek budowlany czarny 160 l 5 sztuk', '', '', '', ''),
(142, 1, 1, 'Stopa stabilizująca marki Krause, gwarantuje stabilnoś i bezpieczeństwo podczas prac na drabinie z linii Corda. W komplecie wraz z stopką, znajduje się komplet śrub mocujących.', '', 'stopa-do-stabilizacji-corda-50x20-mm', '', '', '', 'Stopa do stabilizacji Corda 50x20 mm', '', '', '', ''),
(143, 1, 1, 'Płyn czyszczący do pianki, marki Soudal. Jest to gotowy do użycia, doskonały płyn do czyszczenia poliuretanowej pianki montażowej, w aerozolu. Skutecznie i szybko usuwa świeże zbrudzenia nieutwardzonej pianki ze: szkła, metali, parapetów, futryn, ościeży oraz tworzyw sztucznych odpornych na rozpuszczalniki. Może być również stosowany do odtłuszczania powierzchni metalowych, przed zastosowaniem poliuretanów. Opakowanie zawiera dodatkowo specjalny aplikator słomkowy, zapewniający precyzyjne czyszczenie. Dodatkową zaletą płynu jest to, iż zawarta w nim mieszanina gazów i rozpuszczalników jest nieszkodliwa dla środowiska naturalnego.', '', 'soudal-plyn-czyszczacy-do-pianki-150-ml', '', '', '', 'Soudal Płyn czyszczący do pianki 150 ml', '', '', '', ''),
(144, 1, 1, 'Worek budowlany, 5 sztuk, marki Fola. Wykonany z polipropylenu, mocny worek o ładowności 70 l. Przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych, gruzu. Idealny również do pakowania piasku, ziemi, drewna, węgla, miału, brykietów, ziemniaków, warzyw i owoców.', '', 'fola-worek-budowlany-70-l-5-sztuk', '', '', '', 'Fola Worek budowlany 70 l 5 sztuk', '', '', '', ''),
(145, 1, 1, 'Preparat do usuwania pianki PU Remover, 100 ml, marki Soudal. Preparat PU Remover to specjalnie dobrana mieszanina nieagresywnych rozpuszczalników i plastyfikatorów. Jest bezzapachowy i nieszkodliwy dla środowiska naturalnego. Łatwy w nakładaniu - nie ścieka i nie kapie podczas aplikacji na pionowe powierzchnie. W zestawie znajduje się pędzelek i szpachelka do precyzyjnej aplikacji.', '', 'soudal-preparat-do-usuwania-pianki-pu-remover-100-ml', '', '', '', 'Soudal Preparat do usuwania pianki PU Remover 100 ml', '', '', '', ''),
(146, 1, 1, 'Folia ochronna 200, czarna, marki Fola. Wykonana z polietylenu folia izolacyjno-ochronna o grubości 0,08 mm do zabezpieczania wszelkich powierzchni. Chroni przed zabrudzeniem podczas prac remontowych, malarskich czy ogrodniczych. Osłania konstrukcje, wykopy, rusztowania oraz wszelkie inne elementy narażone na uszkodzenia. Posiada doskonałą wytrzymałość mechaniczną i elastyczność.', '', 'fola-folia-do-ochrony-200-czarna-008-mm-4-m-x-25-m', '', '', '', 'Fola Folia do ochrony 200 czarna 0,08 mm 4 m x 25 m', '', '', '', ''),
(147, 1, 1, 'Wiadro budowlane 12 l, marki Patrol Group. Dzięki wykorzystaniu do produkcji wysokoelastycznych tworzyw, wiadro jest odporne na uszkodzenia mechaniczne. Posiada spód wzmocniony dodatkowym ożebrowaniem co sprawia, że jest stabilne i nie odkształca się podczas użytkowania. Wiadro wyposażone jest też w dwa praktyczne udogodnienia: lejek, zmniejszający prawdopodobieństwo rozlania się płynu podczas przelewania i podziałkę do odmierzania ilości użytej zaprawy. Ma też metalowy uchwyt, ułatwiający przenoszenie. Wiadro budowlane stanowi praktyczne i wygodne narzędzie, niezbędne przy pracach budowlanych i remontowych.', '', 'patrol-group-wiadro-budowlane-z-lejkiem-12-l', '', '', '', 'Patrol Group Wiadro budowlane z lejkiem 12 l', '', '', '', ''),
(148, 1, 1, 'Worki budowlane o wymiarach 91 cm x 110 cm, marki Jan Niezbędny. Bardzo grube, wytrzymałe i elastyczne worki przydatne podczas prac remontowych do transportu stałych i sypkich odpadów budowlanych czy gruzu. Pojemność 160L. W opakowaniu 12 sztuk.', '', 'jan-niezbedny-worki-budowlane-160l', '', '', '', 'Jan Niezbędny Worki budowlane 160l', '', '', '', ''),
(149, 1, 1, 'Worki budowlane o wymiarach 135 cm x 146 cm, marki Jan Niezbędny. Bardzo grube, wytrzymałe i elastyczne worki przydatne podczas prac remontowych do transportu stałych i sypkich odpadów budowlanych czy gruzu. Pojemność 300L. W opakowaniu 6 sztuk.', '', 'jan-niezbedny-worki-budowlane-300l', '', '', '', 'Jan Niezbędny Worki budowlane 300l', '', '', '', ''),
(150, 1, 1, 'Kółko. Element uzupełniający rusztowanie kolumnowe JP5000 firmy Rew Ton. Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak i wewnątrz budynków. Umożliwia wykonywanie prac na wysokości do 8,2 m. Montaż podestów roboczych o wymiarach 1 m x 2 m jest możliwy co 1 m. Jest przejezdne, bezpieczne, łatwe i szybkie w montażu. Odznacza się lekkością konstrukcji.', '', 'rew-ton-kolko-do-rusztowania-kolumnowego', '', '', '', 'Rew-Ton Kółko do rusztowania kolumnowego', '', '', '', ''),
(151, 1, 1, 'Łącznik. Element konstrukcyjny rusztowania kolumnowego typu warszawskiego 1-A/B firmy Rew-Ton. Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak i wewnątrz budynków. Umożliwia wykonywanie prac na wysokości do 8,2 m. Jest przejezdne, bezpieczne, łatwe i szybkie w montażu. Odznacza się lekkością konstrukcji.', '', 'rew-ton-lacznik-do-rusztowania-kolumnowego-16-m', '', '', '', 'Rew-Ton Łącznik do rusztowania kolumnowego 1,6 m', '', '', '', ''),
(152, 1, 1, 'Łącznik. Element konstrukcyjny rusztowania kolumnowego typu warszawskiego 1-A/B firmy Rew-Ton. Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak i wewnątrz budynków. Umożliwia wykonywanie prac na wysokości do 8,2 m. Jest przejezdne, bezpieczne, łatwe i szybkie w montażu. Odznacza się lekkością konstrukcji.', '', 'rew-ton-lacznik-do-rusztowania-kolumnowego-1-m', '', '', '', 'Rew-Ton Łącznik do rusztowania kolumnowego 1 m', '', '', '', ''),
(153, 1, 1, 'Ukośnik do rusztowania kolumnowego typu warszawskiego 1-A/B firmy Rew-Ton. Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak i wewnątrz budynków. Umożliwia wykonywanie prac na wysokości do 8,2 m. Jest przejezdne, bezpieczne, łatwe i szybkie w montażu. Odznacza się lekkością konstrukcji.', '', 'rew-ton-ukosnik-do-rusztowania-kolumnowego-1-m', '', '', '', 'Rew-Ton Ukośnik do rusztowania kolumnowego 1 m', '', '', '', ''),
(154, 1, 1, 'Ukośnik do rusztowania kolumnowego typu warszawskiego 1-A/B firmy Rew-Ton. Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak i wewnątrz budynków. Umożliwia wykonywanie prac na wysokości do 8,2 m. Jest przejezdne, bezpieczne, łatwe i szybkie w montażu. Odznacza się lekkością konstrukcji.', '', 'rew-ton-ukosnik-do-rusztowania-kolumnowego-16-m', '', '', '', 'Rew-Ton Ukośnik do rusztowania kolumnowego 1,6 m', '', '', '', ''),
(155, 1, 1, 'Aplikator do piany poliuretanowej marki Soudal. Jest to bardzo wygodne w użyciu urządzenie, umożliwiające precyzyjną aplikację pianki montażowej. Pozwala na łatwe i szybkie wykonanie uszczelnienia podczas prac budowlanych i remontowych. Aplikację przy użyciu aplikatora marki Soudal można przerwać w dowolnym momencie, a pozostałą w opakowaniu pianę wykorzystać później. Opakowanie zawiera 3 sztuki.', '', 'soudal-aplikator-do-piany-poliuretanowej-3-sztuki', '', '', '', 'Soudal Aplikator do piany poliuretanowej 3 sztuki', '', '', '', ''),
(156, 1, 1, 'Folia budowlana atestowana - czarna, marki Fola. Stanowi doskonałą barierę izolacyjną dla pary wodnej znajdującej się w środku budynku. Chroni przed zjawiskiem skraplania się pary wodnej z wewnątrz budynku podczas zetknięcia się z elementem o odpowiednio niższej temperaturze, zapewniając swobodną cyrkulację powietrza. Zabezpiecza przed zawilgoceniem izolacji termicznej lub akustycznej. Wykonanie z wysokiej jakości tworzywa zapewnią zwiększoną odporność na rozrywanie.', '', 'fola-folia-budowlana-atestowana-czarna-015-mm', '', '', '', 'Fola Folia budowlana atestowana czarna 0,15 mm', '', '', '', ''),
(157, 1, 1, 'Worki budowlane o wymiarach 70 cm x 110 cm, marki Jan Niezbędny. Bardzo grube, wytrzymałe i elastyczne worki przydatne podczas prac remontowych do transportu stałych i sypkich odpadów budowlanych czy gruzu. Pojemność 120L. W opakowaniu 15 sztuk.', '', 'jan-niezbedny-worki-budowlane-120l-15-stuk', '', '', '', 'Jan Niezbędny Worki budowlane 120l 15 stuk', '', '', '', ''),
(158, 1, 1, 'Worki budowlane o wymiarach 120 cm x 150 cm, marki Jan Niezbędny. Bardzo grube, wytrzymałe i elastyczne worki przydatne podczas prac remontowych do transportu stałych i sypkich odpadów budowlanych czy gruzu. Pojemność 240L. W opakowaniu 8 sztuk.', '', 'jan-niezbedny-worki-budowlane-240l', '', '', '', 'Jan Niezbędny Worki budowlane 240l', '', '', '', ''),
(159, 1, 1, 'Podest przeznaczony do przegubowej drabiny Corda 4x3. Wykonany z wytrzymałej blachy z antypoślizgowym karbowaniem zapewniającym bezpieczne użytkowanie. Wymiary założonej platformy na drabinie: 142 x 26 cm.', '', 'platforma-do-drabiny-corda-4x3', '', '', '', 'Platforma do drabiny Corda 4x3', '', '', '', ''),
(160, 1, 1, 'Podpora do rusztowania ClimTec pozwalająca na większą stabilizacje rusztowania, przy jego rozbudowie na kolejne kondygnacje. Zwiększa powierzchnie rozstawiania rusztowania i tym samym jego stabilność.', '', 'krause-podpora-do-rusztowania-climtec', '', '', '', 'Krause Podpora do rusztowania ClimTec', '', '', '', ''),
(161, 1, 1, 'Folia ochronna 200, czarna, marki Fola. Wykonana z polietylenu folia izolacyjno-ochronna o grubości 0,06 mm do zabezpieczania wszelkich powierzchni. Chroni przed zabrudzeniem podczas prac remontowych, malarskich czy ogrodniczych. Osłania konstrukcje, wykopy, rusztowania oraz wszelkie inne elementy narażone na uszkodzenia. Posiada doskonałą wytrzymałość mechaniczną i elastyczność.', '', 'fola-folia-do-ochrony-200-czarna-006-mm', '', '', '', 'Fola Folia do ochrony 200 czarna 0,06 mm', '', '', '', ''),
(162, 1, 1, 'Jest to gotowy do użycia, skuteczny płyn do czyszczenia pistoletów aplikacyjnych do pianki poliuretanowej. Opakowanie wyposażone zostało w standardowy gwint lub złącze typu click, które pozwala na czyszczenie standardowych pistoletów do pianki oraz gniazda i zaworu puszki. Płyn skutecznie i szybko usuwa też, świeże zbrudzenia nieutwardzonej pianki z rąk, narzędzi oraz tworzyw sztucznych odpornych na rozpuszczalniki. Może być również stosowany do odtłuszczania powierzchni metalowych, przed zastosowaniem poliuretanów.', '', 'czyscik-do-pianek-poliuretanowych-500-ml', '', '', '', 'Czyścik do pianek poliuretanowych 500 ml', '', '', '', ''),
(163, 1, 1, 'Worki na gruz o wymiarach 60 cm x 66 cm + 24 cm, marki Jan Niezbędny. Bardzo grube, wytrzymałe i elastyczne worki budowlane na gruz. Posiadają praktyczne uchwyty, umożliwiające łatwe i szczelne zawiązanie i przenoszenie wypełnionego worka. Pojemność 60L, 10 sztuk.', '', 'jan-niezbedny-worki-budowlane-torba-60-l', '', '', '', 'Jan Niezbędny Worki budowlane torba 60 l', '', '', '', ''),
(164, 1, 1, 'Worki na gruz o wymiarach 76 cm x 70 cm + 24 cm, marki Jan Niezbędny. Bardzo grube, wytrzymałe i elastyczne worki budowlane na gruz. Posiadają praktyczne uchwyty, umożliwiające łatwe i szczelne zawiązanie i przenoszenie wypełnionego worka. Pojemność 90L, 10 sztuk.', '', 'jan-niezbedny-worki-budowlane-torba-90-l', '', '', '', 'Jan Niezbędny Worki budowlane torba 90 l', '', '', '', ''),
(165, 1, 1, 'Klej do styropianu Styrofix, marki Baumaster to niskoprężny klej poliuretanowy z aplikatorem pistoletowym. Charakteryzuje się wysoką przyczepnością do płyt styropianowych w systemach ociepleń budynków, przy ociepleniu fundamentu i piwnic.  Zastosowanie kleju Styrofix Klej poliuretanowy sprawdzi się podczas klejenia płyt styropianowych w systemach ociepleń budynków metodą BSO oraz płyt XPS i EPS przy ocieplaniu fundamentów i przyziemnych części budynków. Stosowany jest także do montażu parapetów, wypełniania szczelin w izolacji termicznej oraz do klejenia kasetonów styropianowych i paneli ściennych.  Doskonała przyczepność Klej do styropianu posiada doskonała przyczepność do powierzchni ceramicznych, betonowych, drewnianych, PCV oraz wszelkiego rodzaju styropianów oraz tynków. Ponadto wysoka przyczepność kleju występuje również w przypadku podłoży z powłoką bitumiczną, papy i asfaltowych mas izolacyjnych. Klej po 2 godzinach od aplikacji jest wstępnie utwardzony i pozwala na kontynuację prac.  Temperatura pracy i wydajność Podczas pracy z klejem poliuretanowym Styrofix temperatura podłoża i powietrza powinna wynosić od -5 do +30 stopni. Natomiast temperatura puszki z klejem powinna wynosić około 20 stopni. W przypadku klejenia XPS wydajność opakowania wynosi do 12m2 powierzchni. Z kolei w przypadku klejenia BSO wynosi do 8 m2 powierzchni. Zużycie może się różnić w zależności od temperatury i wilgotności powietrza.', '', 'baumaster-klej-do-styropianu-styrofix-750-ml', '', '', '', 'Baumaster Klej do styropianu Styrofix 750 ml', '', '', '', ''),
(166, 1, 1, 'Baumaster Klej do styropianu Styrofix Aqua Graphite 750g Klej do styropianu Styrofix marki Baumaster to niskoprężny klej poliuretanowy z aplikatorem pistoletowym. Charakteryzuje się wysoką przyczepnością do płyt styropianowych w systemach ociepleń budynków, przy ociepleniu fundamentu i piwnic.  Zastosowanie kleju Styrofix Klej poliuretanowy sprawdzi się podczas klejenia płyt styropianowych w systemach ociepleń budynków metodą BSO oraz płyt XPS i EPS przy ocieplaniu fundamentów i przyziemnych części budynków. Stosowany jest także do montażu parapetów, wypełniania szczelin w izolacji termicznej oraz do klejenia kasetonów styropianowych i paneli ściennych.  Doskonała przyczepność Klej do styropianu posiada doskonała przyczepność do powierzchni ceramicznych, betonowych, drewnianych, PCV oraz wszelkiego rodzaju styropianów oraz tynków. Ponadto wysoka przyczepność kleju występuje również w przypadku podłoży z powłoką bitumiczną, papy i asfaltowych mas izolacyjnych. Klej po 2 godzinach od aplikacji jest wstępnie utwardzony i pozwala na kontynuację prac.  Temperatura pracy i wydajność Podczas pracy z klejem poliuretanowym Styrofix temperatura podłoża i powietrza powinna wynosić od -5 do +30 stopni. Natomiast temperatura puszki z klejem powinna wynosić około 20 stopni. W przypadku klejenia XPS wydajność opakowania wynosi do 12m2 powierzchni. Z kolei w przypadku klejenia BSO wynosi do 8 m2 powierzchni. Zużycie może się różnić w zależności od temperatury i wilgotności powietrza.', '', 'baumaster-klej-do-styropianu-styrofix-aqua-graphite-750g', '', '', '', 'Baumaster Klej do styropianu Styrofix Aqua Graphite 750g', '', '', '', ''),
(167, 1, 1, 'Folia budowlana czarna, o wymiarach 4 m x 8 m, marki Fola. Służy do zabezpieczenia powierzchni podczas prac budowlanych. Wykonanie z wysokiej jakości polietylenu zapewnia zwiększoną odporność na rozrywanie. Grubość folii: 0,15 mm.', '', 'fola-folia-budowlana-015-mm-4-m-x-8-m', '', '', '', 'Fola Folia budowlana 0,15 mm 4 m x 8 m', '', '', '', ''),
(168, 1, 1, 'Jednoskładnikowa wężykowa biała piana poliuretanowa firmy Ceresit o pojemności 750 ml. 4 x bardziej zwarta struktura zwiększa własciwości termoizolacyjne i dźwiękoszczelne. Optymalna niskoprężność zabezpiecza min. przed wypaczaniem profili drzwi i okien Pianka zapewnia zwiększenie dźwiękoszczelności nawet do -63 dB. Produkt wyróznia się wysoką elastycznością oraz 4 x większą odpornościa na promienie UV.', '', 'ceresit-piana-whiteteq-z-wezykiem-750-ml', '', '', '', 'Ceresit Piana Whiteteq z wężykiem, 750 ml', '', '', '', ''),
(169, 1, 1, 'Folia budowlana atestowana - czarna, marki Fola. Stanowi doskonałą barierę izolacyjną dla pary wodnej znajdującej się w środku budynku. Chroni przed zjawiskiem skraplania się pary wodnej z wewnątrz budynku podczas zetknięcia się z elementem o odpowiednio niższej temperaturze, zapewniając swobodną cyrkulację powietrza. Zabezpiecza przed zawilgoceniem izolacji termicznej lub akustycznej. Wykonanie z wysokiej jakości tworzywa zapewnią zwiększoną odporność na rozrywanie.', '', 'fola-folia-budowlana-atestowana-czarna-02-mm', '', '', '', 'Fola Folia budowlana atestowana czarna 0,2 mm', '', '', '', ''),
(170, 1, 1, 'Płachta remontowo-budowlana 3 m x 5 m. Wykonana z polietylenu folia izolacyjno-ochronna do zabezpieczania wszelkich powierzchni. Chroni przed zabrudzeniem podczas prac budowlanych, remontowych, malarskich czy ogrodniczych. Osłania konstrukcje, wykopy, rusztowania oraz wszelkie inne elementy narażone na uszkodzenia. Posiada doskonałą wytrzymałość mechaniczną i elastyczność.', '', 'fola-folia-remontowo-budowlana-3-m-x-5-m', '', '', '', 'Fola Folia remontowo-budowlana 3 m x 5 m', '', '', '', ''),
(171, 1, 1, 'Pianka do kręgów Genius Gun, 750 ml, marki Soudal. Jest to pianka przeznaczona do uszczelniania m.in. połączeń kręgów kanalizacyjnych, elementów konstrukcji szybów, studzienek, komór i kanałów telekomunikacyjnych. Charakteryzuje się podwyższoną odpornością na działanie związków organicznych. Aplikator Genius Gun umożliwia precyzyjne dozowanie - pełną kontrolę ilości pianki wypuszczanej z puszki.', '', 'soudal-pianka-do-kregow-genius-gun-750-ml', '', '', '', 'Soudal Pianka do kręgów Genius Gun 750 ml', '', '', '', ''),
(172, 1, 1, 'Folia budowlana atestowana - czarna, marki Fola. Stanowi doskonałą barierę izolacyjną dla pary wodnej znajdującej się w środku budynku. Chroni przed zjawiskiem skraplania się pary wodnej z wewnątrz budynku podczas zetknięcia się z elementem o odpowiednio niższej temperaturze, zapewniając swobodną cyrkulację powietrza. Zabezpiecza przed zawilgoceniem izolacji termicznej lub akustycznej. Wykonanie z wysokiej jakości tworzywa zapewnią zwiększoną odporność na rozrywanie.  Wymiary: Długość-12 m Szerokość- 4 m Grubość- 0,3 m', '', 'fola-folia-budowlana-czarna-030-mm', '', '', '', 'Fola Folia budowlana czarna 0,30 mm', '', '', '', ''),
(173, 1, 1, 'Worek budowlany, 5 sztuk, marki Fola. Wykonany z polipropylenu, mocny worek o ładowności 120 l. Przeznaczony do magazynowania i transportu stałych i sypkich odpadów budowlanych, gruzu. Idealny również do pakowania piasku, ziemi, drewna, węgla, miału, brykietów, ziemniaków, warzyw i owoców.', '', 'fola-worek-budowlany-czarny-120-l-5-sztuk', '', '', '', 'Fola Worek budowlany czarny 120 l 5 sztuk', '', '', '', ''),
(174, 1, 1, 'Podstawka do rusztowania kolumnowego typu warszawskiego 1-A/B firmy Rew-Ton. Kompletne rusztowanie ma zastosowane w budownictwie przy pracach murarskich, tynkarskich, malarskich, montażowych, instalacyjnych, ciesielskich, spawalniczych, szklarskich i innych. Rusztowanie może być wykorzystywane zarówno do wykonywania robót zewnętrznych, jak i wewnątrz budynków. Umożliwia wykonywanie prac na wysokości do 8,2 m. Jest przejezdne, bezpieczne, łatwe i szybkie w montażu. Odznacza się lekkością konstrukcji.', '', 'rew-ton-podstawka-do-rusztowania-kolumnowego', '', '', '', 'Rew-Ton Podstawka do rusztowania kolumnowego', '', '', '', ''),
(175, 1, 1, 'Worki budowlane o wymiarach 70 cm x 110 cm, marki Jan Niezbędny. Bardzo grube, wytrzymałe i elastyczne worki przydatne podczas prac remontowych do transportu stałych i sypkich odpadów budowlanych czy gruzu. Pojemność 120L. W opakowaniu 25 sztuk.', '', 'jan-niezbedny-worki-budowlane-120l-25-stuk', '', '', '', 'Jan Niezbędny Worki budowlane 120l 25 stuk', '', '', '', ''),
(176, 1, 1, 'Ręczny tynk gipsowy Goldband marki Knauf sprawdzi się podczas remontu. Goldbad to sucha zaprawa gipsowa, która sprawdzi podczas wyrównywania krzywych ścian, wypełniania ubytków, powstałych na skutek wymiany instalacji wodno-kanalizacyjnej lub elektrycznej oraz do tynkowania glifów wokół drzwi i okien.    Zastosowanie ręcznego tynku gipsowego Zaprawa gipsowa Knauf może być stosowana na wielu podłożach mineralnych, jak pustaki ceramiczne czy beton komórkowy, a także stare tynki gipsowe i wcześniej zagruntowane tynki cementowo-wapienne. Ręczny tynk gipsowy tworzy gładkie powierzchnie o dowolnej strukturze wewnątrz budynków na ścianach i sufitach. Pomieszczenia, w których można użyć tynku Goldband powinny wykazywać wilgotność powietrza na poziomie do 70%. To sprawia, że można go stosować w pokojach, piwnicach i na poddaszach, a nawet w szkolnych, hotelowych czy szpitalnych łazienkach. Tynk gipsowy sprawdzi się jako podłoże pod różnego rodzaju farby i tapety, jako podłoże do układania płytek i pod tynki wykończeniowe.  Sposób użycia Goldband Tynk Goldband można nakładać w warstwach o grubości do 8 do 35 mm. Jeśli jest potrzeba położenia grubszej warstwy tynku, należy wykonać drugą warstwę. Grubość obu warstw powinna wynosić maksymalnie 50 mm. Tynk gipsowy Goldband reguluje wilgotność powietrza w pomieszczeniach, dzięki higroskopijnym właściwościom gipsu. Higroskopijność sprawia, że nadmiar wilgoci zostaje pochłonięty, jeśli powietrze jest zbyt wilgotne. Gips oddaje również nadmiar wilgoci, jeśli powietrze staje się zbyt suche.  Czas schnięcia i zużycie Tynk gipsowy do obróbki tynkarskiej okien i drzwi wysycha przez 14 dni w przypadku warstwy o grubości 10 mm. Zaprawa gipsowa Knauf jest zdatna do użytku przez okres 6 miesięcy od daty produkcji. Średnie zużycie Goldband wynosi 13 kg na 1 m2 przy warstwie o grubości 15 mm. Zużycie może się różnić w zależności od rodzaju podłoża oraz grubości warstwy tynku gipsowego.', '', 'knauf-reczny-tynk-gipsowy-goldband-25-kg', '', '', '', 'Knauf Ręczny tynk gipsowy Goldband 25 kg', '', '', '', ''),
(177, 1, 1, 'Bardzo wydajny, lekki tynk gipsowy Knauf MP 75 Leicht, sprawdzi się najbardziej na inwestycjach, na których w krótkim czasie trzeba otynkować duże powierzchnie ścian i sufitów. Sprzyjają temu łatwość obróbki, technologia maszynowa oraz nakładanie tynku w jednej warstwie. Może być stosowany na wszystkich podłożach mineralnych. Sprawdzi się we wszystkich ogrzewanych zimą pomieszczeniach. Tworzy równe i gładkie powierzchnie, które nie wymagają dodatkowego wygładzania za pomocą gładzi. Tynk Knauf MP 75 Leicht to fabrycznie przygotowana sucha zaprawa gipsowa z dodatkiem lekkich kruszyw przeznaczona do wykonania tynków jednowarstwowych o grubości od 8 do 50 mm wewnątrz budynków w pomieszczeniach o maksymalnej wilgotności powietrza do 70%, a zatem także w kuchniach i łazienkach, które nie są użytkowane w celach przemysłowych. Produkt przeznaczony jest do tynkowania ścian z betonu komórkowego lub pustaków ceramicznych, a także na wylane z betonu sufity. Tynk Knauf MP 75L jest lekki i bardzo wydajny, odporny na ścieranie, reguluje wilgotność powietrza we wnętrzach dzięki właściwościom higroskopijnym gipsu, który pochłania nadmiar wilgoci, jeśli powietrze jest zbyt wilgotne oraz oddaje nadmiar wilgoci, jeśli powietrze staje się zbyt suche. Lekki skład produktu ułatwia obróbkę. Dodatkowo maszynowe nakładanie tynku w jednym cyklu technologicznym umożliwia szybką realizację prac tynkarskich o dużym wolumenie.', '', 'knauf-maszynowy-tynk-gipsowy-mp-75-leicht-25-kg', '', '', '', 'Knauf Maszynowy tynk gipsowy MP 75 Leicht 25 kg', '', '', '', ''),
(178, 1, 1, 'Baumaster Tynk mozaikowy kolor BM122 18kg Tynk strukturalny, mozaikowy, ozdobny, wykonany na bazie żywicy akrylowej i naturalnego lub barwionego kruszywa. Tynk przeznaczony jest do wykonywania ozdobnych wypraw tynkarskich wewnątrz i na zewnątrz budynku. Można go nakładać na podłożach betonowych, tynkach gipsowych, cementowych i cementowo-wapiennych oraz na płytach gipsowo-kartonowych i gipsowo-włóknowych. Jest elastyczny, odporny na duże naprężenia, wodo- i mrozoodporny, umiarkowanie poroprzepuszczalny oraz przyjazny środowisku naturalnemu. Ziarno: 1,5 mm Średnie zużycie: ok. 4 kg/m5', '', 'baumaster-tynk-mozaikowy-kolor-bm122-18kg', '', '', '', 'Baumaster Tynk mozaikowy kolor BM122 18kg', '', '', '', ''),
(179, 1, 1, 'Cechy Ręczny tynk gipsowy Knauf Goldband to znakomity wybór dla inwestorów planujących remont. Doskonale sprawdzi się do wyrównania krzywych ścian, otynkowania glifów wokół nowo wstawionych okien lub drzwi, albo do wypełnienia bruzd, które powstały podczas wymiany instalacji elektrycznej lub wodno-kanalizacyjnej. Małe opakowanie wystarczy na wykonanie niewielkiej naprawy ściany. Oszczędza materiał i koszty.  Zastosowanie Knauf Goldband to fabrycznie przygotowana sucha zaprawa gipsowa przeznaczona do tynkowania całych powierzchni ścian lub wypełniania ubytków na wszelkich podłożach mineralnych, takich jak beton komórkowy, pustaki ceramiczne, a także stare tynki gipsowe i cementowo-wapienne po wcześniejszym zagruntowaniu środkiem gruntującym. Może być nakładany do grubości 50 mm. Może być wykończony na gładko i wtedy nie wymaga dodatkowego wygładzania gładzią. Ręczna technologia wykonania umożliwia również kształtowanie struktury tynku przed jego wyschnięciem. Jak każdy tynk gipsowy Knauf Goldband reguluje wilgotność powietrza we wnętrzach dzięki właściwościom higroskopijnym gipsu, który pochłania nadmiar wilgoci, jeśli powietrze jest zbyt wilgotne oraz oddaje nadmiar wilgoci, jeśli powietrze staje się zbyt suche.', '', 'knauf-reczny-tynk-gipsowy-goldband-5-kg', '', '', '', 'Knauf Ręczny tynk gipsowy Goldband 5 kg', '', '', '', ''),
(180, 1, 1, 'Tynk gipsowy Knauf MP 75 to doskonały wybór do otynkowania ścian i sufitów. Nakładany maszynowo w jednej warstwie, czyli w jednym cyklu technologicznym, znacząco przyśpiesza wykonanie prac tynkarskich. Może być stosowany na wszystkich podłożach mineralnych. Sprawdzi się we wszystkich ogrzewanych zimą pomieszczeniach. Po wyschnięciu powstają równe i gładkie powierzchnie, które nie wymagają dodatkowego wygładzania za pomocą gładzi. Tynk Knauf MP 75 to gotowa do użycia zaprawa gipsowa przeznaczona do wykonania tynków jednowarstwowych o grubości od 8 do 50 mm wewnątrz budynków w pomieszczeniach o maksymalnej wilgotności powietrza do 70%, a zatem także w kuchniach i łazienkach, które nie są użytkowane w celach przemysłowych. Produkt przeznaczony jest do tynkowania ścian z betonu komórkowego lub pustaków ceramicznych, a także na wylane z betonu sufity. Tynk Knauf MP 75 jest odporny na ścieranie, reguluje wilgotność powietrza i tworzy we wnętrzach przyjemny i zdrowy klimat dzięki właściwościom higroskopijnym gipsu, który pochłania nadmiar wilgoci, jeśli powietrze jest zbyt wilgotne oraz oddaje nadmiar wilgoci, jeśli powietrze staje się zbyt suche. Maszynowa technologia nakładania tynku przyspiesza wykonanie prac tynkarskich. Tynk polecany jest do tynkowania ścian i sufitów nie tylko w budownictwie mieszkaniowym, ale także w obiektach publicznych, takich jak szkoły, urzędy, hotele itp.', '', 'knauf-maszynowy-tynk-gipsowy-mp-75-25-kg', '', '', '', 'Knauf Maszynowy tynk gipsowy MP 75 25 kg', '', '', '', ''),
(181, 1, 1, 'Baumaster Tynk mozaikowy kolor BM537 15kg Tynk strukturalny, mozaikowy, ozdobny, wykonany na bazie żywicy akrylowej i naturalnego lub barwionego kruszywa. Tynk przeznaczony jest do wykonywania ozdobnych wypraw tynkarskich wewnątrz i na zewnątrz budynku. Można go nakładać na podłożach betonowych, tynkach gipsowych, cementowych i cementowo-wapiennych oraz na płytach gipsowo-kartonowych i gipsowo-włóknowych. Jest elastyczny, odporny na duże naprężenia, wodo- i mrozoodporny, umiarkowanie poroprzepuszczalny oraz przyjazny środowisku naturalnemu. Ziarno: 1,5 mm Średnie zużycie: ok. 4 kg/m5', '', 'baumaster-tynk-mozaikowy-kolor-bm537-15kg', '', '', '', 'Baumaster Tynk mozaikowy kolor BM537 15kg', '', '', '', ''),
(182, 1, 1, 'Ręczny tynk gipsowy Rotband marki Knauf to tynk o zwiększonej przyczepności. Knauf Rotband to sucha zaprawa gipsowa przeznaczona do wykonania jednowarstwowych tynków na podłożach mineralnych. Ręczna technologia wykonania daje możliwość kształtowania struktury tynku przed jego wyschnięciem.    Wysoka przyczepność Dzięki wysokiej przyczepności ręczny tynk gipsowy Knauf doskonale się sprawdza zwłaszcza na trudnych podłoża mineralnych typu beton. Dzięki Rotband można ręcznie tynkować sufity i uzupełniać ubytki tynku na suficie. Tynk gipsowy można stosować również do tynkowania ścian. Przy pomocy zaprawy gipsowej Rotband można wykończyć pracę na gładko, dzięki czemu nie trzeba wygładzać ścian gładzią ani wykonywać dodatkowej struktury.  Zastosowanie tynku gipsowego Ręczny tynk gipsowy tworzy gładkie powierzchnie o dowolnej strukturze wewnątrz budynków na ścianach i sufitach. Pomieszczenia, w których można użyć tynku Rotband powinny wykazywać wilgotność powietrza na poziomie do 70%. To sprawia, że można go stosować w pokojach, piwnicach i na poddaszach, a nawet w szkolnych, hotelowych czy szpitalnych łazienkach. Tynk gipsowy sprawdzi się jako podłoże pod różnego rodzaju farby i tapety, jako podłoże do układania płytek i pod tynki wykończeniowe.  Sposób użycia ręcznego tynku gipsowego Tynk Rotband można nakładać w warstwach o grubości do 5 do 35 mm. Jeśli jest potrzeba położenia grubszej warstwy tynku, należy wykonać drugą warstwę. Grubość obu warstw powinna wynosić maksymalnie 50 mm. Wysoka przyczepność tynku gipsowego Knauf daje możliwość użycia szczególnie na trudnych podłożach. Tynk gipsowy Rotband reguluje wilgotność powietrza w pomieszczeniach, dzięki higroskopijnym właściwościom gipsu. Higroskopijność sprawia, że nadmiar wilgoci zostaje pochłonięty, jeśli powietrze jest zbyt wilgotne. Gips oddaje również nadmiar wilgoci, jeśli powietrze staje się zbyt suche.', '', 'knauf-reczny-tynk-gipsowy-rotband-25-kg', '', '', '', 'Knauf Ręczny tynk gipsowy Rotband 25 kg', '', '', '', ''),
(183, 1, 1, '', '', 'kreisel-tynk-silikatowo-silikonowy-dekoracyjny-ts0725-kg', '', '', '', 'Kreisel Tynk silikatowo-silikonowy dekoracyjny TS07,25 kg', '', '', '', ''),
