(186, 1, 1, '', '', 'kreisel-sisitynk-ts05-25-tynk-silikatowo-silikonowy', '', '', '', 'Kreisel SISITYNK TS05 25 Tynk silikatowo-silikonowy', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(187, 1, 1, 'Mineralny tynk cienkowarstwowy. Zaprawa na bazie cementu do ręcznego wykonywania cienkowarstwowej wyprawy tynkarskiej o strukturze \"baranka\". Wchodzi w skład systemów ociepleń TURBO i TURBO-W firmy Kreisel. Po wyschnięciu tworzy dobrze przyczepną, paroprzepuszczalną, trwałą wyprawę tynkarską. Tynk o strukturze do 2 mm nadaje się także do nanoszenia mechanicznego. Zużycie: 1,0 mm - 2,1kg/m2, 1,5 mm - 2,5kg/m2, 2,0 mm - 2,9kg/m2, 3,0mm - 4,1kg/m2 Uziarnienie: 1,0 mm lub 1,5 mm lub 2,0 mm lub 3,0 mm Czas przydatności do użycia po zarobieniu wodą: 2 godziny (w temperaturze +20°C) Czas obróbki: do 20 minut Czas schnięcia warstwy: od 24 do 48 godzin Przepuszczalność pary wodnej: ? 0,26m (dla system pokrytego powłoką wykończeniową) Kolor: biały', '', 'kreisel-tynk-mineralny-poztynk-sz-062-bialy-baranek-2-mm-25-kg', '', '', '', 'Kreisel Tynk mineralny Poztynk SZ 062 biały baranek 2 mm 25 kg', '', '', '', ''),
(188, 1, 1, 'Cekol ZT-02 jest tynkiem cementowo-wapiennym, który można nakładać ręcznie oraz maszynowo. Jest to produkt wydajny, doskonale przyczepny do stosowania wewnątrz i na zewnątrz budynków. Tworzy gładką powierzchnię, a przy tym - jest bardzo łatwy w obróbce. Po stwardnieniu jest mrozoodporny i wodoodporny. Dane techniczne: - Wydajność: około 1,7 kg/m2/mm - Minimalna grubość warstwy: 5 mm - Maksymalna grubość warstwy: 20 mm - Wytrzymałość na ściskanie: 2 N/mm2 - Przyczepność: 0,3 N/mm2, FP-b - Absorpcja wody: c 0,40 kg/m2 min - Reakcja na ogień: A1 - Temperatura wykonywania prac: +5°C - 25°C', '', 'cekol-tynk-cementowo-wapienny-zt-02-25-kg', '', '', '', 'Cekol Tynk cementowo-wapienny ZT-02 25 kg', '', '', '', ''),
(189, 1, 1, 'Cechy  Ręczny tynk gipsowy Knauf Rotband to tynk o zwiększonej przyczepności, dzięki czemu polecany jest zwłaszcza na trudne podłoża mineralne, np. betonowe. Doskonale sprawdzi się do ręcznego tynkowania sufitów, a także do uzupełnienia ubytków tynku na suficie. Można użyć go również do tynkowania ścian. Rotband można wykończyć na gładko i wtedy nie wymaga dodatkowego wygładzania za pomocą gładzi albo wykonać strukturę. Małe opakowanie wystarczy na wykonanie niewielkiej naprawy np. sufitu. Oszczędza materiał i koszty.  Zastosowanie  Knauf Rotband to fabrycznie przygotowana sucha zaprawa gipsowa o zwiększonej przyczepności do wykonania jednowarstwowych tynków na podłożach mineralnych. Tynk może być nakładany już od grubości 5 do 35 mm. Jeśli istnieje konieczność położenia grubszej warstwy tynku, to należy wykonać go dwuwarstwowo do maksymalnej grubości 50 mm. Z uwagi na wysoką przyczepność Rotband poleca się zwłaszcza na trudne podłoża, np. gładkie betony. Może być wykończony na gładko i wtedy nie wymaga dodatkowego wygładzania gładzią. Ręczna technologia wykonania umożliwia również kształtowanie struktury tynku przed jego wyschnięciem. Jak każdy tynk gipsowy Knauf Rotband reguluje wilgotność powietrza we wnętrzach dzięki właściwościom higroskopijnym gipsu, który pochłania nadmiar wilgoci, jeśli powietrze jest zbyt wilgotne oraz oddaje nadmiar wilgoci, jeśli powietrze staje się zbyt suche.', '', 'knauf-reczny-tynk-gipsowy-rotband-5-kg', '', '', '', 'Knauf Ręczny tynk gipsowy Rotband 5 kg', '', '', '', ''),
(190, 1, 1, 'Baumaster Tynk mozaikowy kolor BM535 5kg Tynk strukturalny, mozaikowy, ozdobny, wykonany na bazie żywicy akrylowej i naturalnego lub barwionego kruszywa. Tynk przeznaczony jest do wykonywania ozdobnych wypraw tynkarskich wewnątrz i na zewnątrz budynku. Można go nakładać na podłożach betonowych, tynkach gipsowych, cementowych i cementowo-wapiennych oraz na płytach gipsowo-kartonowych i gipsowo-włóknowych. Jest elastyczny, odporny na duże naprężenia, wodo- i mrozoodporny, umiarkowanie poroprzepuszczalny oraz przyjazny środowisku naturalnemu. Ziarno: 1,5 mm Średnie zużycie: ok. 4 kg/m5', '', 'baumaster-tynk-mozaikowy-kolor-bm535-5kg', '', '', '', 'Baumaster Tynk mozaikowy kolor BM535 5kg', '', '', '', ''),
(191, 1, 1, 'Baumaster Tynk mozaikowy kolor BM 546 15kg Tynk strukturalny, mozaikowy, ozdobny, wykonany na bazie żywicy akrylowej i naturalnego lub barwionego kruszywa. Tynk przeznaczony jest do wykonywania ozdobnych wypraw tynkarskich wewnątrz i na zewnątrz budynku. Można go nakładać na podłożach betonowych, tynkach gipsowych, cementowych i cementowo-wapiennych oraz na płytach gipsowo-kartonowych i gipsowo-włóknowych. Jest elastyczny, odporny na duże naprężenia, wodo- i mrozoodporny, umiarkowanie poroprzepuszczalny oraz przyjazny środowisku naturalnemu. Ziarno: 1,5 mm Średnie zużycie: ok. 4 kg/m2', '', 'baumaster-tynk-mozaikowy-kolor-bm-546-15kg', '', '', '', 'Baumaster Tynk mozaikowy kolor BM 546 15kg', '', '', '', ''),
(192, 1, 1, 'Baumaster Tynk mozaikowy kolor BM535 15kg Tynk strukturalny, mozaikowy, ozdobny, wykonany na bazie żywicy akrylowej i naturalnego lub barwionego kruszywa. Tynk przeznaczony jest do wykonywania ozdobnych wypraw tynkarskich wewnątrz i na zewnątrz budynku. Można go nakładać na podłożach betonowych, tynkach gipsowych, cementowych i cementowo-wapiennych oraz na płytach gipsowo-kartonowych i gipsowo-włóknowych. Jest elastyczny, odporny na duże naprężenia, wodo- i mrozoodporny, umiarkowanie poroprzepuszczalny oraz przyjazny środowisku naturalnemu. Ziarno: 1,5 mm Średnie zużycie: ok. 4 kg/m5', '', 'baumaster-tynk-mozaikowy-kolor-bm535-15kg', '', '', '', 'Baumaster Tynk mozaikowy kolor BM535 15kg', '', '', '', ''),
(193, 1, 1, 'Cechy  Ręczny tynk gipsowy Knauf Goldband to znakomity wybór dla inwestorów planujących remont. Doskonale sprawdzi się do wyrównania krzywych ścian, otynkowania glifów wokół nowo wstawionych okien lub drzwi, albo do wypełnienia bruzd, które powstały podczas wymiany instalacji elektrycznej lub wodno-kanalizacyjnej. Małe opakowanie wystarczy na wykonanie niewielkiej naprawy ściany. Oszczędza materiał i koszty.  Zastosowanie  Knauf Goldband to fabrycznie przygotowana sucha zaprawa gipsowa przeznaczona do tynkowania całych powierzchni ścian lub wypełniania ubytków na wszelkich podłożach mineralnych, takich jak beton komórkowy, pustaki ceramiczne, a także stare tynki gipsowe i cementowo-wapienne po wcześniejszym zagruntowaniu środkiem gruntującym. Może być nakładany w jednej warstwie o grubości od 8 do 35 mm, lub w dwóch warstwach nawet do 50 mm. Może być wykończony na gładko i wtedy nie wymaga dodatkowego wygładzania gładzią. Ręczna technologia wykonania umożliwia również kształtowanie struktury tynku przed jego wyschnięciem. Jak każdy tynk gipsowy Knauf Golbdand reguluje wilgotność powietrza we wnętrzach dzięki właściwościom higroskopijnym gipsu, który pochłania nadmiar wilgoci, jeśli powietrze jest zbyt wilgotne oraz oddaje nadmiar wilgoci, jeśli powietrze staje się zbyt suche.', '', 'knauf-reczny-tynk-gipsowy-goldband-10-kg', '', '', '', 'Knauf Ręczny tynk gipsowy Goldband 10 kg', '', '', '', ''),
