(196, 1, 1, 'Podkład pod tynki strukturalne BAUMASTER - środek do wzmacniania, impregnowania i kolorowania podłoża. Gotowy do użycia, płytko penetrujący środek przeznaczony do gruntowania podłoży pod tynki strukturalne do wewnątrz i na zewnątrz.', '', 'podklad-mozaikowy-pod-tynki-strukturalne-baumaster-16-kg', '', '', '', 'Podkład mozaikowy pod tynki strukturalne BAUMASTER 16 kg', '', '', '', ''),
(197, 1, 1, 'Mineralny tynk cienkowarstwowy. Zaprawa na bazie cementu do ręcznego wykonywania cienkowarstwowej wyprawy tynkarskiej o strukturze \"baranka\". Wchodzi w skład systemów ociepleń TURBO i TURBO-W firmy Kreisel. Po wyschnięciu tworzy dobrze przyczepną, paroprzepuszczalną, trwałą wyprawę tynkarską. Tynk o strukturze do 2 mm nadaje się także do nanoszenia mechanicznego. Zużycie: 1,0 mm - 2,1kg/m2, 1,5 mm - 2,5kg/m2, 2,0 mm - 2,9kg/m2, 3,0mm - 4,1kg/m2 Uziarnienie: 1,0 mm lub 1,5 mm lub 2,0 mm lub 3,0 mm Czas przydatności do użycia po zarobieniu wodą: 2 godziny (w temperaturze +20°C) Czas obróbki: do 20 minut Czas schnięcia warstwy: od 24 do 48 godzin Przepuszczalność pary wodnej: ? 0,26m (dla system pokrytego powłoką wykończeniową) Kolor: biały', '', 'kreisel-tynk-mineralny-poztynk-sz-061-bialy-drapany-2-mm-25-kg', '', '', '', 'Kreisel Tynk mineralny Poztynk SZ 061 biały drapany 2 mm 25 kg', '', '', '', ''),
