(199, 1, 1, 'Mineralny tynk cienkowarstwowy. Zaprawa na bazie cementu do ręcznego wykonywania cienkowarstwowej wyprawy tynkarskiej o strukturze \"baranka\". Wchodzi w skład systemów ociepleń TURBO i TURBO-W firmy Kreisel. Po wyschnięciu tworzy dobrze przyczepną, paroprzepuszczalną, trwałą wyprawę tynkarską. Tynk o strukturze do 2 mm nadaje się także do nanoszenia mechanicznego. Zużycie: 1,0 mm - 2,1kg/m2, 1,5 mm - 2,5kg/m2, 2,0 mm - 2,9kg/m2, 3,0mm - 4,1kg/m2 Uziarnienie: 1,0 mm lub 1,5 mm lub 2,0 mm lub 3,0 mm Czas przydatności do użycia po zarobieniu wodą: 2 godziny (w temperaturze +20°C) Czas obróbki: do 20 minut Czas schnięcia warstwy: od 24 do 48 godzin Przepuszczalność pary wodnej: 0,26m (dla system pokrytego powłoką wykończeniową) Kolor: biały', '', 'kreisel-tynk-mineralny-poztynk-062-bialy-baranek-15-mm-25-kg', '', '', '', 'Kreisel Tynk mineralny Poztynk 062 biały baranek 1,5 mm 25 kg', '', '', '', ''),
(200, 1, 1, 'Baumaster Tynk mozaikowy kolor BM122 15kg Tynk strukturalny, mozaikowy, ozdobny, wykonany na bazie żywicy akrylowej i naturalnego lub barwionego kruszywa. Tynk przeznaczony jest do wykonywania ozdobnych wypraw tynkarskich wewnątrz i na zewnątrz budynku. Można go nakładać na podłożach betonowych, tynkach gipsowych, cementowych i cementowo-wapiennych oraz na płytach gipsowo-kartonowych i gipsowo-włóknowych. Jest elastyczny, odporny na duże naprężenia, wodo- i mrozoodporny, umiarkowanie poroprzepuszczalny oraz przyjazny środowisku naturalnemu. Ziarno: 1,5 mm Średnie zużycie: ok. 4 kg/m5', '', 'baumaster-tynk-mozaikowy-kolor-bm122-15kg', '', '', '', 'Baumaster Tynk mozaikowy kolor BM122 15kg', '', '', '', ''),
(201, 1, 1, 'Cechy  Ręczny tynk gipsowy Knauf Rotband to tynk o zwiększonej przyczepności, dzięki czemu polecany jest zwłaszcza na trudne podłoża mineralne, np. betonowe. Doskonale sprawdzi się do ręcznego tynkowania sufitów, a także do uzupełnienia ubytków tynku na suficie. Można użyć go również do tynkowania ścian. Rotband można wykończyć na gładko i wtedy nie wymaga dodatkowego wygładzania za pomocą gładzi albo wykonać strukturę. Małe opakowanie wystarczy na wykonanie niewielkiej naprawy np. sufitu. Oszczędza materiał i koszty.  Zastosowanie  Knauf Rotband to fabrycznie przygotowana sucha zaprawa gipsowa o zwiększonej przyczepności do wykonania jednowarstwowych tynków na podłożach mineralnych. Tynk może być nakładany już od grubości 5 do 35 mm. Jeśli istnieje konieczność położenia grubszej warstwy tynku, to należy wykonać go dwuwarstwowo do maksymalnej grubości 50 mm. Z uwagi na wysoką przyczepność Rotband poleca się zwłaszcza na trudne podłoża, np. gładkie betony. Może być wykończony na gładko i wtedy nie wymaga dodatkowego wygładzania gładzią. Ręczna technologia wykonania umożliwia również kształtowanie struktury tynku przed jego wyschnięciem. Jak każdy tynk gipsowy Knauf Rotband reguluje wilgotność powietrza we wnętrzach dzięki właściwościom higroskopijnym gipsu, który pochłania nadmiar wilgoci, jeśli powietrze jest zbyt wilgotne oraz oddaje nadmiar wilgoci, jeśli powietrze staje się zbyt suche.', '', 'knauf-reczny-tynk-gipsowy-rotband-10-kg', '', '', '', 'Knauf Ręczny tynk gipsowy Rotband 10 kg', '', '', '', ''),
