(205, 1, 1, 'ECO TYNK 022 baranek biały 25 kg marki Kreisel.  ECO TYNK baranek biały firmy Kreisel to jedyny w Polsce tynk stworzony na bazie ekologicznych spoiw polimerowych naturalnych wypełniaczy i kruszyw, z systemem ochrony biologicznej ECO PROTECT na bazie aktywnego srebra. Tynk ten przeznaczony jest do cienkowarstwowych zapraw tynkarskich. Charakteryzuje się wysoką paroprzepuszczalnością. Świetnie sprawdza się na budynkach położonych w pobliżu terenów zielonych i zbiorników wodnych oraz terenów górskich. Zużycie dla ziarna baranek 1,5 mm: ok.2,4 kg/m2. Wydajność: ok. 10,4 m2/wiadro/ baranek 1,5 mm.', '', 'kreisel-eco-tynk-baranek-bialy-25-kg', '', '', '', 'Kreisel ECO TYNK baranek biały 25 kg', '', '', '', ''),
