(209, 1, 1, 'Podkład tynkarski Tynkolit-T 330 biały, marki Kreisel. Przeznaczony jest do ostatecznego przygotowania powierzchni przed nanoszeniem tynków mineralnych, akrylowych i mozaikowych. Ogranicza i wyrównuje chłonność podłoży, ułatwia wykonywanie wypraw tynkarskich, zwiększając ich przyczepność. Paroprzepuszczalny, wodo- i mrozoodporny.', '', 'kreisel-podklad-tynkarski-tynkolit-t-330-bialy-7-kg', '', '', '', 'Kreisel Podkład tynkarski Tynkolit-T 330 biały 7 kg', '', '', '', ''),
