(216, 1, 1, 'Baumaster Tynk mozaikowy kolor BM122 5kg Tynk strukturalny, mozaikowy, ozdobny, wykonany na bazie żywicy akrylowej i naturalnego lub barwionego kruszywa. Tynk przeznaczony jest do wykonywania ozdobnych wypraw tynkarskich wewnątrz i na zewnątrz budynku. Można go nakładać na podłożach betonowych, tynkach gipsowych, cementowych i cementowo-wapiennych oraz na płytach gipsowo-kartonowych i gipsowo-włóknowych. Jest elastyczny, odporny na duże naprężenia, wodo- i mrozoodporny, umiarkowanie poroprzepuszczalny oraz przyjazny środowisku naturalnemu. Ziarno: 1,5 mm Średnie zużycie: ok. 4 kg/m9', '', 'baumaster-tynk-mozaikowy-kolor-bm122-5kg', '', '', '', 'Baumaster Tynk mozaikowy kolor BM122 5kg', '', '', '', ''),
(217, 1, 1, 'Grunt pod tynki Big Mass GT w wiaderku o wadze 7 kg.  Grunt jest preparatem przeznaczonym do ostatecznego przygotowania powierzchni przed pokryciem ich tynkami mozaikowymi, mineralnymi lub akrylowymi. Reguluje chłonność oraz zmniejsza nasiąkliwość podłoża i zużycie masy tynkarskiej. Ułatwia aplikację oraz zwiększa siłę wiązania tynków z podłożem. Nadaje się do stosowania na wszystkie rodzaje podłoży budowlanych wewnątrz i na zewnątrz budynków. Wszystkie podłoża powinny być właściwie wysezonowane, oczyszczone z kurzu, tłuszczów, smarów, środków antyadhezyjnych, resztek farb itp. Powinny mieć odpowiednią nośność, stałą i jednorodną strukturę. Preparat gruntujący nanosi się na ścianę przy pomocy wałka lub pędzla. Środek należy przed użyciem wymieszać w celu ujednolicenia konsystencji. Niedopuszczalne jest prowadzenie prac w temperaturze otoczenia niższej niż +5°C oraz wyższej niż +25°C, w czasie opadów atmosferycznych, podczas silnego wiatru i przy dużym nasłonecznieniu elewacji. Zużycie: ok. 0,20-0,25 kg na 1 m2 (w zależności od chłonności i chropowatości podłoża)', '', 'big-mass-grunt-pod-tynki-gt-7-kg', '', '', '', 'Big Mass Grunt pod tynki GT 7 kg', '', '', '', ''),
(218, 1, 1, 'Podkładowa masa tynkarska Cerplast, marki Atlas, 10 kg. Gruntuje podłoża pod tynki cienkowarstwowe. Ułatwia ich fakturowanie oraz nakładanie. Łatwa w aplikacji. Do stosowania pod tynki zewnętrzne i wewnętrzne. Wpływa na wysoką przyczepność tynku, wzmacniając podłoże.', '', 'atlas-podkladowa-masa-tynkarska-cerplast-10-kg', '', '', '', 'Atlas Podkładowa masa tynkarska Cerplast 10 kg', '', '', '', ''),
(219, 1, 1, 'Podkładowa masa tynkarska Cerplast, marki Atlas, 15 kg. Przeznaczona do gruntowania podłoża pod tynki cienkowarstwowe Atlas - mineralne, akrylowe, akrylowo-silikonowe oraz mozaikowe Deko M. Do stosowania na podłoża betonowe oraz na mury z cegieł, bloczków i pustaków ceramicznych, komórkowych bądź silikatowych, a także na płyty gipsowo-kartonowe i systemy ociepleń ze styropianem, XPS i wełną mineralną. Cerplast posiada wysoką przyczepność, silnie przylega do podłoża oraz do nakładanych tynków. Zapobiega zbyt intensywnemu oddawaniu do podłoża wody. Ułatwia nakładanie kolejnej warstwy. Stanowi chemiczną barierę pomiędzy podłożem a tynkiem. Ogranicza przebijanie koloru z podłoża i powstawanie plam na powierzchni tynku. Chropowata powierzchnia redukuje poślizg nakładanego tynku. Podkładowa masa tynkarska tworzy tymczasową ochronę przed warunkami atmosferycznymi dla nieotynkowanej elewacji.', '', 'atlas-podkladowa-masa-tynkarska-cerplast-15-kg', '', '', '', 'Atlas Podkładowa masa tynkarska Cerplast 15 kg', '', '', '', ''),
(220, 1, 1, 'Podkładowa masa tynkarska Cerplast, marki Atlas, 25 kg. Przeznaczona do gruntowania podłoża pod tynki cienkowarstwowe Atlas - mineralne, akrylowe, akrylowo-silikonowe oraz mozaikowe Deko M. Do stosowania na podłoża betonowe oraz na mury z cegieł, bloczków i pustaków ceramicznych, komórkowych bądź silikatowych, a także na płyty gipsowo-kartonowe i systemy ociepleń ze styropianem, XPS i wełną mineralną. Cerplast posiada wysoką przyczepność, silnie przylega do podłoża oraz do nakładanych tynków. Zapobiega zbyt intensywnemu oddawaniu do podłoża wody. Ułatwia nakładanie kolejnej warstwy. Stanowi chemiczną barierę pomiędzy podłożem a tynkiem. Ogranicza przebijanie koloru z podłoża i powstawanie plam na powierzchni tynku. Chropowata powierzchnia redukuje poślizg nakładanego tynku. Podkładowa masa tynkarska tworzy tymczasową ochronę przed warunkami atmosferycznymi dla nieotynkowanej elewacji.', '', 'atlas-podkladowa-masa-tynkarska-cerplast-25-kg', '', '', '', 'Atlas Podkładowa masa tynkarska Cerplast 25 kg', '', '', '', ''),
(221, 1, 1, 'Cekol PI-01 to doskonały preparat do impregnacji i zabezpieczenia tynku dekoracyjnego TD-01. Jest bezrozpuszczalnikowy, bezbarwny i nadaje powierzchni połysk. Do stosowania wewnątrz oraz na zewnątrz budynków. Dane techniczne: Czas schnięcia: w zależności od temperatury i wilgotności: od 2 do 24 h - Wydajność: 8 - 10 m2 z 1 l - Temperatura stosowania i podłoża: +5°C - 25°C', '', 'cekol-preparat-do-impregnacji-tynku-dekoracyjnego-pi-01-1-l', '', '', '', 'Cekol Preparat do impregnacji tynku dekoracyjnego PI-01 1 l', '', '', '', ''),
