(224, 1, 1, 'Cement Classic Monolit. Cement o ogólnym zastosowaniu. Przeznaczony do produkcji zapraw murarskich i tynkarskich. Stosowany również do wykonywania betonów zbrojonych, elementów konstrukcyjnych. Opakowanie: 25 kg.', '', 'cement-classic-monolit-25-kg', '', '', '', 'Cement Classic Monolit 25 kg', '', '', '', ''),
(225, 1, 1, '', '', 'ceresit-zaprawa-szybkowiazaca-cx5-5-kg', '', '', '', 'Ceresit Zaprawa szybkowiążąca CX5 5 kg', '', '', '', ''),
(226, 1, 1, 'Cement CEM II/B-V 32,5 R to cement portlandzki popiołowy klasy 32,5 z dodatkiem lotnego popiołu węglowego. Wyróżnia się wydłużonym czasem urabialności oraz doskonałą pompowalnością przygotowanej przy jego użyciu mieszanki betonowej. Wysokie wytrzymałości w długich okresach dojrzewania, powodują niski skurcz oraz zwiększona odporność na agresję siarczanową. Cement doskonale nadaje się , do wykonywania fundamentów i konstrukcji nośnych, a także do stabilizacji gruntów i podbudowy dróg. Stosowany do produkcji betonu, prefabrykatów betonowych, zapraw, zaczynów, mieszanek i innych materiałów zawierających cement, z uwzględnieniem odpowiednich norm i przepisów przyjętych w miejscu stosowania.', '', 'cement-cemii-325r-25-kg', '', '', '', 'Cement CEMII 32,5R 25 kg', '', '', '', ''),
(227, 1, 1, 'Plastyfikator zimowy Flux-ZM, marki Primacol, 5 l. Przeznaczony do produkcji wszelkich typów betonu w warunkach zimowych, w temperaturze do -8 st. C. Silnie uplastycznia i poprawia urabialność betonu, redukując ilość wody zarobowej o co najmniej 18 procent. Powoduje znaczny wzrost wytrzymałości betonu oraz zwiększa jego mrozoodporność. Nie zmienia napowietrzenia świeżej mieszanki i czasu jej wiązania. Flux-ZM szczególnie polecany jest do wytwarzania w ujemnych temperaturach otoczenia ścian oporowych, dachówek cementowych, kostki brukowej, płyt kanałowych i chodnikowych oraz do wykonywania wylewek, również pod ogrzewanie podłogowe.', '', 'primacol-plastyfikator-zimowy-flux-zm-5-l', '', '', '', 'Primacol Plastyfikator zimowy Flux-ZM 5 l', '', '', '', ''),
(228, 1, 1, '', '', 'wapno-hydratyzowane-natura-classic-20-kg', '', '', '', 'Wapno hydratyzowane Natura/Classic 20 kg', '', '', '', ''),
(229, 1, 1, 'Plastyfikator zimowy Flux-ZM, marki Primacol, 1 l. Przeznaczony do produkcji wszelkich typów betonu w warunkach zimowych, w temperaturze do -8 st. C. Silnie uplastycznia i poprawia urabialność betonu, redukując ilość wody zarobowej o co najmniej 18 procent. Powoduje znaczny wzrost wytrzymałości betonu oraz zwiększa jego mrozoodporność. Nie zmienia napowietrzenia świeżej mieszanki i czasu jej wiązania. Flux-ZM szczególnie polecany jest do wytwarzania w ujemnych temperaturach otoczenia ścian oporowych, dachówek cementowych, kostki brukowej, płyt kanałowych i chodnikowych oraz do wykonywania wylewek, również pod ogrzewanie podłogowe.', '', 'primacol-plastyfikator-zimowy-flux-zm-1-l', '', '', '', 'Primacol Plastyfikator zimowy Flux-ZM 1 l', '', '', '', ''),
(230, 1, 1, 'Zaprawa montażowa Lampocem, marki Mapei, 5 kg. Jest to gotowe do użycia, schnące bezskurczowo spoiwo hydrauliczne. Lampocem jest używany do szybkiego montażu różnego rodzaju elementów do betonu i muru. Jest idealny do osadzania śrub, kotew, ram, a także do zewnętrznego zamykania rys. Spoiwo ma krótki czas wiązania (3 minuty w temperaturze +20 st.C). Po zmieszaniu z wodą tworzy plastyczną masę, łatwą do nakładania także na powierzchniach pionowych, bez konieczności użycia szalunku. Zapewnia trwałość połączeń, jest odporny na pękanie, gwarantuje szybki i skuteczny efekt.', '', 'mapei-zaprawa-montazowa-lampocem-5-kg', '', '', '', 'Mapei Zaprawa montażowa Lampocem 5 kg', '', '', '', ''),
(231, 1, 1, 'Idealny do prac naprawczych. Odporny na warunki atmosferyczne. Grubość warstwy do 20 mm.', '', 'knauf-ff-cement-bialy-15kg', '', '', '', 'Knauf F+F Cement biały 1,5kg', '', '', '', ''),
(232, 1, 1, 'Do szybkiego uszczelniania lub zatrzymywania wycieku wody Idealne wypełnienie bez skurczu. Wysoka wytrzymałość po ok. 15 minutach. Odporny na działanie warunków atmosferycznych, wodoodporny.', '', 'knauf-ff-cement-szybkowiazacy-15kg', '', '', '', 'Knauf F+F Cement szybkowiążący 1,5kg', '', '', '', ''),
(233, 1, 1, 'Zaprawa szybkowiążąca CX 5 marki Ceresit to przygotowana fabrycznie sucha mieszanka, która wiąże w przeciągu 5 minut elementy z tworzyw sztucznych, metalowe i plastikowe z betonem, murem lub tynkiem cementowym.    Zastosowanie zaprawy montażowej CX 5 Cement montażowy CX 5 Ceresit daje możliwość mocowania poręczy, krat, szafek instalacyjnych, wsporników, przewodów i puszek. Wodoszczelną zaprawę stosuje się tak samo wewnątrz, jak i na zewnątrz budynków w warunkach suchych i mokrych. Szybkowiążący cement wypełnia otwory montażowe, wyokrąglenia naroży oraz ubytki w miejscach mocowania kotew i elementów stalowych.  Wodoszczelność zaprawy Ceresit Cement wodoszczelny umożliwia miejscowe uszczelnianie konstrukcji betonowych i może tamować miejscowe wycieki wody. Dzięki wodoszczelności może być stosowany w łazienkach, np. podczas mocowania ceramiki łazienkowej jak umywalka. Zaprawę szybkowiążącą można też wykorzystać w ogrodzie do wykonania podlewki pod lampę ogrodową, dzięki czemu woda nie przedostanie się do instalacji elektrycznej.  Sposób użycia mieszanki cementowej Zaprawa CX 5 powstała na bazie mieszanki cementów z modyfikatorami i wypełniaczami mineralnymi, które wpływają na wysokie parametry wiążące. Zaleca się mieszanie suchej zaprawy z wodą w proporcjach: 1,25 l wody na 5 kg lub 6,25 l wody na 25 kg. Zaprawę powinno się stosować w temperaturze od 5 do 25 stopni. Wytrzymałość zaprawy CX 5 na ściskanie wg PN-EN 12190:2000 wynosi: po 6 h &gt; 15 MPa, po 24 h &gt; 25 MPa, po 28 dniach &gt; 40 MPa. Wytrzymałość zaprawy na zginanie wg PN-EN-B-04500:1985 wynosi: po 6 h &gt; 2,5 MPa, po 24 h &gt; 2,6 MPa, po 28 dniach &gt; 6,0 MPa. Szybkowiążąca zaprawa cementowa Ceresit zużywa się w zależności od rodzaju podłoża i wykonywanej pracy. Średnie zużycie wynosi około 1,6 kg na 1 dm3 wypełnianej objętości.', '', 'ceresit-zaprawa-szybkowiazaca-cx5-25-kg', '', '', '', 'Ceresit Zaprawa szybkowiążąca CX5 25 kg', '', '', '', ''),
(234, 1, 1, '', '', 'wapno-hydratyzowane-biale-2-kg', '', '', '', 'Wapno hydratyzowane białe 2 kg', '', '', '', ''),
(235, 1, 1, 'Środek do usuwania cementu i zapraw, marki Primacol, 575 ml. Przeznaczony do czyszczenia płytek ceramicznych, kamieni, szkła, powierzchni chromowanych i lakierowanych. Doskonale usuwa resztki zapraw cementowo-wapiennych, tynków oraz fug.', '', 'primacol-srodek-do-usuwania-cementu-i-zapraw-575-ml', '', '', '', 'Primacol Środek do usuwania cementu i zapraw 575 ml', '', '', '', ''),
(236, 1, 1, 'Plastyfikator do zapraw Fast-mix DH, marki Primacol, 16 g. Domieszka przeznaczona do poprawienia właściwości roboczych zapraw betonowych. Zwiększa napowietrzenie świeżej zaprawy, poprawia jej urabialność, a po stwardnieniu - wodoszczelność i odporno', '', 'primacol-plastyfikator-do-zapraw-fast-mix-dh-16-g', '', '', '', 'Primacol Plastyfikator do zapraw Fast-mix DH 16 g', '', '', '', ''),
(237, 1, 1, 'Mikrozbrojenia - polipropylenowe włókna do betonu, marki Primacol, 150 g. Cięte włókna polipropylenowe pokryte wodorozcieńczalnym spoiwem. Stosowane jako dodatek do betonów, zapraw i tynków. Powodują redukcję rys skurczowych i mikropęknięć, zmniejszają nasiąkliwość oraz wodoprzepuszczalność. Zwiększają udarność, odporność na ogień i ograniczają penetrację przez chemikalia. Poprawiają spójność i jednorodność betonu, jego urabialność oraz odporność na rozkruszanie i mróz. Mikrozbrojenia można stosować do wylewek przemysłowych i podłogowych (również przy ogrzewaniu podłogowym), do betonów natryskowych (np. przy tunelach), do prefabrykatów i galanterii betonowej, do szpachlówek, gipsów, sztukaterii itp., a także do miejscowych napraw betonów i tynków.', '', 'primacol-mikrozbrojenia-do-betonu-150-g', '', '', '', 'Primacol Mikrozbrojenia do betonu 150 g', '', '', '', ''),
(238, 1, 1, 'Domieszka do zapraw uplastyczniająco-napowietrzająca Tynkolit, marki Primacol, 1 l. Przeznaczona jest do stosowania we wszystkich robotach murarskich. Szczególnie polecana do wytwarzania tynków wewnętrznych i zewnętrznych. Jest odpowiednikiem wapna. Umożliwia prowadzenie robót w okresach obniżonych temperatur (do -2 st. C). Silnie uplastycznia i nadaje zaprawie murarskiej właściwości klejące. Tynki wykonane z użyciem Tynkolitu nie pękają, mają podwyższoną udarność, są mało ścieralne, bardzo mało nasiąkliwe i całkowicie mrozoodporne.', '', 'primacol-domieszka-do-zapraw-tynkolit-1-l', '', '', '', 'Primacol Domieszka do zapraw Tynkolit 1 l', '', '', '', ''),
(239, 1, 1, 'Przyspieszacz wiązania do betonu F-3S, marki Primacol, 1 l. Domieszka przeznaczona do wykonywania mieszanek betonowych o skróconym czasie wiązania. Umożliwia wylewanie betonu i prowadzenie prac murarskich w obniżonych temperaturach otoczenia do -10 st. C. F-3S wyraźnie przyspiesza początek czasu wiązania betonu nawet do 50 procent i nie obniża wytrzymałości końcowej. Pozwala to na przyspieszenie toku prac - szybsze zdejmowanie szalunków, wyjmowanie odlewów z form czy zacieranie posadzek.', '', 'primacol-przyspieszacz-wiazania-do-betonu-f-3s-1-l', '', '', '', 'Primacol Przyspieszacz wiązania do betonu F-3S 1 l', '', '', '', ''),
(240, 1, 1, 'Domieszka do zapraw uplastyczniająco-napowietrzająca Tynkolit, marki Primacol, 5 l. Przeznaczona jest do stosowania we wszystkich robotach murarskich. Szczególnie polecana do wytwarzania tynków wewnętrznych i zewnętrznych. Jest odpowiednikiem wapna. Umożliwia prowadzenie robót w okresach obniżonych temperatur (do -2 st. C). Silnie uplastycznia i nadaje zaprawie murarskiej właściwości klejące. Tynki wykonane z użyciem Tynkolitu nie pękają, mają podwyższoną udarność, są mało ścieralne, bardzo mało nasiąkliwe i całkowicie mrozoodporne.', '', 'primacol-domieszka-do-zapraw-tynkolit-5-l', '', '', '', 'Primacol Domieszka do zapraw Tynkolit 5 l', '', '', '', ''),
(241, 1, 1, 'Przyspieszacz wiązania do betonu F-3S, marki Primacol, 5 l. Domieszka przeznaczona do wykonywania mieszanek betonowych o skróconym czasie wiązania. Umożliwia wylewanie betonu i prowadzenie prac murarskich w obniżonych temperaturach otoczenia do -10 st. C. F-3S wyraźnie przyspiesza początek czasu wiązania betonu nawet do 50 procent i nie obniża wytrzymałości końcowej. Pozwala to na przyspieszenie toku prac - szybsze zdejmowanie szalunków, wyjmowanie odlewów z form czy zacieranie posadzek.', '', 'primacol-przyspieszacz-wiazania-do-betonu-f-3s-5-l', '', '', '', 'Primacol Przyspieszacz wiązania do betonu F-3S 5 l', '', '', '', ''),
(242, 1, 1, 'Mikrozbrojenia - polipropylenowe włókna do betonu, marki Primacol, 600 g. Cięte włókna polipropylenowe pokryte wodorozcieńczalnym spoiwem. Stosowane jako dodatek do betonów, zapraw i tynków. Powodują redukcję rys skurczowych i mikropęknięć, zmniejszają nasiąkliwość oraz wodoprzepuszczalność. Zwiększają udarność, odporność na ogień i ograniczają penetrację przez chemikalia. Poprawiają spójność i jednorodność betonu, jego urabialność oraz odporność na rozkruszanie i mróz. Mikrozbrojenia można stosować do wylewek przemysłowych i podłogowych (również przy ogrzewaniu podłogowym), do betonów natryskowych (np. przy tunelach), do prefabrykatów i galanterii betonowej, do szpachlówek, gipsów, sztukaterii itp., a także do miejscowych napraw betonów i tynków.', '', 'primacol-mikrozbrojenia-do-betonu-600-g', '', '', '', 'Primacol Mikrozbrojenia do betonu 600 g', '', '', '', ''),
(243, 1, 1, 'Środek do czyszczenia Klinkier Czyścik, marki Primacol, 5 l. Przeznaczony do klinkieru, płytek elewacyjnych, kamienia naturalnego i sztucznego. Doskonale usuwa resztki zapraw, fug, wykwity, przebarwienia i inne zabrudzenia.', '', 'primacol-srodek-do-czyszczenia-klinkier-czyscik-5-l', '', '', '', 'Primacol Środek do czyszczenia Klinkier Czyścik 5 l', '', '', '', ''),
(244, 1, 1, 'Pręt stalowy żebrowany o średnicy 6 mm i długości 3000 mm jest wykorzystywany do budowania konstrukcji budowlnaych. Zarówno profesjonalista jak i majsterkowicz znajdzie dla niego zastosowanie.', '', 'pret-stalowy-zebrowany-sr-6-mm-x-3000-mm', '', '', '', 'Pręt stalowy żebrowany śr. 6 mm x 3000 mm', '', '', '', ''),
(245, 1, 1, 'Pręt stalowy gładki o średnicy 10 mm i długości 3000 mm jest wykorzystywany do budowania konstrukcji budowlnaych. Zarówno profesjonalista jak i majsterkowicz znajdzie dla niego zastosowanie.', '', 'pret-stalowy-gladki-sr-10-mm-x-3000-mm', '', '', '', 'Pręt stalowy gładki śr. 10 mm x 3000 mm', '', '', '', ''),
(246, 1, 1, 'Mata zbrojeniowa zgrzewana firmy Brik o rozmiarze kratki 150 x 150 mm. Zgrzewana z drutów stalowych siatka do przeciwskurczowego zbrojenia betonowej wylewki. Podnosi wytrzymałość konstrukcji i podłoża, a także zabezpiecza ogrzewanie podłogowe przed uszkodzeniami. Idealna do wzmacniania posadzek, stropów, podłóg, ścian oraz chodników i ścieżek. Do stosowania w domach, garażach, warsztatach i obiektach przemysłowych. Wymiar maty: 1 m x 2 m.', '', 'mata-zbrojeniowa-zgrzewana-100x200-cm-z-kratka-15-x-15-cm', '', '', '', 'Mata zbrojeniowa zgrzewana 100x200 cm z kratką 15 x 15 cm', '', '', '', ''),
(247, 1, 1, 'Mata zbrojeniowa zgrzewana o rozmiarze kratki 100 mm x 100 mm. Zgrzewana z drutów stalowych siatka do przeciwskurczowego zbrojenia betonowej wylewki. Podnosi wytrzymałość konstrukcji i podłoża, a także zabezpiecza ogrzewanie podłogowe. Idealna do wzmacniania posadzek, stropów, podłóg, ścian oraz chodników i ścieżek. Do stosowania w domach, garażach, warsztatach i obiektach przemysłowych. Średnica drutu: 2,5 mm. Wymiar maty: 1 m x 2 m.', '', 'mata-zbrojeniowa-zgrzewana-100-mm-x-100-mm', '', '', '', 'Mata zbrojeniowa zgrzewana 100 mm x 100 mm', '', '', '', ''),
(248, 1, 1, 'Drut stalowy ocynkowany o uniwersalnym zastosowaniu. Wykonanie ze stali ocynkowanej zapewnia wysoką odporność na warunki atmosferyczne i zmiany temperatur oraz nadaje wytrzymałość. Średnica: 0,8 mm, długość: 100 m.', '', 'drut-stalowy-ocynkowany-sr-08-mm-x-100-m', '', '', '', 'Drut stalowy ocynkowany śr. 0,8 mm x 100 m', '', '', '', ''),
(249, 1, 1, 'Dystans stropowy wykorzystywany jest pod zbrojenie do wylewek, stropów, opasek, ław betonowych itp. Utrzymuje zbrojenie na wymaganej wysokości, umożliwia ułożenie zbrojenia dokładnie w centralnej części warstwy betonu, dystansując tym samym pręty od szalunków. Dzięki precyzyjnemu ułożeniu zbrojenia, uzyskujemy zwiększoną trwałość, oraz równomierne rozłożenie ciężaru warstwy zbrojonej, tym samym zmniejszając ryzyko naprężeń, Minimalizujemy w ten sposób, ryzyko pęknięć oraz odprysków kawałków betonu. Dystanse mogą być wykorzystywane również do mat zbrojeniowych, odsuwając je na żądaną wysokość od podłoża. Grubość: 12 mm.', '', 'dystans-stropowy-zbrojeniowy-dstu-1-100-sztuk', '', '', '', 'Dystans stropowy zbrojeniowy DSTU 1 - 100 sztuk', '', '', '', ''),
(250, 1, 1, 'Pręt stalowy gładki o średnicy 8 mm i długości 3000 mm jest wykorzystywany do budowania konstrukcji budowlnaych. Zarówno profesjonalista jak i majsterkowicz znajdzie dla niego zastosowanie.', '', 'pret-stalowy-gladki-sr-8-mm-x-3000-mm', '', '', '', 'Pręt stalowy gładki śr. 8 mm x 3000 mm', '', '', '', ''),
(251, 1, 1, 'Strzemiona budowlane o wymiarach 25 cm x 30 cm są wykorzystywane do budowy zbrojenia podczas prac budowlanych. Wysoka jakość użytych materiałów zapewnia długą trwałość.', '', 'strzemiona-budowlane-25-cm-x-30-cm-20-szt', '', '', '', 'Strzemiona budowlane 25 cm x 30 cm - 20 szt', '', '', '', ''),
(252, 1, 1, '', '', 'siatka-do-wylewek-1-m-x-50-mb', '', '', '', 'Siatka do wylewek 1 m x 50 mb', '', '', '', ''),
(253, 1, 1, 'Akumulator z serii Power X-Change firmy Einhell to zaawansowana technologia zapewnia zwiększoną wydajność: jeszcze większą wydajność, jeszcze większą wytrzymałość, co oszczędza czas i pieniądze. System baterii może być używany do wszystkich urządzeń z serii Power X-Change.', '', 'einhell-akumulator-18-v-pxc-52-ah', '', '', '', 'Einhell Akumulator 18 V PXC 5,2 Ah', '', '', '', ''),
(254, 1, 1, 'Ryobi Akumulator RB18L50, 5Ah  Akumulator Lithium+ 5,0 Ah marki Ryobi należy do bogatej rodziny narzędzi akumulatorowych w systemie Lithium+ przeznaczonych do domu i ogrodu. W porównaniu do poprzednich generacji akumulator RB18L40 oferuje znacznie wyższą moc, zdecydowanie dłuższy czas pracy i większą trwałość. Wytrzymała konstrukcja zapewnia ochronę przed uszkodzeniem i długi okres użytkowania. Akumulator posiada 4-stopniowy wskaźnik naładowania, informujący o pozostałej do wykorzystania rezerwie energii (100%, 75%, 50%, 255), ponadto nowoczesna technologia IntelliCell monitoruje i balansuje poszczególne ogniwa, które wydłużajają czas pracy akumulatora, przechowywania i zwiekszająca jego bezpieczeństwo. Akumulator umożliwia wkręcenie do 15500 wkrętów o wymiarach 4x32mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę R18DD3).  Brak ładowarki w zestawie.  Specyfikacja techniczna  Napięcie/Moc: 18V Pojemność akumulatora 5,0 Ah', '', 'ryobi-akumulator-rb18l50-5ah', '', '', '', 'Ryobi Akumulator RB18L50, 5Ah', '', '', '', ''),
(255, 1, 1, '4Garden Akumulator 20V 4Ah', '', '4garden-akumulator-20v-4ah', '', '', '', '4Garden Akumulator 20V 4Ah', '', '', '', ''),
(256, 1, 1, 'LUX-Tools Akumulator 20V 2Ah Lekki akumulator litowo-jonowy LUX-Tools o napięciu akumulatora 20V, pojemności akumulatora 2Ah i czasie ładowania do 60 minut (za pomocą standardowej ładowarki). Akumulator posiada 4-stopniowy wyświetlacz LED informujący o poziomie naładowania. Zewnętrzna częśc akumulatora została częściowo pokryta gumową powierzchnią umożliwiającą lepszą przyczepność urządzenia, np. do powierzchni stołu warsztatowego, ułatwiając tym samym pracę. Bezpieczeństwo w użytkowaniu akumulatora zapewnia wskaźnik przegrzania. Akumulator przeznaczony do narzędzi z serii LUX-Tools.    Specyfikacja techniczna  Napięcie akumulatora: 20V Pojemność akumulatorowa: 2 Ah Rodzaj akumulatora: litowo-jonowy Czas ładowania: do 60 minut  Technologia litowo-jonowa Nowoczesny akumulator litowo-jonowy jest znacznie lżejszy i mniejszy, a także posiada wyjątkowo płaską konstrukcję. Ponadto wyróżnia się długą żywotnością i niskim samorozładowaniem, dzięki czemu akumulator sprawny jest nawet po dłuższych przerwach w pracy.  Power System PowerSystem LUX-Tools to linia produktów zasilanych akumulatorami tego samego typu. Dzięki takiemu rozwiązaniu istnieje możliwość dowolnej konfiguracji zestawu produktów i doboru optymalnej ilości potrzebnych akumulatorów.', '', 'lux-tools-akumulator-20v-2ah', '', '', '', 'LUX-Tools Akumulator 20V 2Ah', '', '', '', ''),
(257, 1, 1, 'Akumulator z serii Power X-Change firmy Einhell to zaawansowana technologia zapewnia zwiększoną wydajność: jeszcze większą wydajność, jeszcze większą wytrzymałość, co oszczędza czas i pieniądze. System baterii może być używany do wszystkich urządzeń z serii Power X-Change.', '', 'einhell-akumulator-power-x-change-18v-25-ah', '', '', '', 'Einhell Akumulator Power X-Change 18V 2,5 Ah', '', '', '', ''),
(258, 1, 1, 'ZESTAW STARTOWY 18V 2,5 Ah/ŁADOWARKA marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Zestaw składa się z akumulatora 2,5 Ah oraz szybkiej ładowarki. Dzięki unikalnej konstrukcji jego wymiary oraz waga są stosunkowo małe. Wyróżnia go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania. System akumulatorowy Power Exchange to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2Ah) i różnych typów ładowarek.', '', 'zestaw-startowy-25-ah', '', '', '', 'Zestaw startowy 2,5 Ah', '', '', '', ''),
(259, 1, 1, 'Akumulator z serii Power X-Change firmy Einhell to zaawansowana technologia zapewnia zwiększoną wydajność: jeszcze większą wydajność, jeszcze większą wytrzymałość, co oszczędza czas i pieniądze. System baterii może być używany do wszystkich urządzeń z serii Power X-Change.', '', 'einhell-akumulator-18v-25ah', '', '', '', 'Einhell Akumulator 18V 2,5Ah', '', '', '', ''),
(260, 1, 1, 'Akumulator V20 Li-Ion 2,0Ah 18V marki Stanley FatMax  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy, gdziekolwiek jesteś i dokądkolwiek zaprowadzi Cię praca - i będzie Ci służyć dłużej.  Zintegrowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością wykonać pracę.', '', 'stanley-fatmax-akumulator-litowo-jonowy-v20-20ah-18v', '', '', '', 'Stanley FatMax Akumulator litowo-jonowy V20 2,0Ah 18V', '', '', '', ''),
(261, 1, 1, 'Akumulator V20 Li-Ion 4,0Ah 18V marki Stanley FatMax  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy, gdziekolwiek jesteś i dokądkolwiek zaprowadzi Cię praca - i będzie Ci służyć dłużej.  Zintegrowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością wykonać pracę.', '', 'stanley-fatmax-akumulator-litowo-jonowy-v20-40ah-18v', '', '', '', 'Stanley FatMax Akumulator litowo-jonowy V20 4,0Ah 18V', '', '', '', ''),
(262, 1, 1, 'Akumulator Li-Ion BL1840B 4,0 Ah marki Makita  Akumulator litowo-jonowy o pojemności 4,0 Ah ze wskaźnikiem naładowania.  Jest to akumulator ogólnego zastosowania o wysokiej mocy do narzędzi współpracujących z akumulatorem Makita LXT o napięciu 18 V. Doskonale sprawdza się w przypadku narzędzi o przeciętnym poborze mocy.  Przy zastosowaniu szybkiej ładowarki czas ładowania wynosi ok. 36 minut.', '', 'makita-akumulator-li-ion-bl1840b-40-ah', '', '', '', 'Makita Akumulator Li-Ion BL1840B 4,0 Ah', '', '', '', ''),
(263, 1, 1, 'Akumulator 18V o pojemności 4 Ah do elektrourządzeń z linii Power for ALL marki Bosch.', '', 'bosch-akumulator-18v-li-4ah', '', '', '', 'Bosch Akumulator 18V Li 4Ah', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(264, 1, 1, 'Akumulator marki Bosch Professional dzięki niskiej wadze gwarantuje jeszcze wyższy komfort pracy. Kompatybilny ze wszystkimi narzędziami - jeden akumulator do wszystkich narzędzi danej klasy napięcia. Wyjątkowa wytrzymałość: urządzenie zachowuje pełną sprawność i funkcjonalność nawet do dłuższym czasie nieużywania. Zastosowana technologia Coolpack zapewnia dobre odprowadzanie ciepła na akumulatorze od wewnątrz na zewnątrz.', '', 'bosch-professional-akumulator-gba-18v-4ah', '', '', '', 'Bosch Professional Akumulator GBA 18V 4Ah', '', '', '', ''),
(265, 1, 1, 'Ryobi Akumulator RB18L40, 4Ah  Akumulator Lithium+ 4,0 Ah marki Ryobi należy do bogatej rodziny narzędzi akumulatorowych w systemie Lithium+ przeznaczonych do domu i ogrodu. W porównaniu do poprzednich generacji akumulator RB18L40 oferuje znacznie wyższą moc, zdecydowanie dłuższy czas pracy i większą trwałość. Wytrzymała konstrukcja zapewnia ochronę przed uszkodzeniem i długi okres użytkowania. Akumulator posiada 4-stopniowy wskaźnik naładowania, informujący o pozostałej do wykorzystania rezerwie energii (100%, 75%, 50%, 255), ponadto nowoczesna technologia IntelliCell monitoruje i balansuje poszczególne ogniwa, które wydłużajają czas pracy akumulatora, przechowywania i zwiekszająca jego bezpieczeństwo. Akumulator umożliwia wkręcenie do 1240 wkrętów o wymiarach 4x32mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę R18DD3) oraz 749 wkrętów o wymiarach 4x40mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę RCD1802)  Brak ładowarki w zestawie.  Specyfikacja techniczna  Napięcie/Moc: 18V Pojemność akumulatora 4,0 Ah', '', 'ryobi-akumulator-rb18l40-4ah', '', '', '', 'Ryobi Akumulator RB18L40, 4Ah', '', '', '', ''),
(266, 1, 1, 'Akumulator Li-Ion BL1820B 2,0 Ah marki Makita  Akumulator Li-ion o pojemności 2,0 Ah, wyposażony we wskaźnik naładowania. Jest to wydajny akumulator ogólnego zastosowania przeznaczony do narzędzi Makita 18V LXT .  Czas ładowania wynosi w przybliżeniu 24 minuty przy użyciu szybkiej ładowarki.', '', 'makita-akumulator-li-ion-bl1820b-20-ah', '', '', '', 'Makita Akumulator Li-Ion BL1820B 2,0 Ah', '', '', '', ''),
(267, 1, 1, 'Bosch akumulator GBA 18 V 2,0 Ah Lekki akumulator litowo-jonowy Bosch z obudową COOLPACK o napięciu akumulatora 18V, pojemności akumulatora 2Ah i czasie ładowania do 60 minut (dla baterii 2Ah). Akumulator przeznaczony jest do zasilania narzędzi akumulatorowych 18V z serii Bosch Professional (linia niebieska).    Specyfikacja techniczna  Model: GBA 18V 2Ah Napięcie akumulatora: 18V Pojemność akumulatorowa: 2 Ah Rodzaj akumulatora: litowo-jonowy Czas ładowania: do 60 minut dla baterii 2Ah  Electronic Cell Protection System CEP zapewnia urządzeniu długą żywotność i dłuższy czas pracy akumulatora. System ten chroni akumulator przed przeciążeniem, przegrzaniem, a także całkowitym rozładowaniem.  Obudowa COOLPACK Specjalna obudowa akumulatora odprowadzająca ciepło, a także regulowana prędkość pracy wentylatora w ładowarkach sieciowych Bosch zapewniają optymalną ochronę ogniw przed przegrzaniem.  Wslaźnik stanu naładowania Akumulator GBA 18V posiada wbudowany diodowy wskaźnik stanu naładowania akumulatora, który informuje użytkownika o aktualnym stanie naładowania i pozostałym do wykorzystania zapasie energii.  Świecenie 3 diod wskazuje, że akumulator naładowany jest do 100% Świecenie 2 diod wskazuje, że akumulator naładowany jest do 60% Świecenie 1 diody wskazuje, że akumulator naładowany jest do 30% Migająca dioda wskazuje, że akumulator naładowany jest poniżej 5%.', '', 'bosch-akumulator-gba-18-v-20-ah', '', '', '', 'Bosch akumulator GBA 18 V 2,0 Ah', '', '', '', ''),
(268, 1, 1, 'Akumulator PXC 18 V 2,0 Ah marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, jego wymiary oraz waga są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie.  System akumulatorowy Power Exchange to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.  Urządzenie dostarczane jest bez ładowarki.', '', 'einhell-akumulator-pxc-18-v-20-ah', '', '', '', 'Einhell Akumulator PXC 18 V 2,0 Ah', '', '', '', ''),
(269, 1, 1, '4Garden Akumulator 20V 2Ah', '', '4garden-akumulator-20v-2ah', '', '', '', '4Garden Akumulator 20V 2Ah', '', '', '', ''),
(270, 1, 1, 'Akumulator 18V o pojemności 2,5 Ah do elektrourządzeń z linii Power for ALL marki Bosch.', '', 'bosch-akumulator-18v-li-25ah', '', '', '', 'Bosch Akumulator 18V Li 2,5Ah', '', '', '', ''),
(271, 1, 1, 'Zestaw startowy - akumulatory 18V 2 i 4 Ah i ładowarka marki Bosch Professional.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych marki Bosch przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca.', '', 'bosch-professional-zestaw-startowy-gba-18v-2ah-gba-18v-4ah-gal-18v-40', '', '', '', 'Bosch Professional Zestaw startowy GBA 18V 2Ah/GBA 18V 4Ah/GAL 18V-40', '', '', '', ''),
(272, 1, 1, 'Ryobi Akumulator RB18L20, 2Ah  Akumulator Lithium+ 2,0 Ah marki Ryobi należy do bogatej rodziny narzędzi akumulatorowych w systemie Lithium+ przeznaczonych do domu i ogrodu. W porównaniu do poprzednich generacji akumulator RB18L20 oferuje znacznie wyższą moc, zdecydowanie dłuższy czas pracy i większą trwałość. Wytrzymała konstrukcja zapewnia ochronę przed uszkodzeniem i długi okres użytkowania. Akumulator umożliwia wkręcenie do 600 wkrętów o wymiarach 4x32mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę R18DD3) oraz wykonanie do 70 cięć w drewnie sosnowym 2x6\' (50x150mm) - w tym celu należy oddzielnie dokupić pilarkę tarczową R18CS.  Brak ładowarki w zestawie.  Specyfikacja techniczna  Napięcie/Moc: 18V Pojemność akumulatora 2,0 Ah', '', 'ryobi-akumulator-rb18l20-2ah', '', '', '', 'Ryobi Akumulator RB18L20, 2Ah', '', '', '', ''),
(273, 1, 1, 'Akumulator V20 Li-Ion 6,0Ah 18V marki Stanley FatMax  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy, gdziekolwiek jesteś i dokądkolwiek zaprowadzi Cię praca - i będzie Ci służyć dłużej.  Zintegrowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością wykonać pracę.', '', 'stanley-fatmax-akumulator-litowo-jonowy-v20-60ah-18v', '', '', '', 'Stanley FatMax Akumulator litowo-jonowy V20 6,0Ah 18V', '', '', '', ''),
(274, 1, 1, 'Bosch akumulator GBA 12V 2Ah Lekki akumulator litowo-jonowy Bosch o napięciu akumulatora 12V, pojemności akumulatora 2Ah i czasie ładowania dla ładowarki: GAL 1230 CV - ok. 45 minut, GAL 12V-40 - ok. 30 minut, GAL 1130 CV - ok. 45 minut. Akumulator przeznaczony jest do zasilania narzędzi akumulatorowych 10,8V i 12V z serii Bosch Professional (linia niebieska).  WAŻNA INFORMACJA - zmiana z 10,8V na 12V Od stycznia 2017 roku kompletny asortyment produktów Bosch Professional 10,8V zmienił nazwę na 12V. Narzędzia 12V są nadal w pełni kompatybilne ze wszystkimi aktualnymi (10,8V) i przyszłymi (12V) elektronarzędziami, akumulatorami i ładowarkami Bosch Professional.    Specyfikacja techniczna  Model: GBA 12V Napięcie akumulatora: 12V Pojemność akumulatorowa: 2 Ah Rodzaj akumulatora: litowo-jonowy Czas ładowania: 30-45 minut  Electronic Cell Protection System CEP zapewnia urządzeniu długą żywotność i dłuższy czas pracy akumulatora. System ten chroni akumulator przed przeciążeniem, przegrzaniem, a także całkowitym rozładowaniem.', '', 'bosch-akumulator-gba-12v-2ah', '', '', '', 'Bosch akumulator GBA 12V 2Ah', '', '', '', ''),
(275, 1, 1, 'Zestaw startowy - akumulator 18V 4 Ah i szybka ładowarka marki Einhell.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania.  System akumulatorowy Power X-Change to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.', '', 'einhell-zestaw-startowy-akumulator-40-ah-ladowarka', '', '', '', 'Einhell Zestaw startowy - akumulator 4,0 Ah + ładowarka', '', '', '', ''),
(276, 1, 1, 'Zestaw startowy marki Bosch złożony z akumulatora litowo-jonowego o pojemności 4,0 Ah oraz ładowarki. Przeznaczony do stosowania z elektronarzędziami marki Bosch.  Ładowarka może być stosowana w pozycji stojącej lub wiszącej - montaż na ścianie.', '', 'bosch-professional-zestaw-startowy-akumulator-ladowarka-18v', '', '', '', 'Bosch Professional Zestaw startowy akumulator + ładowarka 18V', '', '', '', ''),
(277, 1, 1, 'Zestaw startowy - akumulator 18V 2,5 Ah i szybka ładowarka 3A marki Einhell.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania.  System akumulatorowy Power X-Change to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.', '', 'einhell-zestaw-startowy-akumulator-18v-25ah-i-ladowarka', '', '', '', 'Einhell Zestaw startowy - akumulator 18V 2,5Ah i ładowarka', '', '', '', ''),
(278, 1, 1, 'Zestaw startowy akumulator 18V 4,0 Ah o wymiarach 17 x 87 x 18 cm, firmy Einhell.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania.  System akumulatorowy Power X-Change to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.', '', 'einhell-zestaw-startowy-akumulator-18v-40-ah-i-ladowarka', '', '', '', 'Einhell Zestaw startowy - akumulator 18V 4,0 Ah i ładowarka', '', '', '', ''),
(279, 1, 1, '4Garden Szybka ładowarka 20V 2,9A', '', '4garden-szybka-ladowarka-20v-29a', '', '', '', '4Garden Szybka ładowarka 20V 2,9A', '', '', '', ''),
(280, 1, 1, 'Akumulator wykonany w technologii Litowo-Jonowej o pojemności 2 Ah i napięciu maksymalnym 20 V. Akumulator przy użyciu standardowej ładowarki jest ładowany w 100% w 60 minut. Akumulator jest przeznaczony do elektrycznych urządzeń ogrodniczych marki LUX-Tools. W zestawie znajdziesz ładowarkę o mocy znamionowej - 70 W, napięciu ładowania - 20,9 V, prądzie ładowania - 2,4 V i klasie ochrony - II.', '', 'lux-tools-zestaw-startowy-akumulator-20v-2ah-ladowarka', '', '', '', 'LUX-Tools Zestaw startowy - akumulator 20V 2Ah + ładowarka', '', '', '', ''),
(281, 1, 1, 'Ryobi Ładowarka RC18120  Kompaktowa ładowarka należy do systemu Ryobi ONE+ składającego się z ponad 150 bezprzewodowych narzędzi do domu, ogrodu i wielu innych jest idealna do szybkiego ładowania baterii litowych Ryobi. Ładowarka akumulatorów litowych jest w stanie ładować z szybkością 2,0 amperów na godzinę, co oznacza, że możesz naładować akumulator o pojemności 2,0 Ah w ciągu 1 godziny. Wyposażony w lampki kontrolne, które pokazują stan naładowania i konserwacji akumulatorów. Wskaźnik gotowości do pracy pokazuje, kiedy bateria osiągnęła 80% pojemności. Zawiera inteligentne monitorowanie stanu, które ocenia napięcie i temperaturę akumulatora, zapewniając jednocześnie długotrwałą trwałość. Ładowarka kompatybilna jest ze wszystkimi akumulatorami litowo-jonowymi systemu ONE+ 18V  Specyfikacja techniczna  Napięcie/Moc: 18V Czas ładowania baterii 2Ah: 60 minut Czas ładowania baterii 3Ah: 90 minut Czas ładowania baterii 4Ah: 120 minut Szybkie ładowanie: tak', '', 'ryobi-ladowarka-rc18120', '', '', '', 'Ryobi Ładowarka RC18120', '', '', '', ''),
(282, 1, 1, 'Zestaw startowy z bateriami i ładowarką STANLEY FATMAX V20 2x 2.0Ah  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy w każdym miejscu i o każdej porze - i będzie działał dłużej.  Wbudowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Ładowanie akumulatorów 18V STANLEY FATMAX V20 2,0Ah w 30 minut. Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym, który pozwoli Ci z łatwością wykonywać pracę.', '', 'stanley-fatmax-zestaw-v20-akumulator-20ah-x-2-z-ladowarka-2a-18v', '', '', '', 'Stanley FatMax Zestaw V20 akumulator 2,0Ah x 2 z ładowarką 2A 18V', '', '', '', ''),
(283, 1, 1, 'Ładowarka do akumulatora DC18SD Li-Ion marki Makita  Ładowarka z kontrolką przeznaczona do akumulatorów litowo-jonowych Makita 14,4V i 18V.', '', 'makita-ladowarka-do-akumulatora-dc18sd-li-ion', '', '', '', 'Makita Ładowarka do akumulatora DC18SD Li-Ion', '', '', '', ''),
(284, 1, 1, 'Einhell Ładowarka PXC Szybka ładowarka Einhell należąca do rodziny urządzeń Power X-Change. Dzięki technologii szybkiego ładowania 4 amperów, czasy ładowania są jeszcze krótsze, akumulator jest stale monitorowany przez inteligentne zarządzanie ładowaniem, co zapewnia optymalne ładowanie i maksymalne bezpieczeństwo. Za pomocą uchwytów do zawieszania ładowarkę można łatwo zamontować na ścianie, a dzięki swoim kompaktowym rozmiarom urządzenie zajmuje niewiele miejsca. Tryb odświeżania umożliwia reaktywację głęboko rozładowanych akumulatorów. Wskaźnik stanu LED przekazuje aż 6 informacji odnośnie stanu akumulatora    Specyfikacja techniczna  Napięcie akumulatora: 18V Czas ładowania dla baterii 1,5Ah: 30 min. Czas ładowania dla baterii 3Ah: 60 min. Czas ładowania dla baterii 5,2Ah: 130 min. Szybkie ładowanie: tak  Seria PXC Seria PXC to seria urządzeń na akumulator, który można stosować w ponad 200 urządzeniach, zarówno służących do prac w przydomowym warsztacie, jak i w ogrodzie. Również ładowarki z tej serii mogą być stosowane do wszystkich akumulatorów PXC. Dzięki jednej baterii i jednej ładowarce do wszystkich urządzeń, chronisz środowisko i jednocześnie zapewniasz elastyczność pracy w domu i w ogrodzie.', '', 'einhell-ladowarka-pxc', '', '', '', 'Einhell Ładowarka PXC', '', '', '', ''),
(285, 1, 1, 'Szybka ładowarka 18V AL 1830CV dla akumulatorów o napięciu 14,4 i 18 V do elektrourządzeń marki Bosch. Czas ładowania 2,0 Ah do 100% ok. 45 min. Czas ładowania 4,0 Ah do 100% ok. 95 min. Czas ładowania 6,0 Ah do 100% ok. 130 min.', '', 'bosch-szybka-ladowarka-18v-al-1830cv', '', '', '', 'Bosch Szybka ładowarka 18V AL 1830CV', '', '', '', ''),
(286, 1, 1, '4Garden Ładowarka 20V 0,5A', '', '4garden-ladowarka-20v-05a', '', '', '', '4Garden Ładowarka 20V 0,5A', '', '', '', ''),
(287, 1, 1, 'Szybka ładowarka V20 4S 18V marki Stanley FatMax  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością poradzić sobie w różnych pracach.  Ładowarka 4A do szybkiego ładowania akumulatorów 18V STANLEY FATMAX V20 2.0Ah w 30 minut.', '', 'stanley-fatmax-ladowarka-szybka-v20-4a-18v', '', '', '', 'Stanley FatMax Ładowarka szybka V20 4A 18V', '', '', '', ''),
(288, 1, 1, '4Garden Podwójna ładowarka 20 V (do 2,0 Ah i 4,0 Ah)', '', '4garden-podwojna-ladowarka-20-v-do-20-ah-i-40-ah', '', '', '', '4Garden Podwójna ładowarka 20 V (do 2,0 Ah i 4,0 Ah)', '', '', '', ''),
(289, 1, 1, '4Garden Ładowarka 20V 2,2A', '', '4garden-ladowarka-20v-22a', '', '', '', '4Garden Ładowarka 20V 2,2A', '', '', '', ''),
(290, 1, 1, 'Ładowarka PXC 6 A marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Umożliwia ładowanie wszystkich akumulatorów z serii systemów Power X-Change jeszcze szybciej niż kiedykolwiek. Wybrany tryb doładowania znacznie skraca czas ładowania akumulatorów. Ponadto cykle ładowania są dostosowane do konkretnej sytuacji, dzięki czemu akumulatory mają dłuższą żywotność. Dla maksymalnego bezpieczeństwa dostępna jest inteligentna funkcja zarządzania ładowaniem oraz stałe monitorowanie ładowania zapewniające optymalne ładowanie przez cały czas. 6-stopniowy system ładowania zapewnia aktualne informacje o stanie akumulatora.  System akumulatorowy Power Exchange to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.  Urządzenie dostarczane jest bez akumulatora.', '', 'einhell-ladowarka-pxc-6-a', '', '', '', 'Einhell Ładowarka PXC 6 A', '', '', '', ''),
(291, 1, 1, 'Generator Prądotwórczy benzynowy o mocy znamionowej 2000 W firmy Hyundai.  Urządzenie niezbędne w każdym miejscu gdzie nie mamy dostępu do prądu z sieci. Generator wyposażony w chłodzony powietrzem silnik o mocy 3 KM ze stabilizacją napięcia AVR oraz voltomierz. Urządzenie wyposażono w 2 gniazdkach jednofazowe 230 V. Czas pracy ciągłej na jednym zbiorniku o pojemności 15 l wynosi 12 godzin. Poziom hałasu: 95 dB.  Posiada system automatycznej stabilizacji napięcia AVR dzięki któremu bezpiecznie podłączysz do agregatu domowy sprzęt AGD taki jak piece centralnego ogrzewania, pralkę, lodówkę itp.', '', 'hyundai-generator-pradotworczy-benzynowy-2000-w-z-avr', '', '', '', 'Hyundai Generator prądotwórczy benzynowy 2000 W z AVR', '', '', '', ''),
(292, 1, 1, 'Ramię wychylne marki LUX Tools o max długości 1100 mm. Obrotowe ramię służy do mocowania i obracania elektrycznych wciągników o lekkiej konstrukcji. W komplecie z ramieniem sprzedawane są nakładki mocujące. Min/max zasięg ramienia i udźwig: 750 mm - 600 kg/1100 mm - 300 kg br&gt;', '', 'lux-tools-ramie-wychylne-swa-600-300-600-kg', '', '', '', 'LUX Tools Ramię wychylne SWA-600 300-600 kg', '', '', '', ''),
(293, 1, 1, 'Strzemiona budowlane o wymiarach 25 cm x 30 cm są wykorzystywane do budowy zbrojenia podczas prac budowlanych. Wysoka jakość użytych materiałów zapewnia długą trwałość.', '', 'strzemiona-budowlane-25-cm-x-30-cm-20-szt', '', '', '', 'Strzemiona budowlane 25 cm x 30 cm - 20 szt', '', '', '', ''),
(294, 1, 1, '', '', 'siatka-do-wylewek-1-m-x-50-mb', '', '', '', 'Siatka do wylewek 1 m x 50 mb', '', '', '', ''),
(295, 1, 1, 'Akumulator z serii Power X-Change firmy Einhell to zaawansowana technologia zapewnia zwiększoną wydajność: jeszcze większą wydajność, jeszcze większą wytrzymałość, co oszczędza czas i pieniądze. System baterii może być używany do wszystkich urządzeń z serii Power X-Change.', '', 'einhell-akumulator-18-v-pxc-52-ah', '', '', '', 'Einhell Akumulator 18 V PXC 5,2 Ah', '', '', '', ''),
(296, 1, 1, 'Ryobi Akumulator RB18L50, 5Ah  Akumulator Lithium+ 5,0 Ah marki Ryobi należy do bogatej rodziny narzędzi akumulatorowych w systemie Lithium+ przeznaczonych do domu i ogrodu. W porównaniu do poprzednich generacji akumulator RB18L40 oferuje znacznie wyższą moc, zdecydowanie dłuższy czas pracy i większą trwałość. Wytrzymała konstrukcja zapewnia ochronę przed uszkodzeniem i długi okres użytkowania. Akumulator posiada 4-stopniowy wskaźnik naładowania, informujący o pozostałej do wykorzystania rezerwie energii (100%, 75%, 50%, 255), ponadto nowoczesna technologia IntelliCell monitoruje i balansuje poszczególne ogniwa, które wydłużajają czas pracy akumulatora, przechowywania i zwiekszająca jego bezpieczeństwo. Akumulator umożliwia wkręcenie do 15500 wkrętów o wymiarach 4x32mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę R18DD3).  Brak ładowarki w zestawie.  Specyfikacja techniczna  Napięcie/Moc: 18V Pojemność akumulatora 5,0 Ah', '', 'ryobi-akumulator-rb18l50-5ah', '', '', '', 'Ryobi Akumulator RB18L50, 5Ah', '', '', '', ''),
(297, 1, 1, '4Garden Akumulator 20V 4Ah', '', '4garden-akumulator-20v-4ah', '', '', '', '4Garden Akumulator 20V 4Ah', '', '', '', ''),
(298, 1, 1, 'LUX-Tools Akumulator 20V 2Ah Lekki akumulator litowo-jonowy LUX-Tools o napięciu akumulatora 20V, pojemności akumulatora 2Ah i czasie ładowania do 60 minut (za pomocą standardowej ładowarki). Akumulator posiada 4-stopniowy wyświetlacz LED informujący o poziomie naładowania. Zewnętrzna częśc akumulatora została częściowo pokryta gumową powierzchnią umożliwiającą lepszą przyczepność urządzenia, np. do powierzchni stołu warsztatowego, ułatwiając tym samym pracę. Bezpieczeństwo w użytkowaniu akumulatora zapewnia wskaźnik przegrzania. Akumulator przeznaczony do narzędzi z serii LUX-Tools.    Specyfikacja techniczna  Napięcie akumulatora: 20V Pojemność akumulatorowa: 2 Ah Rodzaj akumulatora: litowo-jonowy Czas ładowania: do 60 minut  Technologia litowo-jonowa Nowoczesny akumulator litowo-jonowy jest znacznie lżejszy i mniejszy, a także posiada wyjątkowo płaską konstrukcję. Ponadto wyróżnia się długą żywotnością i niskim samorozładowaniem, dzięki czemu akumulator sprawny jest nawet po dłuższych przerwach w pracy.  Power System PowerSystem LUX-Tools to linia produktów zasilanych akumulatorami tego samego typu. Dzięki takiemu rozwiązaniu istnieje możliwość dowolnej konfiguracji zestawu produktów i doboru optymalnej ilości potrzebnych akumulatorów.', '', 'lux-tools-akumulator-20v-2ah', '', '', '', 'LUX-Tools Akumulator 20V 2Ah', '', '', '', ''),
(299, 1, 1, 'Akumulator z serii Power X-Change firmy Einhell to zaawansowana technologia zapewnia zwiększoną wydajność: jeszcze większą wydajność, jeszcze większą wytrzymałość, co oszczędza czas i pieniądze. System baterii może być używany do wszystkich urządzeń z serii Power X-Change.', '', 'einhell-akumulator-power-x-change-18v-25-ah', '', '', '', 'Einhell Akumulator Power X-Change 18V 2,5 Ah', '', '', '', ''),
(300, 1, 1, 'ZESTAW STARTOWY 18V 2,5 Ah/ŁADOWARKA marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Zestaw składa się z akumulatora 2,5 Ah oraz szybkiej ładowarki. Dzięki unikalnej konstrukcji jego wymiary oraz waga są stosunkowo małe. Wyróżnia go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania. System akumulatorowy Power Exchange to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2Ah) i różnych typów ładowarek.', '', 'zestaw-startowy-25-ah', '', '', '', 'Zestaw startowy 2,5 Ah', '', '', '', ''),
(301, 1, 1, 'Akumulator z serii Power X-Change firmy Einhell to zaawansowana technologia zapewnia zwiększoną wydajność: jeszcze większą wydajność, jeszcze większą wytrzymałość, co oszczędza czas i pieniądze. System baterii może być używany do wszystkich urządzeń z serii Power X-Change.', '', 'einhell-akumulator-18v-25ah', '', '', '', 'Einhell Akumulator 18V 2,5Ah', '', '', '', ''),
(302, 1, 1, 'Akumulator V20 Li-Ion 2,0Ah 18V marki Stanley FatMax  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy, gdziekolwiek jesteś i dokądkolwiek zaprowadzi Cię praca - i będzie Ci służyć dłużej.  Zintegrowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością wykonać pracę.', '', 'stanley-fatmax-akumulator-litowo-jonowy-v20-20ah-18v', '', '', '', 'Stanley FatMax Akumulator litowo-jonowy V20 2,0Ah 18V', '', '', '', ''),
(303, 1, 1, 'Akumulator V20 Li-Ion 4,0Ah 18V marki Stanley FatMax  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy, gdziekolwiek jesteś i dokądkolwiek zaprowadzi Cię praca - i będzie Ci służyć dłużej.  Zintegrowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością wykonać pracę.', '', 'stanley-fatmax-akumulator-litowo-jonowy-v20-40ah-18v', '', '', '', 'Stanley FatMax Akumulator litowo-jonowy V20 4,0Ah 18V', '', '', '', ''),
(304, 1, 1, 'Akumulator Li-Ion BL1840B 4,0 Ah marki Makita  Akumulator litowo-jonowy o pojemności 4,0 Ah ze wskaźnikiem naładowania.  Jest to akumulator ogólnego zastosowania o wysokiej mocy do narzędzi współpracujących z akumulatorem Makita LXT o napięciu 18 V. Doskonale sprawdza się w przypadku narzędzi o przeciętnym poborze mocy.  Przy zastosowaniu szybkiej ładowarki czas ładowania wynosi ok. 36 minut.', '', 'makita-akumulator-li-ion-bl1840b-40-ah', '', '', '', 'Makita Akumulator Li-Ion BL1840B 4,0 Ah', '', '', '', ''),
(305, 1, 1, 'Akumulator 18V o pojemności 4 Ah do elektrourządzeń z linii Power for ALL marki Bosch.', '', 'bosch-akumulator-18v-li-4ah', '', '', '', 'Bosch Akumulator 18V Li 4Ah', '', '', '', ''),
(306, 1, 1, 'Akumulator marki Bosch Professional dzięki niskiej wadze gwarantuje jeszcze wyższy komfort pracy. Kompatybilny ze wszystkimi narzędziami - jeden akumulator do wszystkich narzędzi danej klasy napięcia. Wyjątkowa wytrzymałość: urządzenie zachowuje pełną sprawność i funkcjonalność nawet do dłuższym czasie nieużywania. Zastosowana technologia Coolpack zapewnia dobre odprowadzanie ciepła na akumulatorze od wewnątrz na zewnątrz.', '', 'bosch-professional-akumulator-gba-18v-4ah', '', '', '', 'Bosch Professional Akumulator GBA 18V 4Ah', '', '', '', ''),
(307, 1, 1, 'Ryobi Akumulator RB18L40, 4Ah  Akumulator Lithium+ 4,0 Ah marki Ryobi należy do bogatej rodziny narzędzi akumulatorowych w systemie Lithium+ przeznaczonych do domu i ogrodu. W porównaniu do poprzednich generacji akumulator RB18L40 oferuje znacznie wyższą moc, zdecydowanie dłuższy czas pracy i większą trwałość. Wytrzymała konstrukcja zapewnia ochronę przed uszkodzeniem i długi okres użytkowania. Akumulator posiada 4-stopniowy wskaźnik naładowania, informujący o pozostałej do wykorzystania rezerwie energii (100%, 75%, 50%, 255), ponadto nowoczesna technologia IntelliCell monitoruje i balansuje poszczególne ogniwa, które wydłużajają czas pracy akumulatora, przechowywania i zwiekszająca jego bezpieczeństwo. Akumulator umożliwia wkręcenie do 1240 wkrętów o wymiarach 4x32mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę R18DD3) oraz 749 wkrętów o wymiarach 4x40mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę RCD1802)  Brak ładowarki w zestawie.  Specyfikacja techniczna  Napięcie/Moc: 18V Pojemność akumulatora 4,0 Ah', '', 'ryobi-akumulator-rb18l40-4ah', '', '', '', 'Ryobi Akumulator RB18L40, 4Ah', '', '', '', ''),
(308, 1, 1, 'Akumulator Li-Ion BL1820B 2,0 Ah marki Makita  Akumulator Li-ion o pojemności 2,0 Ah, wyposażony we wskaźnik naładowania. Jest to wydajny akumulator ogólnego zastosowania przeznaczony do narzędzi Makita 18V LXT .  Czas ładowania wynosi w przybliżeniu 24 minuty przy użyciu szybkiej ładowarki.', '', 'makita-akumulator-li-ion-bl1820b-20-ah', '', '', '', 'Makita Akumulator Li-Ion BL1820B 2,0 Ah', '', '', '', ''),
(309, 1, 1, 'Bosch akumulator GBA 18 V 2,0 Ah Lekki akumulator litowo-jonowy Bosch z obudową COOLPACK o napięciu akumulatora 18V, pojemności akumulatora 2Ah i czasie ładowania do 60 minut (dla baterii 2Ah). Akumulator przeznaczony jest do zasilania narzędzi akumulatorowych 18V z serii Bosch Professional (linia niebieska).    Specyfikacja techniczna  Model: GBA 18V 2Ah Napięcie akumulatora: 18V Pojemność akumulatorowa: 2 Ah Rodzaj akumulatora: litowo-jonowy Czas ładowania: do 60 minut dla baterii 2Ah  Electronic Cell Protection System CEP zapewnia urządzeniu długą żywotność i dłuższy czas pracy akumulatora. System ten chroni akumulator przed przeciążeniem, przegrzaniem, a także całkowitym rozładowaniem.  Obudowa COOLPACK Specjalna obudowa akumulatora odprowadzająca ciepło, a także regulowana prędkość pracy wentylatora w ładowarkach sieciowych Bosch zapewniają optymalną ochronę ogniw przed przegrzaniem.  Wslaźnik stanu naładowania Akumulator GBA 18V posiada wbudowany diodowy wskaźnik stanu naładowania akumulatora, który informuje użytkownika o aktualnym stanie naładowania i pozostałym do wykorzystania zapasie energii.  Świecenie 3 diod wskazuje, że akumulator naładowany jest do 100% Świecenie 2 diod wskazuje, że akumulator naładowany jest do 60% Świecenie 1 diody wskazuje, że akumulator naładowany jest do 30% Migająca dioda wskazuje, że akumulator naładowany jest poniżej 5%.', '', 'bosch-akumulator-gba-18-v-20-ah', '', '', '', 'Bosch akumulator GBA 18 V 2,0 Ah', '', '', '', ''),
(310, 1, 1, 'Akumulator PXC 18 V 2,0 Ah marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, jego wymiary oraz waga są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie.  System akumulatorowy Power Exchange to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.  Urządzenie dostarczane jest bez ładowarki.', '', 'einhell-akumulator-pxc-18-v-20-ah', '', '', '', 'Einhell Akumulator PXC 18 V 2,0 Ah', '', '', '', ''),
(311, 1, 1, '4Garden Akumulator 20V 2Ah', '', '4garden-akumulator-20v-2ah', '', '', '', '4Garden Akumulator 20V 2Ah', '', '', '', ''),
(312, 1, 1, 'Akumulator 18V o pojemności 2,5 Ah do elektrourządzeń z linii Power for ALL marki Bosch.', '', 'bosch-akumulator-18v-li-25ah', '', '', '', 'Bosch Akumulator 18V Li 2,5Ah', '', '', '', ''),
(313, 1, 1, 'Zestaw startowy - akumulatory 18V 2 i 4 Ah i ładowarka marki Bosch Professional.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych marki Bosch przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca.', '', 'bosch-professional-zestaw-startowy-gba-18v-2ah-gba-18v-4ah-gal-18v-40', '', '', '', 'Bosch Professional Zestaw startowy GBA 18V 2Ah/GBA 18V 4Ah/GAL 18V-40', '', '', '', ''),
(314, 1, 1, 'Ryobi Akumulator RB18L20, 2Ah  Akumulator Lithium+ 2,0 Ah marki Ryobi należy do bogatej rodziny narzędzi akumulatorowych w systemie Lithium+ przeznaczonych do domu i ogrodu. W porównaniu do poprzednich generacji akumulator RB18L20 oferuje znacznie wyższą moc, zdecydowanie dłuższy czas pracy i większą trwałość. Wytrzymała konstrukcja zapewnia ochronę przed uszkodzeniem i długi okres użytkowania. Akumulator umożliwia wkręcenie do 600 wkrętów o wymiarach 4x32mm (w tym celu należy oddzielnie dokupić wiertarko-wkrętarkę R18DD3) oraz wykonanie do 70 cięć w drewnie sosnowym 2x6\' (50x150mm) - w tym celu należy oddzielnie dokupić pilarkę tarczową R18CS.  Brak ładowarki w zestawie.  Specyfikacja techniczna  Napięcie/Moc: 18V Pojemność akumulatora 2,0 Ah', '', 'ryobi-akumulator-rb18l20-2ah', '', '', '', 'Ryobi Akumulator RB18L20, 2Ah', '', '', '', ''),
(315, 1, 1, 'Akumulator V20 Li-Ion 6,0Ah 18V marki Stanley FatMax  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy, gdziekolwiek jesteś i dokądkolwiek zaprowadzi Cię praca - i będzie Ci służyć dłużej.  Zintegrowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością wykonać pracę.', '', 'stanley-fatmax-akumulator-litowo-jonowy-v20-60ah-18v', '', '', '', 'Stanley FatMax Akumulator litowo-jonowy V20 6,0Ah 18V', '', '', '', ''),
(316, 1, 1, 'Bosch akumulator GBA 12V 2Ah Lekki akumulator litowo-jonowy Bosch o napięciu akumulatora 12V, pojemności akumulatora 2Ah i czasie ładowania dla ładowarki: GAL 1230 CV - ok. 45 minut, GAL 12V-40 - ok. 30 minut, GAL 1130 CV - ok. 45 minut. Akumulator przeznaczony jest do zasilania narzędzi akumulatorowych 10,8V i 12V z serii Bosch Professional (linia niebieska).  WAŻNA INFORMACJA - zmiana z 10,8V na 12V Od stycznia 2017 roku kompletny asortyment produktów Bosch Professional 10,8V zmienił nazwę na 12V. Narzędzia 12V są nadal w pełni kompatybilne ze wszystkimi aktualnymi (10,8V) i przyszłymi (12V) elektronarzędziami, akumulatorami i ładowarkami Bosch Professional.    Specyfikacja techniczna  Model: GBA 12V Napięcie akumulatora: 12V Pojemność akumulatorowa: 2 Ah Rodzaj akumulatora: litowo-jonowy Czas ładowania: 30-45 minut  Electronic Cell Protection System CEP zapewnia urządzeniu długą żywotność i dłuższy czas pracy akumulatora. System ten chroni akumulator przed przeciążeniem, przegrzaniem, a także całkowitym rozładowaniem.', '', 'bosch-akumulator-gba-12v-2ah', '', '', '', 'Bosch akumulator GBA 12V 2Ah', '', '', '', ''),
(317, 1, 1, 'Zestaw startowy - akumulator 18V 4 Ah i szybka ładowarka marki Einhell.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania.  System akumulatorowy Power X-Change to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.', '', 'einhell-zestaw-startowy-akumulator-40-ah-ladowarka', '', '', '', 'Einhell Zestaw startowy - akumulator 4,0 Ah + ładowarka', '', '', '', ''),
(318, 1, 1, 'Zestaw startowy marki Bosch złożony z akumulatora litowo-jonowego o pojemności 4,0 Ah oraz ładowarki. Przeznaczony do stosowania z elektronarzędziami marki Bosch.  Ładowarka może być stosowana w pozycji stojącej lub wiszącej - montaż na ścianie.', '', 'bosch-professional-zestaw-startowy-akumulator-ladowarka-18v', '', '', '', 'Bosch Professional Zestaw startowy akumulator + ładowarka 18V', '', '', '', ''),
(319, 1, 1, 'Zestaw startowy - akumulator 18V 2,5 Ah i szybka ładowarka 3A marki Einhell.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania.  System akumulatorowy Power X-Change to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.', '', 'einhell-zestaw-startowy-akumulator-18v-25ah-i-ladowarka', '', '', '', 'Einhell Zestaw startowy - akumulator 18V 2,5Ah i ładowarka', '', '', '', ''),
(320, 1, 1, 'Zestaw startowy akumulator 18V 4,0 Ah o wymiarach 17 x 87 x 18 cm, firmy Einhell.  Zestaw należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Dzięki unikalnej konstrukcji, wymiary oraz waga akumulatora są stosunkowo małe. Wyróżniają go nie tylko bardzo wysokiej jakości ogniwa litowo-jonowe, ale również zastosowana elektronika sterująca systemem ABS, który zapobiega m.in. przeładowaniu, przegrzaniu oraz samoczynnemu rozładowywaniu się akumulatora. System ten pozwala również naładować akumulator w bardzo krótkim czasie. Ładowarka zadba o to, żeby akumulator nie został przegrzany podczas ładowania i był ładowany odpowiednim napięciem i natężeniem prądu. Poinformuje nas o ewentualnym uszkodzeniu akumulatora, a kiedy zostanie głęboko rozładowany - spróbuje go pobudzić i przywrócić do normalnego funkcjonowania.  System akumulatorowy Power X-Change to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.', '', 'einhell-zestaw-startowy-akumulator-18v-40-ah-i-ladowarka', '', '', '', 'Einhell Zestaw startowy - akumulator 18V 4,0 Ah i ładowarka', '', '', '', ''),
(321, 1, 1, '4Garden Szybka ładowarka 20V 2,9A', '', '4garden-szybka-ladowarka-20v-29a', '', '', '', '4Garden Szybka ładowarka 20V 2,9A', '', '', '', ''),
(322, 1, 1, 'Akumulator wykonany w technologii Litowo-Jonowej o pojemności 2 Ah i napięciu maksymalnym 20 V. Akumulator przy użyciu standardowej ładowarki jest ładowany w 100% w 60 minut. Akumulator jest przeznaczony do elektrycznych urządzeń ogrodniczych marki LUX-Tools. W zestawie znajdziesz ładowarkę o mocy znamionowej - 70 W, napięciu ładowania - 20,9 V, prądzie ładowania - 2,4 V i klasie ochrony - II.', '', 'lux-tools-zestaw-startowy-akumulator-20v-2ah-ladowarka', '', '', '', 'LUX-Tools Zestaw startowy - akumulator 20V 2Ah + ładowarka', '', '', '', ''),
(323, 1, 1, 'Ryobi Ładowarka RC18120  Kompaktowa ładowarka należy do systemu Ryobi ONE+ składającego się z ponad 150 bezprzewodowych narzędzi do domu, ogrodu i wielu innych jest idealna do szybkiego ładowania baterii litowych Ryobi. Ładowarka akumulatorów litowych jest w stanie ładować z szybkością 2,0 amperów na godzinę, co oznacza, że możesz naładować akumulator o pojemności 2,0 Ah w ciągu 1 godziny. Wyposażony w lampki kontrolne, które pokazują stan naładowania i konserwacji akumulatorów. Wskaźnik gotowości do pracy pokazuje, kiedy bateria osiągnęła 80% pojemności. Zawiera inteligentne monitorowanie stanu, które ocenia napięcie i temperaturę akumulatora, zapewniając jednocześnie długotrwałą trwałość. Ładowarka kompatybilna jest ze wszystkimi akumulatorami litowo-jonowymi systemu ONE+ 18V  Specyfikacja techniczna  Napięcie/Moc: 18V Czas ładowania baterii 2Ah: 60 minut Czas ładowania baterii 3Ah: 90 minut Czas ładowania baterii 4Ah: 120 minut Szybkie ładowanie: tak', '', 'ryobi-ladowarka-rc18120', '', '', '', 'Ryobi Ładowarka RC18120', '', '', '', ''),
(324, 1, 1, 'Zestaw startowy z bateriami i ładowarką STANLEY FATMAX V20 2x 2.0Ah  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 jest gotowy do pracy w każdym miejscu i o każdej porze - i będzie działał dłużej.  Wbudowany wskaźnik umożliwia wygodne monitorowanie poziomu naładowania akumulatora.  Ładowanie akumulatorów 18V STANLEY FATMAX V20 2,0Ah w 30 minut. Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym, który pozwoli Ci z łatwością wykonywać pracę.', '', 'stanley-fatmax-zestaw-v20-akumulator-20ah-x-2-z-ladowarka-2a-18v', '', '', '', 'Stanley FatMax Zestaw V20 akumulator 2,0Ah x 2 z ładowarką 2A 18V', '', '', '', ''),
(325, 1, 1, 'Ładowarka do akumulatora DC18SD Li-Ion marki Makita  Ładowarka z kontrolką przeznaczona do akumulatorów litowo-jonowych Makita 14,4V i 18V.', '', 'makita-ladowarka-do-akumulatora-dc18sd-li-ion', '', '', '', 'Makita Ładowarka do akumulatora DC18SD Li-Ion', '', '', '', ''),
(326, 1, 1, 'Einhell Ładowarka PXC Szybka ładowarka Einhell należąca do rodziny urządzeń Power X-Change. Dzięki technologii szybkiego ładowania 4 amperów, czasy ładowania są jeszcze krótsze, akumulator jest stale monitorowany przez inteligentne zarządzanie ładowaniem, co zapewnia optymalne ładowanie i maksymalne bezpieczeństwo. Za pomocą uchwytów do zawieszania ładowarkę można łatwo zamontować na ścianie, a dzięki swoim kompaktowym rozmiarom urządzenie zajmuje niewiele miejsca. Tryb odświeżania umożliwia reaktywację głęboko rozładowanych akumulatorów. Wskaźnik stanu LED przekazuje aż 6 informacji odnośnie stanu akumulatora    Specyfikacja techniczna  Napięcie akumulatora: 18V Czas ładowania dla baterii 1,5Ah: 30 min. Czas ładowania dla baterii 3Ah: 60 min. Czas ładowania dla baterii 5,2Ah: 130 min. Szybkie ładowanie: tak  Seria PXC Seria PXC to seria urządzeń na akumulator, który można stosować w ponad 200 urządzeniach, zarówno służących do prac w przydomowym warsztacie, jak i w ogrodzie. Również ładowarki z tej serii mogą być stosowane do wszystkich akumulatorów PXC. Dzięki jednej baterii i jednej ładowarce do wszystkich urządzeń, chronisz środowisko i jednocześnie zapewniasz elastyczność pracy w domu i w ogrodzie.', '', 'einhell-ladowarka-pxc', '', '', '', 'Einhell Ładowarka PXC', '', '', '', ''),
(327, 1, 1, 'Szybka ładowarka 18V AL 1830CV dla akumulatorów o napięciu 14,4 i 18 V do elektrourządzeń marki Bosch. Czas ładowania 2,0 Ah do 100% ok. 45 min. Czas ładowania 4,0 Ah do 100% ok. 95 min. Czas ładowania 6,0 Ah do 100% ok. 130 min.', '', 'bosch-szybka-ladowarka-18v-al-1830cv', '', '', '', 'Bosch Szybka ładowarka 18V AL 1830CV', '', '', '', ''),
(328, 1, 1, '4Garden Ładowarka 20V 0,5A', '', '4garden-ladowarka-20v-05a', '', '', '', '4Garden Ładowarka 20V 0,5A', '', '', '', ''),
(329, 1, 1, 'Szybka ładowarka V20 4S 18V marki Stanley FatMax  Część nowego systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 wspólnym, nowym i ulepszonym akumulatorem litowo-jonowym 18V, który pozwoli Ci z łatwością poradzić sobie w różnych pracach.  Ładowarka 4A do szybkiego ładowania akumulatorów 18V STANLEY FATMAX V20 2.0Ah w 30 minut.', '', 'stanley-fatmax-ladowarka-szybka-v20-4a-18v', '', '', '', 'Stanley FatMax Ładowarka szybka V20 4A 18V', '', '', '', ''),
(330, 1, 1, '4Garden Podwójna ładowarka 20 V (do 2,0 Ah i 4,0 Ah)', '', '4garden-podwojna-ladowarka-20-v-do-20-ah-i-40-ah', '', '', '', '4Garden Podwójna ładowarka 20 V (do 2,0 Ah i 4,0 Ah)', '', '', '', ''),
(331, 1, 1, '4Garden Ładowarka 20V 2,2A', '', '4garden-ladowarka-20v-22a', '', '', '', '4Garden Ładowarka 20V 2,2A', '', '', '', ''),
(332, 1, 1, 'Ładowarka PXC 6 A marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Umożliwia ładowanie wszystkich akumulatorów z serii systemów Power X-Change jeszcze szybciej niż kiedykolwiek. Wybrany tryb doładowania znacznie skraca czas ładowania akumulatorów. Ponadto cykle ładowania są dostosowane do konkretnej sytuacji, dzięki czemu akumulatory mają dłuższą żywotność. Dla maksymalnego bezpieczeństwa dostępna jest inteligentna funkcja zarządzania ładowaniem oraz stałe monitorowanie ładowania zapewniające optymalne ładowanie przez cały czas. 6-stopniowy system ładowania zapewnia aktualne informacje o stanie akumulatora.  System akumulatorowy Power Exchange to ponad 75 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2 Ah do 5,2 Ah) i różnych typów ładowarek.  Urządzenie dostarczane jest bez akumulatora.', '', 'einhell-ladowarka-pxc-6-a', '', '', '', 'Einhell Ładowarka PXC 6 A', '', '', '', ''),
(333, 1, 1, 'Generator Prądotwórczy benzynowy o mocy znamionowej 2000 W firmy Hyundai.  Urządzenie niezbędne w każdym miejscu gdzie nie mamy dostępu do prądu z sieci. Generator wyposażony w chłodzony powietrzem silnik o mocy 3 KM ze stabilizacją napięcia AVR oraz voltomierz. Urządzenie wyposażono w 2 gniazdkach jednofazowe 230 V. Czas pracy ciągłej na jednym zbiorniku o pojemności 15 l wynosi 12 godzin. Poziom hałasu: 95 dB.  Posiada system automatycznej stabilizacji napięcia AVR dzięki któremu bezpiecznie podłączysz do agregatu domowy sprzęt AGD taki jak piece centralnego ogrzewania, pralkę, lodówkę itp.', '', 'hyundai-generator-pradotworczy-benzynowy-2000-w-z-avr', '', '', '', 'Hyundai Generator prądotwórczy benzynowy 2000 W z AVR', '', '', '', ''),
(334, 1, 1, 'Ramię wychylne marki LUX Tools o max długości 1100 mm. Obrotowe ramię służy do mocowania i obracania elektrycznych wciągników o lekkiej konstrukcji. W komplecie z ramieniem sprzedawane są nakładki mocujące. Min/max zasięg ramienia i udźwig: 750 mm - 600 kg/1100 mm - 300 kg br&gt;', '', 'lux-tools-ramie-wychylne-swa-600-300-600-kg', '', '', '', 'LUX Tools Ramię wychylne SWA-600 300-600 kg', '', '', '', ''),
(335, 1, 1, 'Elektryczna wciągarka marki LUX Tools o mocy 500 W. Urządzenie jest przeznaczone do podnoszenia i opuszczania małych ciężarów. Urządzenie wyposażone w linę o średnicy 3,18 mm. Wciągarka posiada zabezpieczenie przeciwprzeciążeniowe. Dołączony pilot obsługowy jest na kablu o długości 1,5 m a kabel zasilający ma 0,65 m. Maksymalny udźwig na wysokość 6/12 metrów: 200/100 kg. Funkcja automatycznego stopu. Stopień ochrony: IP54 Waga: 11 kg', '', 'lux-tools-elektryczna-wciagarka-linowa-sz-100-200', '', '', '', 'LUX Tools Elektryczna wciągarka linowa SZ-100/200', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(336, 1, 1, 'Wciągarka linowa marki LUX-TOOLS o maksymalnym udżwigu 360 kg. Urządzenie służy do ciągnięcia lub mocowania ładunków. Nie jest przeznaczone do podnoszenia ładunków. Wciągarka wyposażona jest w linę o średnicy 4 mm i długośći 10 m. Funkcja automatycznego stopu. Waga: 2,25 kg.', '', 'wciagarka-linowa-sw-360-kg', '', '', '', 'Wciągarka linowa SW-360 kg', '', '', '', ''),
(337, 1, 1, '', '', 'hyundai-generator-pradotworczy-hg800-3-650w', '', '', '', 'Hyundai Generator prądotwórczy HG800-3, 650W', '', '', '', ''),
(338, 1, 1, 'Przecinarka do glazury FSM-1200 o długości cięcia 120 cm marki Lux Tools. Ręczna przecinarka do glazury przeznaczona do cięcia małych i średnich płytek ceramicznych o grubości do 14 mm i długości do 1200 mm. Przecinarka posiada ruchome boczne ramiona do podtrzymywania szerszych płytek. Wyprofilowany uchwyt zapewnia wygodniejsze cięcie oraz łamanie płytek. Wyposażona jest w prowadnicę równoległą i ostrze o średnicy 22 mm.', '', 'lux-tools-przecinarka-reczna-do-glazury-120-cm', '', '', '', 'Lux-Tools Przecinarka ręczna do glazury 120 cm', '', '', '', ''),
(339, 1, 1, 'Przecinarka do glazury FSM 800 mm, LUX-TOOLS. Ręczna przecinarka do glazury przeznaczona do cięcia małych i dużych płytek ceramicznych o grubości do 12 mm i długości do 800 mm. Wyposażona jest w aluminiową podstawę, prowadnicę równoległą i poręczny uchwyt.', '', 'lux-przecinarka-do-glazury-fsm-800-mm', '', '', '', 'LUX Przecinarka do glazury FSM 800 mm', '', '', '', ''),
(340, 1, 1, 'Przecinarka do glazury FSM 700 mm, LUX-TOOLS. Ręczna przecinarka do glazury przeznaczona do cięcia małych i dużych płytek ceramicznych o grubości do 12 mm i długości do 700 mm. Wyposażona jest w aluminiową podstawę, prowadnicę równoległą i poręczny uchwyt.', '', 'lux-przecinarka-do-glazury-fsm-700-mm', '', '', '', 'LUX Przecinarka do glazury FSM 700 mm', '', '', '', ''),
(341, 1, 1, 'Przecinarka do glazury C-FSM-180/600, marki CMI. Kompaktowa przecinarka przeznaczona do cięcia małych i średnich płytek ceramicznych, zarówno ściennych, jak i podłogowych, a także kamienia i innych materiałów ceramicznych. Umożliwia cięcia pod kątem od 0 st. do 45 st. Wyposażona jest w tarczową piłę diamentową o średnicy 180 mm i prowadnicę równoległą. Posiada stół roboczy o wymiarach 330 mm x 360 mm z podziałką milimetrową, odchylany pod kątem 45 st. Moc: 600 W. Zasilanie: 230 V / 50 Hz. Prędkość obrotowa bez obciążenia: 4.750 obr/min. Maksymalna głębokość cięcia: 35 mm.', '', 'cmi-przecinarka-do-glazury-c-fsm-180-600-600-w-180-mm', '', '', '', 'CMI Przecinarka do glazury C-FSM-180/600 600 W 180 mm', '', '', '', ''),
(342, 1, 1, 'Przecinarka do glazury 600 mm marki LUX-Tools. Ręczna przecinarka do glazury przeznaczona do cięcia małych i średnich płytek ceramicznych o grubości do 14 mm i długości do 600 mm. Wyposażona jest w prowadnicę równoległą z łożyskami kulkowymi, ostrze o średnicy 22 mm i poręczny uchwyt.', '', 'lux-przecinarka-do-glazury-600-mm', '', '', '', 'LUX Przecinarka do glazury 600 mm', '', '', '', ''),
(343, 1, 1, 'Przecinarka do glazury TC-TC 800 o wymiarach 21x43x45cm, firmy Einhell.  Jest to kompaktowe i łatwe w transporcie narzędzie do cięcia z dużą dokładnością płytek ściennych i podłogowych. Duży stół roboczy ma bezpieczne wsparcie dla prowadzenia standardowych rozmiarów płytek. Przecinarka wyposażona jest w zbiornik z wodą do chłodzenia tarczy z funkcją łatwego opróżniania. Sam blat roboczy posiada regulację pochylenia w zakresie od 0 do 45 stopni. Solidna rama jest wyposażona w antypoślizgowe plastikowe nóżki zapewniające stabilność, dzięki otworom montażowym można je łatwo zamontować na każdym stole warsztatowym. Napięcie znamionowe: 220-240 V około 50 Hz Moc silnika: 800 W S2 10 min Liczba obrotów silnika: 2950 min-1 Klasa izolacji: Klasa F Rodzaj ochrony: IPX4 Klasa ochrony: I Długość cięcia: nieograniczona Długość cięcia typu Jolly: nieograniczona Wysokość cięcia 90°: 34 mm Wysokość cięcia 45°: 14 mm Stół przecinarki-Wymiary 395 mm x 385 mm Tarcza tnąca diamentowa 180 x 25,4 mm Waga: 9,2 kg.', '', 'einhell-przecinarka-do-glazury-tc-tc-800-21x43x45cm', '', '', '', 'Einhell Przecinarka do glazury TC-TC 800 21x43x45cm', '', '', '', ''),
(344, 1, 1, 'Przecinarka do płytek TR 232 S/L Norton Clipper  Przecinarka TR 232 została zaprojektowana z myślą o wytrzymałości i wysokiej wydajności. Urządzenie jest przeznaczone do przecinania wielu rodzajów płytek na sucho i mokro.  Tak samo, jak w przypadku innych produktów Norton Clipper, operator natychmiast doceni dbałość o szczegóły i jakość materiałów zastosowanych w konstrukcji urządzenia. Urządzenie wraz ze wszystkimi elementami montowane jest zgodnie z wysokimi normami zapewniającymi długi okres użytkowania przy minimalnej konserwacji.  Urządzenie jest przeznaczone do przecinania na mokro wielu rodzajów płytek, materiałów budowlanych i wyrobów ogniotrwałych. Nie jest przeznaczone do cięcia drewna, metalu ani jakichkolwiek innych materiałów.  Rama wykonana ze stali i aluminium zapewnia odpowiednią sztywność i wytrzymałość konstrukcji. 4 rozkładane nogi gwarantują stabilność podczas pracy.  Precyzyjnie kierowana aluminiowa konsola składa się z silnika elektrycznego, prowadnic i osłony tarczy. Głowicę można przechylać umożliwiając cięcie pod kątem do 45°.  Układ osłony tarczy obsługujący tarcze o maksymalnej średnicy 230 mm jest szczelnie zamknięty, ale zewnętrzną pokrywę można zdjąć, aby przeprowadzić prace konserwacyjne lub wymienić tarczę. Osłona zapewnia operatorowi maksymalną ochronę i zwiększoną widoczność elementu obrabianego. Do zabezpieczenia kołnierza mocującego służy sześciokątna nakrętka (gwintowana w lewo).  System chłodzenia wodą obejmuje: Zatapialną elektryczną pompę wodną. Rurę ssącą z tworzywa sztucznego dostarczającą wodę z miski do głowicy tnącej. Zdejmowaną plastikową miskę umieszczoną pod stołem, która zapobiega nadmiernej utracie wody. Dyszę wodną umieszczoną na obudowie, która zapewnia odpowiedni przepływ wody na tarczy.  Silnik elektryczny jednofazowy o mocy 1,1 kW. Do uruchamiania i wyłączania urządzenia służy przełącznik z czerwonym i zielonym przyciskiem. Czerwony przycisk jest również wyłącznikiem awaryjnym.  Dane techniczne: Napięcie zasilające / Moc: 230V 1 ~ /1,1Kw Bezpiecznik / generator: 16A / 3 kVA Średnica tarczy i otworu: śr. 230 x 25,4mm Głowica wychylna: 0 - 45° Maksymalna głębokość cięcia pod kątem 90° / 45° : 15mm / 10mm Prędkość obrotowa: 2950 min-1 Wibracje dłoni/ramienia: &lt; 2,5 m/s2 Poziom mocy akustycznej / ciśnienia akustycznego: 71 dB (A) / 79 dB (A) Wymiary stołu: 1200 x 565 mm', '', 'norton-clipper-przecinarka-do-plytek-tr-232-s-l-1100-w', '', '', '', 'Norton Clipper Przecinarka do płytek TR 232 S/L 1100 W', '', '', '', ''),
(345, 1, 1, 'Przecinarka do glazury FSM 600 mm, LUX-TOOLS. Ręczna przecinarka do glazury przeznaczona do cięcia małych i dużych płytek ceramicznych o grubości do 12 mm i długości do 600 mm. Wyposażona jest w prowadnicę równoległą, ostrze o średnicy 22 mm i poręczny uchwyt.', '', 'lux-przecinarka-do-glazury-fsm-600-mm', '', '', '', 'LUX Przecinarka do glazury FSM 600 mm', '', '', '', ''),
(346, 1, 1, 'Przecinarka do płytek glazurniczych DED7827 marki Dedra o mocy 800W z przesuwną głowicą tnącą  Przecinarka tarczowa do cięcia ceramiki wyposażona jest w elektryczny silnik indukcyjny oraz tarczę o średnicy 200 mm.  Przecinarka z tarczową piłą diamentową jest przeznaczona do cięcia wszelkiego rodzaju płytek okładzinowych, zarówno ściennych jak i podłogowych, oraz kamienia, cegły, cegły klinkierowej i innych materiałów ceramicznych o wymiarach z zakresu użytkowego.  W urządzeniu zastosowano system obróbki na mokro z użyciem wody jako czynnika chłodzącego i przeciwpyłowego, podawanego bezpośrednio na tarczę diamentową. Dzięki temu w czasie pracy znacznie ograniczono rozprzestrzenianie się urobku.  Maszyna umożliwia wykonanie podstawowych operacji cięcia elementów ceramicznych: cięcie wzdłużne pasków, cięcie poprzeczne, cięcie wzdłuż przekątnej oraz ukosowanie krawędzi.  Parametry urządzenia: Narzędzie klasy I Wymiary stołu roboczego : 890 x 394 mm Max. długość cięcia: 650 mm Max. grubość cięcia: 36 mm Max. grubość cięcia przy ukosowaniu 45°: do 29 mm Zakres odchyleń głowicy roboczej (od pionu) od 0° do 45° Moc pompki: 5W Max. temp. wody w obiegu 35°', '', 'dedra-przecinarka-do-glazury-ded7827-o-mocy-800-w', '', '', '', 'Dedra Przecinarka do glazury DED7827 o mocy 800 W', '', '', '', ''),
(347, 1, 1, 'Przecinarka do glazury TH-TC 618 600 W marki Einhell to kompaktowe i łatwe w transporcie narzędzie do cięcia z dużą dokładnością płytek ściennych i podłogowych. Duży stół roboczy ma bezpieczne wsparcie dla prowadzenia standardowych rozmiarów płytek. Przecinarka wyposażona jest w zbiornik z wodą do chłodzenia tarczy z funkcją łatwego opróżniania. Sam blat roboczy posiada regulację pochylenia w zakresie od 0 do 45 stopni. Solidna rama jest wyposażona w antypoślizgowe plastikowe nóżki zapewniające stabilność, dzięki otworom montażowym można je łatwo zamontować na każdym stole warsztatowym.  Urządzenie zasilane jest napięciem sieciowym 220-240 V.', '', 'einhell-przecinarka-do-glazury-th-tc-618-600-w', '', '', '', 'Einhell Przecinarka do glazury TH-TC 618 600 W', '', '', '', ''),
(348, 1, 1, 'Przecinarka do glazury MC990 800 W 720 mm marki Nutool. Przecinarka z tarczową piłą diamentową o średnicy 200 mm służy do precyzyjnego cięcia wszelkiego rodzaju płytek ceramicznych, zarówno ściennych, jak i podłogowych oraz kamienia, cegły, cegły klinkierowej i innych materiałów ceramicznych. Umożliwia cięcia pod kątem od 0 st. do 45 st. Przecinarka wyposażona jest w przesuwną głowicę tnącą. Stosuje się tu system obróbki na mokro z użyciem wody jako czynnika chłodzącego i przeciwpyłowego. Jest to uniwersalne urządzenie zapewniające wysoką wydajność i precyzję. Dzięki szybkiemu i bezproblemowemu montażowi 4 stopek przeznaczone jest zarówno do stacjonarnego, jak i mobilnego użycia. Moc: 800 W. Zasilanie: 230 V / 50 Hz. Prędkość obrotowa bez obciążenia: 2.950 obr/min. Maksymalna głębokość cięcia: 36 mm (90 st.), 29 mm (45 st.). Maksymalna długość cięcia: 720 mm. Wymiary stołu roboczego: 990 mm x 394 mm. Waga: 35 kg. W zestawie: prowadnica równoległa i akcesoria do cięcia skośnego.', '', 'nutool-przecinarka-do-glazury-mc990-800-w-720-mm', '', '', '', 'Nutool Przecinarka do glazury MC990 800 W 720 mm', '', '', '', ''),
(349, 1, 1, 'Przecinarka do glazury 59G887 o mocy 1200 W marki Graphite.  Przecinarka z piłą o średnicy 250 x 25,4 mm służy do precyzyjnego cięcia wszelkiego rodzaju płytek ceramicznych, zarówno ściennych, jak i podłogowych oraz kamienia, cegły, cegły klinkierowej i innych materiałów ceramicznych. Umożliwia cięcia pod kątem od 90/45°. Przecinarka wyposażona jest w przesuwną głowicę tnącą. Stosuje się tu system obróbki na mokro z użyciem wody jako czynnika chłodzącego i przeciwpyłowego. Dzięki szybkiemu i bezproblemowemu montażowi 4 stopek przeznaczone jest zarówno do stacjonarnego, jak i mobilnego użycia. Prędkość obrotowa bez obciążenia: 2.950 obr/min. Maksymalna głębokość cięcia: 58/45 mm dla 90/45°. Maksymalna długość cięcia: 1260 mm dla cięcia wgłębnego oraz 1100 mm bez cięcia wgłębnego. Zasięg posuwu głowicy: 1200 mm Wymiary stołu roboczego: 468 x 1260 mm. Wysokość: 850 mm.', '', 'graphite-przecinarka-do-glazury-1200-w', '', '', '', 'Graphite Przecinarka do glazury 1200 W', '', '', '', ''),
(350, 1, 1, 'Maszynka do płytek ceramicznych 1000 mmZnajduje swoje zastosowanie podczas prac glazurniczych. Płynne prowadzenie noża na prowadnicy umożliwiają zastosowane łożyska kulkowe. Aluminiowy blat wyposażony w miarę metryczną oraz kątownik.', '', 'maszynka-do-plytek-ceramicznych-1000-mm', '', '', '', 'Maszynka do płytek ceramicznych 1000 mm', '', '', '', ''),
(351, 1, 1, 'Kółko tnące-22 mm przeznaczone jest do przecinarek do cięcia płytek. Część jest prosta do wymiany w momencie kiedy stare kółko już słabo tnie.', '', 'lux-kolko-tnace-do-przecinarek-22-mm', '', '', '', 'LUX Kółko tnące do przecinarek 22 mm', '', '', '', ''),
(352, 1, 1, 'Maszynka do płytek ceramicznych 800 mmZnajduje swoje zastosowanie podczas prac glazurniczych. Płynne prowadzenie noża na prowadnicy umożliwiają zastosowane łożyska kulkowe. Aluminiowy blat wyposażony w miarę metryczną oraz kątownik.', '', 'maszynka-do-plytek-ceramicznych-800-mm', '', '', '', 'Maszynka do płytek ceramicznych 800 mm', '', '', '', ''),
(353, 1, 1, 'Kółko przeznaczone jest jako część zapasowa do przecinarki ręcznej do glazury firmy LUX. Średnica: 22 mm# Szerokość: 2 mm', '', 'kolko-tnace-do-przecinarki-do-glazury-lux', '', '', '', 'Kółko tnące do przecinarki do glazury LUX', '', '', '', ''),
(354, 1, 1, 'Przecinarka do glazury MC1170 800 W 230 mm marki Nutool. Przecinarka z tarczową piłą diamentową służy do precyzyjnego cięcia wszelkiego rodzaju płytek ceramicznych, zarówno ściennych, jak i podłogowych oraz kamienia, cegły, cegły klinkierowej i innych materiałów ceramicznych. Umożliwia cięcie pod kątem od 0 st. do 45 st. Przecinarka wyposażona jest w przesuwną głowicę tnącą. Stosuje się tu system obróbki na mokro z użyciem wody jako czynnika chłodzącego i przeciwpyłowego. Jest to uniwersalne urządzenie zapewniające wysoką wydajność i precyzję. Dzięki szybkiemu i bezproblemowemu montażowi 4 stopek przeznaczone jest zarówno do stacjonarnego, jak i mobilnego użycia. Moc: 800 W. Zasilanie: 230 V / 50 Hz. Prędkość obrotowa bez obciążenia: 2.950 obr/min. Maksymalna głębokość cięcia: 36 mm (90 st.), 29 mm (45 st.). Maksymalna długość cięcia: 900 mm. Wymiary stołu roboczego: 1170 mm x 394 mm. W zestawie: prowadnica równoległa i akcesoria do cięcia skośnego.', '', 'nutool-przecinarka-do-glazury-mc1170-800-w-230-mm', '', '', '', 'Nutool Przecinarka do glazury MC1170 800 W 230 mm', '', '', '', ''),
(355, 1, 1, 'Kółko przeznaczone jest jako część zapasowa do przecinarki ręcznej do glazury, marki LUX-Tools. Średnica: 22 mm', '', 'lux-zapasowy-krazek-tnacy-22-mm', '', '', '', 'LUX Zapasowy krążek tnący 22 mm', '', '', '', ''),
(356, 1, 1, 'Kółko przeznaczone jest jako część zapasowa do przecinarki ręcznej do glazury marki LUX-Tools. Średnica: 22 mm# Szerokość: 2 mm', '', 'lux-zapasowy-krazek-tnacy-22-mm', '', '', '', 'LUX Zapasowy krążek tnący 22 mm', '', '', '', ''),
(357, 1, 1, 'Przecinarka do glazury 400 mm, marki Ellix. Ręczna przecinarka do glazury przeznaczona do cięcia małych i średnich płytek ceramicznych o grubości do 10 mm i długości do 400 mm. Wyposażona jest w prowadnicę równoległą, ostrze o średnicy 15 mm i poręczny uchwyt.', '', 'ellix-przecinarka-do-glazury-400-mm', '', '', '', 'Ellix Przecinarka do glazury 400 mm', '', '', '', ''),
(358, 1, 1, 'Przecinarka do płytek TR 202 Norton Clipper  Przecinarka TR 202 została zaprojektowana z myślą o wytrzymałości i wysokiej wydajności. Urządzenie jest przeznaczone do przecinania wielu rodzajów płytek na sucho i mokro.  Tak samo, jak w przypadku innych produktów Norton Clipper, operator natychmiast doceni dbałość o szczegóły i jakość materiałów zastosowanych w konstrukcji urządzenia. Urządzenie wraz ze wszystkimi elementami montowane jest zgodnie z wysokimi normami zapewniającymi długi okres użytkowania przy minimalnej konserwacji.  Urządzenie jest przeznaczone do przecinania na mokro wielu rodzajów płytek, materiałów budowlanych i wyrobów ogniotrwałych. Nie jest przeznaczone do cięcia drewna, metalu ani jakichkolwiek innych materiałów. Rama wykonana ze stali i aluminium zapewnia odpowiednią sztywność i wytrzymałość konstrukcji. 4 rozkładane nogi gwarantują stabilność podczas pracy.  Precyzyjnie kierowana aluminiowa konsola składa się z silnika elektrycznego, prowadnic i osłony tarczy. Głowicę można przechylać umożliwiając cięcie pod kątem do 45°.  Układ osłony tarczy obsługujący tarcze o maksymalnej średnicy 200 mm jest szczelnie zamknięty, ale zewnętrzną pokrywę można zdjąć, aby przeprowadzić prace konserwacyjne lub wymienić tarczę. Osłona zapewnia operatorowi maksymalną ochronę i zwiększoną widoczność elementu obrabianego. Do zabezpieczenia kołnierza mocującego służy sześciokątna nakrętka (gwintowana w lewo).  System chłodzenia wodą obejmuje: Zatapialną elektryczną pompę wodną. Rurę ssącą z tworzywa sztucznego dostarczającą wodę z miski do głowicy tnącej. Zdejmowaną plastikową miskę umieszczoną pod stołem, która zapobiega nadmiernej utracie wody. Dyszę wodną umieszczoną na obudowie, która zapewnia odpowiedni przepływ wody na tarczy.  Silnik elektryczny jednofazowy o mocy 900 W. Do uruchamiania i wyłączania urządzenia służy przełącznik z czerwonym i zielonym przyciskiem. Czerwony przycisk jest również wyłącznikiem awaryjnym.  Dane techniczne: Napięcie zasilające / Moc: 230V 1 ~ / 900 W (1,2 Hp) Bezpiecznik / generator: 16A / 3 kVA Średnica tarczy i otworu: śr. 200 x 25,4mm Głowica wychylna: 0 - 45° Maksymalna głębokość cięcia pod kątem 90° / 45° : 15mm / 10mm Maksymalna długość cięcia: 650 mm Prędkość obrotowa: 2950 min-1 Wibracje dłoni/ramienia: &lt; 2,5 m/s2 Poziom mocy akustycznej / ciśnienia akustycznego: 80 dB (A) / 72 dB (A) Wymiary stołu: 810 x 470 mm', '', 'norton-clipper-przecinarka-do-glazury-tr202-900-w', '', '', '', 'Norton Clipper Przecinarka do glazury TR202 900 W', '', '', '', ''),
(359, 1, 1, 'Ręczna przecinarka do glazury 600 mm, marki Ellix. Przecinarka do glazury przeznaczona do cięcia małych i średnich płytek ceramicznych o grubości do 10 mm i długości do 600 mm. Wyposażona jest w prowadnicę równoległą, ostrze o średnicy 15 mm i poręczny uchwyt.  Stabilna podstawa do pracy na podłodze czy blacie.', '', 'ellix-przecinarka-reczna-do-glazury-600-mm', '', '', '', 'Ellix Przecinarka ręczna do glazury 600 mm', '', '', '', ''),
(360, 1, 1, 'Bosch Professional Młotowiertarka GBH 240 790 W Wyjątkowo trwałe, mocne urządzenie do wszelkich prac budowlanych, renowacyjnych i remontowych Bosch o mocy 790W, sile udaru 2,7J, prędkości obrotowej 1300 obr/min i uchwycie wiertarskim SDS Plus, stosowany w młotach udarowo-obrotowych klasy 2-4kg.   Specyfikacja techniczna  Model: GBH 240 Moc: 790W Siła udaru: 2,7J Prędkość obrotowa: 1300 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 4200 ud/min Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 20mm  Nowy standard wiercenia w betonie Urządzenie zapewnia najszybsze tempo wiercenia w tej klasu narzędzi dzięki zoptymalizowanej obudowie przekładni, wyższą wytrzymałość i możliwość wykonywania zaawansowanych prac dzięki wydajnemu silnikowi o mocy 790W, a także inteligentną konstrukcję ułatwiającą wymianę części i serwisowanie.  Funkcje młotowiertarki Młotowiertarka Bosch posiada funkcje wkręcania, wiercenia, wiercenia udarowego oraz kucia.  Zmiana obrotów lewo/prawo zmiana obrotów lewo/prawo do wkręcania i wykręcania śrub i wkrętów z systemem kompensacji mocy, dzięki któremu prędkośc obrotowa jest identyczna.  Walizka z tworzywa sztucznego W zestawie z młotowiertarką znajduje sie walizka wykonana z tworzywa sztucznego gwarantująca bezpieczny transport, a także przechowywanie urządzenia. Walizka odporna jest na uszkodzenia mechaniczne, ponadto posiada wyprofilowane miejsca na sprzęt dodatkowy (nie występujący w zestawie). Tym samym masz pewność, że żaden z elementów wyposażenia nie przemieści się w trakcie transportu.    Wyposażenie W zestawie znajduje się młotowiertarka GBH 240 o mocy 790W, walizka wykonana z tworzywa sztucznego, 5 wierteł oraz dłuto.    Maksymalna średnica wiercenia Młotowiertarka zapewnia wiercenie w drewnie, betonie, stali oraz betonie koronkami. Ich maksymalna średnica wiercenia podana jest poniżej.  Maks. średnica wiercenia w stali: 13mm Maks. średnica wiercenia w drewnie: 30mm Maks. średnica wiercenia w betonie: 20mm Maks. średnica wiercenia w betonie koronkami: 68mm  Chwyt SDS Plus Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dzięki jego lekkiej i kompaktowej konstrukcji.  Pobierz kartę gwarancyjną.', '', 'bosch-professional-mlotowiertarka-gbh-240-790-w', '', '', '', 'Bosch Professional Młotowiertarka GBH 240 790 W', '', '', '', ''),
(361, 1, 1, 'Młotowiertarka BOSCH Professional GBH 220 720W 2J 1BIEG  - Siła uderzenia (w J) 2.0 - Moc pobierana (w W) 720.0 - Średnica wiercenia w betonie (w mm) 22.0 - Funkcja podkuwania Tak - Typ udaru Wyposażenie elektropneumatyczne do betonu zbrojonego/wibrobetonu/strunobetonu - Moc (w W) Mniej niż 1000 - Ilość prędkości 1 - Średnica wiercenia w drewnie (w mm) 30.0 - Średnica wiercenia w metalu (w mm) 13.0 - Funkcja wiercenia udarowego Tak - Funkcja wiercenia Tak - Typ uchwytu SDS Plus - Waga (w kg) 4.114 - Marka BOSCH PROFESSIONAL - Gwarancja (w latach) 2', '', 'mlotowiertarka-bosch-professional-gbh-220-720w-2j-1-bieg', '', '', '', 'Młotowiertarka BOSCH Professional GBH 220 720W 2J 1 bieg', '', '', '', ''),
(362, 1, 1, 'Makita Młotowiertarka HR2470 780 W Młotowiertarkaudarowa Makita o mocy 780W, prędkości obrotowej 1100 obr/min i sile udaru 2,4J. To solidne iurządzenie przeznaczone jest do dłutowania, wiercenia i wiercenia udarowego. Dzięki przełącznikowi z wyborem trybu kucia, wiercenia lub wiercenia udarowego można szybko i sprawnie dostosować urządzenie do charakteru pracy.    Specyfikacja techniczna  Model: HR 2470 Moc: 780W Prędkość obrotowa: 1100 obr/min. Siła udaru: 2,4J Uchwyt wiertarski: SDS Plus Liczba udarów: 4500 ud/min. Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 24 mm    Pokrycie rękojeści materiałem antypoślizgowym w znacznym stopniu zmniejsza drgania przenoszone na przegub dłoni i zwiększa ergonomię urządzenia, co jest niezwykle istotne, zwłaszcza przy długotrwałych i zaawansowanych pracach. Zastosowanie specjalnego chwytu SDS-plus z osłoną przeciwpyłową, umożliwia beznarzędziową i szybką wymianę wierteł i dłut.', '', 'makita-mlotowiertarka-hr2470-780-w', '', '', '', 'Makita Młotowiertarka HR2470 780 W', '', '', '', ''),
(363, 1, 1, 'CMI Młotowiertarka 1050 W Młotowiertarka CMI o mocy 1050W, prędkości obrotowej 1000 obr/min i sile udaru 3J. To wyjątkowo trwałe i mocne urządzenie przeznaczone do ciężkich prac budowlanych pozwala na pewne wiercenie w betonie, stali i aluminium. Liczba i siła udarów gwarantują, że wiercenie nawet w najtwardzzym betonie. Funkcja kucia z włącznikiem blokady pozwala na wygodną ciągłą pracę.    Specyfikacja techniczna  Moc: 1050W Prędkość obrotowa: 1000 obr/min. Siła udaru: 3J Uchwyt wiertarski: SDS Plus Liczba udarów: 4960 ud/min. Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 24 mm  Młotowiertarka CMI posiada regulowany uchwyt, który znacząco poprawia komfort pracy, a także ogranicznik wiercenia, który pozwoli na szybkie i dokładne osiągnięcie zamierzonej głębokości otworu. Pokrycie jękojeści miękkim materiałem w znacznym stopniu zmniejsza drgania przenoszone na przegub dłoni i zwiększa ergonomię urządzenia, co jest niezwykle istotne, zwłaszcza przy długotrwalych i zaawansowanych pracach. Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową, umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dziękijego lekkiej i kompaktowej konstrukcji.  W zestawie znajduje się młotowiertarka, walizka, osłona przeciwpyłowa, uchwyt wiertarski z wieńcem zębatym oraz zestaw dłu i wierteł.', '', 'cmi-mlotowiertarka-1050-w', '', '', '', 'CMI Młotowiertarka 1050 W', '', '', '', ''),
(364, 1, 1, 'Einhell Klucz udarowy TE-CW 18 Li Solo bezszczotkowy Akumulatorowy klucz udarowy Einhell o napięciu akumulatora 18V i prędkości obrotowej 0-2900 obr/min. Urządzenie marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Jego silnik bezszczotkowy zapewnia większą moc i działa dlużej niż narzędzia z tradycyjnymi silnikami szczotkowymi. Urządzenie to zapewnia wystarczającą moc, aby poluzować nawet zakleszczone nakrętki kół. Mimo całej swojej mocy jest lekki i wygodny w obsłudze. Ponadto jest wyposażony w solidny zewnętrzny kwadratowy uchwyt 1/2\", a także w adapter do wkrętów. Uwaga! Urządzenie dostarczane jest bez akumulatora i ładowarki.    Specyfikacja techniczna  Model: TE-CW 18V (bez akumulatora) Napięcie akumulatora: 18V &gt;Prędkość obrotowa: 0-2900 obr/min Liczba biegów: 1 Maksymalny moment obrotowy: 215Nm    System akumulatorowy Power X-Change To ponad 200 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2Ah do 6 Ah) i różnych typów ładowarek. W akumulatorach zastosowano najlepsze komponenty, jak wysokowydajne ogniwa litowo-jonowe i inteligentna elektronika akumulatorów sterowana procesorem Active Battery Manegment. Zapewniają one bezpieczeństwo, wydajność i niezawodność.', '', 'einhell-klucz-udarowy-te-cw-18-li-solo-bezszczotkowy', '', '', '', 'Einhell Klucz udarowy TE-CW 18 Li Solo bezszczotkowy', '', '', '', ''),
(365, 1, 1, 'Ryobi Klucz udarowy R18IW3-0, 18V  Akumulatorowy klucz udarowy R18IW3-0 świetnie nadaje się do bardziej wymagających zadań związanych z przykręcaniem i odkręcaniem śrub. Produkt marki Ryobi posiada 3 ustawienia prędkości, światło LED oraz uchwyt 1/2\" z kołkiem blokującym.  Brak akumulatora i ładowarki w zestawie (należy dokupić oddzielnie).  Specyfikacja techniczna  Częst. udaru: 0-3200 ud./min. Maks. moment obrotowy: 400 Nm Pręd. bez obc. bieg 1: 2100 obr./min. Pręd. bez obc. bieg 2: 2500 obr./min. Prędkość bez obciążenia: 0-2900 obr/min. Ustawienia momentu obrotowego: 180/240/400', '', 'ryobi-klucz-udarowy-r18iw3-0-18v', '', '', '', 'Ryobi Klucz udarowy R18IW3-0, 18V', '', '', '', ''),
(366, 1, 1, 'CMI Młot udarowy C-BH-1500 1500 W Młot udarowy CMI o mocy 1500W, prędkości obrotowej 780 obr/min i sile udaru 5,5J. To urządzenie z pneumatycznym udarem jest maszyną przeznaczoną do prac budowalnych związanych z wyburzaniem, czy skuwaniem nawierzchni.    Specyfikacja techniczna  Model: C-BH-1500 Moc: 1500W Prędkość obrotowa: 780 obr/min Siła udaru: 5,5J Uchwyt wiertarski: SDS Plus Liczba udarów: 2700 ud/min. Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 36 mm  Młot udarowy CMI służy do wiercenia otworów w materiałach o maksymalnej grubości:  - 13mm stal -36mm beton -40mm drewno  W zestawie znajdują się: 3 szt. wierteł SDS (8/10/12mm x 150mm), 1 przebijak z końcówką płaską i szpiczastą (14x150mm), klucz 6-kątny, osłonę przeciwpyłową i zapasowe szczotki węglowe. Całość umieszczona jest w praktycznej walizce wykonanej z tworzywa sztucznego.', '', 'cmi-mlot-udarowy-c-bh-1500-1500-w', '', '', '', 'CMI Młot udarowy C-BH-1500 1500 W', '', '', '', ''),
(367, 1, 1, 'CMI Młotowiertarka 800 W Młotowiertarka CMI o mocy 800W, prędkości obrotowej 900 obr/min i sile udaru 4J. To wyjątkowo poręczne i bardzo dobrze wyważone urządzenie, doskonałe do seryjnego wiercenia i podkuwania. Młotowiertarka CMI nadaje się do wszelkich prac budowlanych, renowacyjnych i remontowych. Duża moc pozwala na pracę przy dużym obciążeniu i w trudnych warunkach.    Specyfikacja techniczna  Model: C-BH-800-C Moc: 800W Prędkość obrotowa: 900 obr/min. Siła udaru: 4J Uchwyt wiertarski: SDS Plus Liczba udarów: 3900 ud/min. Funkcja kucia: nie Maksymalna średnica wiercenia w betonie: 26 mm  Młotowiertarka CMI wyposażona jest w dodatkowy uchwyt i ogranicznik głębokości, co znacznie poprawia komfort pracy. Z kolei szybkomocujący uchwyt SDS Plus umożliwia łatwą wymianę akcesoriów. Wysoka jakość wykonania zapewnia długą i trwałą eksploatację.  W zestawie znajduje się: dłuto przecinak (14x250mm), 3 szt. wierteł SDS (8/10/12mm x 150mm), dodatkowy uchwyt, ogranicznik głębokości wiercenia oraz zestaw szczotek węglowych.', '', 'cmi-mlotowiertarka-800-w', '', '', '', 'CMI Młotowiertarka 800 W', '', '', '', ''),
(368, 1, 1, 'LUX-Tools Młotowiertarka akumulatorowa 20V - bez akumulatora Młotowiertarka LUX Tools z napięciem akumulatora 20V, sile udaru 1,1J i prędkości obrotowej 900 obr/min. Młot wyróżnia się 3 funkcjami: wkręcania, wiercenia oraz wiercenia udarowego. Urządzenie znajdzie swoje zastosowanie w rzemiośle, pracach domowych i remontowych. Młot jest częścia praktycznego systemu LUX 1 PowerSystem i może być zasilany wysokiej jakości akumulatorami litowo-jonowymi 20V z tej serii. Zasilanie bateryjne zapewnia dużą swobodę ruchów i elastyczność.  Uwaga! Urządzenie sprzedawane jest bez akumulatora i ładowarki.    Specyfikacja techniczna  Napięcie akumulatora: 20V (bez akumulatora w zestawie) Ilość akumulatorów: 0 Siła udaru: 1,1J Prędkość obrotowa: 900 obr/min. Uchwyt wiertarski: SDS Liczba udarów: 5000 ud/min. Maksymalna średnica wiercenia w betonie: 10 mm  Dzięki zmiennej regulacji prędkości urządzenie optymalnie dostosowuje się do danego procesu wiercenia i zapewnia precyzyjne wyniki. Jego wydajność wiercenia osiąga średnicę do 16mm w drewnie, 10mm w betonie i 8mm w stali. Dzięki miękkiemu uchwytowi młot wygodnie leży w dłoni i zapewnia wygodną pracę. Jest również wyposażony w oświetlenie robocze LED, które oświetla trudno dostępne obszary.    LUX Tools 20V - jeden akumulator, wiele możliwości LUX Tools 20V to system, który możesz dopasować do swoich potrzeb. Działa w każdym narzędziu z rodziny PowerSystem, niezależnie od jego rodzaju, dlatego możesz go swobodnie konfigurować. Tak, by jeszcze łatwiej i szybciej wykonać daną pracę. LUX Tools 20V to nie tylko wygoda, ale przede wszystkim oszczędność czasu i miejsca. Dość bałaganu w warsztacie lub ogrodzie. Dość wielu zbędnych ładowarek i akumulatorów. Jedno urządzenie wystarczy i do drobnych domowych napraw, i do wielkiego majsterkowania.  Więcej o PowerSystem przeczytasz tutaj.', '', 'lux-tools-mlotowiertarka-akumulatorowa-20v-bez-akumulatora', '', '', '', 'LUX-Tools Młotowiertarka akumulatorowa 20V - bez akumulatora', '', '', '', ''),
(369, 1, 1, 'Bosch Młot udarowo-obrotowy PBH 2100 RE 550 W Wyjątkowo trwałe, mocne urządzenie do podkuwania, dłutowania, wiercenia i wkręcania Bosch o mocy 550W, sile udaru 1,7J, prędkości obrotowej 2300 obr/min i uchwycie wiertarskim SDS Plus, stosowany w młotach udarowo-obrotowych klasy 2-4kg. Dzięki przełącznikowi z wyborem trybu wkręcania, wiercenia, wiercenia udarowego oraz kucia można szybko i sprawnie dostosować urządzenie do charakeru pracy.   Specyfikacja techniczna  Model: PBH 2100 RE Moc: 550W Siła udaru: 1,7J Prędkość obrotowa: 2300 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 5800 ud/min Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 20mm   Silnik o mocy 550W, a także wysoka prędkośc obrotowa pozwalają na wiercenie w betonie, stali, aluminium czy drewnie. Pneumatyczny mechanizm udarowy gwarantuje, że wiercenie nawet w najtwardszym betoie nie sprawia żadnego problemu. Natomiast blokada udaru pozwala na wiercenie w drewnie, stali czy aluminium.  Funkcja kucia Funkcja kucia z włącznikiem blokady pozwalającym na wygodną ciągłą pracę, umożliwia wykonywanie prac dłutujących w kamieniu, cegle czy betonie. Kolejną zaletą jest opcja zmiany ustawienia dłuta w różnych pozycjach, ułatwiająca kucie w miejscach trudno dostępnych.  Chwyt SDS Plus Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dzięki jego lekkiej i kompaktowej konstrukcji.  Ergonomiczna obsługa i łatwość serwisowania Poręczna, optymalnie ukształtowana młotowiertarka zapewnia ergonomiczną obsługę dzięki niskiej wadze i kompaktowej konstrukcji. Rękojeść urządzenia powleczona jest antypoślizgowym, miękkim materiałem SOFTGRIP, co gwarantuje bezpieczeństwo pracy oraz wygodę obsługi.  Pobierz kartę gwarancyjną.', '', 'bosch-mlot-udarowo-obrotowy-pbh-2100-re-550-w', '', '', '', 'Bosch Młot udarowo-obrotowy PBH 2100 RE 550 W', '', '', '', ''),
(370, 1, 1, 'Klucz udarowy V20 18V bezszczotkowy marki Stanley FatMax  Dzięki ulepszonej technologii akumulatorów, braku efektu pamięci i minimalnemu samorozładowaniu, akumulator litowo-jonowy V20 (do zakupienia osobno) jest gotowy do pracy, gdziekolwiek jesteś i dokądkolwiek zaprowadzi Cię praca - i będzie działał dłużej.  Technologia silnika bezszczotkowego zapewnia wyższą sprawność energetyczną i dłuższy czas pracy, dzięki mniejszemu, bardziej kompaktowemu silnikowi o ograniczonej konserwacji i wydłużonej żywotności.  Mocny silnik zapewniający do 1900RPM i moment obrotowy 373 Nm do wbijania dużych elementów złącznych i innych zastosowań wymagających wysokiego momentu obrotowego.  Kowadełko 1 /2\" z pierścieniem ułatwiającym wymianę nasadek. 2-biegowy przełącznik suwakowy i spust o zmiennej prędkości do kontrolowania wbijanego elementu mocującego. Zintegrowana lampa robocza LED zapewniająca lepszą widoczność w każdych warunkach pracy. Ergonomiczny uchwyt pozwalający na dłuższe użytkowanie.  Część systemu akumulatorowego 18V STANLEY FATMAX V20 - zasilaj wszystkie narzędzia V20 nowym i ulepszonym akumulatorem litowo-jonowym, który pozwoli Ci z łatwością wykonywać pracę.', '', 'stanley-fatmax-klucz-udarowy-v20-18v-bezszczotkowy', '', '', '', 'Stanley FatMax Klucz udarowy V20 18V bezszczotkowy', '', '', '', ''),
(371, 1, 1, 'Bosch Professional Młotowiertarka akumulatorowa GBH 180-LI 18V 4Ah Wyjątkowo trwałe, mocne urządzenie do ciężkich prac budowalnych Bosch o mocy 550W, sile udaru 1,7J, prędkości obrotowej 0-2300 obr/min i uchwycie wiertarskim SDS Plus, stosowany w młotach udarowo-obrotowych klasy 2-4kg. Urządzenie pozwala na pewne wiercenie w stali i drewnie bez udaru i betonie z udarem oraz dłutowanie po zablokowaniu obrotów.   Specyfikacja techniczna  Model: GBH 180-Li Napięcie akumulatora: 18V Ilość akumulatorów: 1 Pojemność akumulatora: 4,0 Ahn Rodzaj akumulatora: litowo-jonowy Siła udaru: 2,0J Prędkość obrotowa: 1800 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 5100 ud/min Maksymalna średnica wiercenia w betonie: 20mm   Silnik bezszczotkowy Wydajny mechanizm udarowy 2,0J oraz 3 tryby pracy młota zapewniają wzechstronność działania, ponato dzięki zastosowaniu silnika bezszczotkowego zauważane są mniejsze nakłady na konserwację i dłuższy czas pracy na jednym cyklu ładowania akumulatora. Silnik bezszczotkowy zapewnia również brak iskrzenia oraz mniejszą emisję ciepła podczas pracy.  Akumulator litowo-jonowy Dostępny w zestawie akumulator litowo-jonowy charakteryzuje się brakiem samorozładowania, brakiem efektu pamięci i wyższą gęstością energii.  Funkcja kucia Funkcja kucia umożliwia wykonywanie prac dłutujących w cegle, kamieniu i betonie, a także w dewnie (przy zastosowaniu specjalnego dłuta. System Vario-Lock Blokada Vario-Lock umożliwia zmianę ustawienia dłuta w różnych pozycjach ułatwiając kucie w miejscach trudno dostępnych. Regulowany uchwyt znacząco poprawia komfort pracy. Z kolei ogranicznik wiercenia pozwala na szybkie i dokładne osiągnięcie zamierzonej głębokości otworu.  Ergonomiczna obsługa i łatwość serwisowania Poręczna, optymalnie ukształtowana młotowiertarka zapewnia ergonomiczną obsługę dzięki niskiej wadze i kompaktowej konstrukcji. Rękojeść urządzenia powleczona jest antypoślizgowym, miękkim materiałem SOFTGRIP, co gwarantuje bezpieczeństwo pracy oraz wygodę obsługi.  Chwyt SDS Plus Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dzięki jego lekkiej i kompaktowej konstrukcji.  Pobierz kartę gwarancyjną.', '', 'bosch-professional-mlotowiertarka-akumulatorowa-gbh-180-li-18v-4ah', '', '', '', 'Bosch Professional Młotowiertarka akumulatorowa GBH 180-LI 18V 4Ah', '', '', '', ''),
(372, 1, 1, 'LUX-TOOLS Młotowiertarka 800 W Młotowiertarka LUX Tools o mocy 800W, prędkości obrotowej 1200 obr/min i sile udaru 2,8J. To solidne i wszechstronne narzędzie do wiercenia i dłutowania. Może być stosowane do takich materiałów, jak: metal, drewno i powierzchnie drewnopochodne oraz lekkie materiały budowlane.    Specyfikacja techniczna  Model: BHA-800 A Moc: 800W Prędkość obrotowa: 1200 obr/min. Siła udaru: 2,8J Uchwyt wiertarski: SDS Plus Liczba udarów: 5300 ud/min. Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 26 mm  Wiertarka udarowa LUX-TOOLS jest wyposażona w uchwyt szybkomocujący z gniazdem SDS-Plus, ułatwiający wymianę akcesoriów. Praktyczną funkcją jest zastosowana elektroniczna regulacja obrotów z funkcją zmiany kierunku obrotów prawo/lewo. Udar o mocy 2,8 J. Sprzęgło przeciążeniowe oraz blokada włącznika do pracy ciągłej zapewniają lepszą sterowność urządzenia. Pozwalają także dostosować parametry pracy do właściwości obrabianego materiału. 4 funkcje: wiercenie, wiercenie udarowe, kucie, reczne ryglowanie dłuta. Kabel o długości 3 m. pozwala na swobodne przemieszczanie się podczas pracy.    Jest wykonana z wysokiej jakości materiałów. Gwarantuje to jej bezawaryjną pracę oraz odporność na czynniki mechaniczne. Ten model pozwala na stosowanie różnego rodzaju akcesoria z mocowaniem SDS-Plus. Zastosowanie dodatkowej rękojeści pozwoliło na wytłumienie drgań, co znacznie wpływa na komfort pracy. Niewielkie wymiary oraz lekkość sprawiają, że urządzeniem bardzo łatwo operować. Do wiertarki dodawane są 3 wiertła, szpic oraz dłuto.', '', 'lux-tools-mlotowiertarka-800-w', '', '', '', 'LUX-TOOLS Młotowiertarka 800 W', '', '', '', ''),
(373, 1, 1, 'Ryobi Młot udarowo-obrotowy RSDS1050-K  Młot udarowo-obrotowy RSDS1050-K z uchwytem wiertarskim SDS+ i udarem pneumatycznym świetnie nadaje się wiercenia otworów w kamieniu i betonie. Produkt marki Ryobi posiada 3 tryby pracy (wiercenie z udarem, wiercenie bez udaru, dłutowanie) i dysponuje funkcją kucia.  Specyfikacja techniczna Siła udaru: 3,6J Maks. częstotliwość udaru: 0-4000 ud./min. Maks. zdolność wiercenia w murze: 26 mm Prędkość bez obciążenia: 0-950 obr/min. Typ uchwytu: SDS+', '', 'ryobi-mlot-udarowo-obrotowy-rsds1050-k', '', '', '', 'Ryobi Młot udarowo-obrotowy RSDS1050-K', '', '', '', ''),
(374, 1, 1, 'Młot udarowo-obrotowy Celma Professional PRWg 40GEO jest połączeniem wysokiej mocy, dużej energii udaru oraz funkcjonalności przy zachowaniu wyjątkowo niskiej wagi. Urządzenie jest przeznaczone głównie do kucia, ciężkich prac wyburzeniowych, prac związanych z montażem instalacji WOD-KAN, C.O., GAZ, wykonaniem hydroizolacji iniekcyjnych. Młot został wyposażony w uchwyt SDS-Max, elektroniczną regulację obrotów oraz duży, wygodny włącznik. Cały zestaw jest spakowany do trwałej walizki, która znacznie ułatwi transport, przechowywanie, a także zmniejszy ryzyko przypadkowego uszkodzenia elektronarzędzia wraz z wyposażeniem.', '', 'mlot-udarowo-obrotowy-celma-professional-prwg-40geo-sds-max-1600w-10j', '', '', '', 'Młot udarowo-obrotowy CELMA Professional PRWg 40GEO SDS Max 1600W 10J', '', '', '', ''),
(375, 1, 1, 'Młotowiertarka SDS-PLUS HR1840 o mocy 470 W marki Makita  Urządzenie przeznaczone jest do wiercenia udarowego w cegle, betonie i kamieniu, oraz do wiercenia w drewnie, metalu, ceramice i tworzywach sztucznych bez użycia udaru. Narzędzie daje możliwość regulacji prędkości obrotowej spustem włącznika. Młotowiertarka wyposażona jest w przycisk blokady do pracy ciągłej oraz przełącznik zmiany obrotów lewo/prawo.  Liczba udarów: 0-4800 ud/min. Siła udaru: 1,4 J. Prędkość obrotowa: 0-2100 obr/min. Maks. średnica wiercenia w stali: 13 mm Maks. średnica wiercenia w drewnie: 24 mm Maks. średnica wiercenia w betonie: 18 mm Maks. średnica wiercenia w betonie: wiertło koronowe: 35 mm Maks. średnica wiercenia w betonie: diamentowe wiertło koronowe: 65 mm  W zestawie: młotowiertarka, uchwyt boczny, ogranicznik głębokości, walizka transportowa.', '', 'makita-mlotowiertarka-sds-plus-470-w', '', '', '', 'Makita Młotowiertarka SDS-PLUS 470 W', '', '', '', ''),
(376, 1, 1, 'Zakrętarka udarowa bezszczotkowa marki Stanley FatMax  Dzięki udoskonalonej technologii akumulatorowej, brakowi efektu pamięci i minimalnemu poziomowi samoczynnego rozładowywania, litowo-jonowy akumulator V20 (do zakupienia osobno) jest gotowy do pracy, kiedykolwiek zechcesz i gdziekolwiek musisz działać, a dodatkowo zapewnia dłuższą pracę narzędzia.  Technologia bezszczotkowego silnika zapewnia lepszą sprawność i dłuższy czas pracy generowane przez mniejszy i bardziej kompaktowy silnik o mniejszych wymogach dotyczących konserwacji i wydłużonej trwałości.  Silnik o dużej mocy generujący do 2800 obr./min, 3500 uderzeń na minutę i 170 Nm momentu obrotowego do wkręcania większych elementów złącznych i innych zastosowań wymagających wysokiego momentu obrotowego.  Uchwyt szybkozaciskowy do łatwej wymiany końcówek narzędziowych jedną ręką.  Wbudowane oświetlenie robocze LED zapewnia lepszą widoczność we wszystkich warunkach pracy.  Zalecany akumulator 2,0Ah lub 4,0Ah bezprzewodowego systemu 18V STANLEY FATMAX V20 (sprzedawany oddzielnie). Część nowego systemu bezprzewodowego 18V STANLEY FATMAX V20 - zasilaj wszystkie swoje narzędzia V20 z użyciem wspólnych, nowych i udoskonalonych akumulatorów litowo-jonowych 18V, które pozwolą z łatwością poradzić sobie z każdym zadaniem.', '', 'stanley-fatmax-zakretarka-udarowa-bezszczotkowa', '', '', '', 'Stanley FatMax Zakrętarka udarowa bezszczotkowa', '', '', '', ''),
(377, 1, 1, 'Ryobi Młotowiertarka akumulatorowa R18SDS-0, 18 V  Akumulatorowa młotowiertarka R18SDS-0 z uchwytem SDS+ do szybkiego wiercenia i łatwej wymiany wierteł świetnie sprawdzi się przy pracy w kamieniu i betonie. Produkt marki Ryobi posiada 4 tryby pracy (dłutowanie, wiercenie z udarem i bez udaru, dopasowanie dłuta) oraz diodę LED do oświetlania miejsca pracy.  Brak akumulatora i ładowarki w zestawie (należy dokupić oddzielnie).  Specyfikacja techniczna  Częst. udaru: 0-5000 ud./min. Maks. zdolność wiercenia w drewnie: 16 mm Maks. zdolność wiercenia w murze: 16 mm Maks. zdolność wiercenia w stali: 13 mm Prędkość bez obciążenia: 0-1300 obr./min.', '', 'ryobi-mlotowiertarka-akumulatorowa-r18sds-0-18-v', '', '', '', 'Ryobi Młotowiertarka akumulatorowa R18SDS-0, 18 V', '', '', '', ''),
(378, 1, 1, 'Młotowiertarka udarowa V20 18V bezszczotkowa marki Stanley FatMax  Dzięki udoskonalonej technologii akumulatorowej, brakowi efektu pamięci i minimalnemu poziomowi samoczynnego rozładowywania, litowo-jonowy akumulator V20 (do zakupienia osobno) jest gotowy do pracy, kiedykolwiek zechcesz i gdziekolwiek musisz działać, a dodatkowo zapewnia dłuższą pracę narzędzia.  Technologia bezszczotkowego silnika zapewnia lepszą sprawność i dłuższy czas pracy generowane przez mniejszy i bardziej kompaktowy silnik o mniejszych wymogach dotyczących konserwacji i wydłużonej trwałości.  Urządzenie może pracować w 3 trybach (wiercenie udarowe, dłutowanie i wiercenie obrotowe), które nadają się do różnorodnych zadań.  Włącznik z regulacją prędkości pozwala na maksymalne panowanie nad wykonywaniem zadania.  Wbudowane oświetlenie robocze LED działa z 20 sekundowym opóźnieniem i zapewnia odpowiednią widoczność miejsca obróbki.  Bezkluczykowy uchwyt narzędziowy pozwala na łatwą wymianę końcówek narzędziowych.  Kompaktowa i lekka konstrukcja ze specjalnie ukształtowanym i pokrytym gumą uchwytem zwiększa komfort i bezpieczeństwo.  Moc udaru do 5500 uderzeń/min, zapewnia wydajne wiercenie w murze.  Silnik zapewnia do 1500 obr./min i 30 Nm momentu obrotowego do wydajnego wiercenia w drewnie i metalu.  Energia udaru 2,0J umożliwia wydajne wiercenie i dłutowanie w betonie i kruszywach.  Zalecany akumulator 4,0Ah bezprzewodowego systemu 18V STANLEY FATMAX V20 (sprzedawany oddzielnie). Część nowego systemu bezprzewodowego 18V STANLEY FATMAX V20 - zasilaj wszystkie swoje narzędzia V20 z użyciem wspólnych, nowych i udoskonalonych akumulatorów litowo-jonowych 18V, które pozwolą z łatwością poradzić sobie z każdym zadaniem.', '', 'stanley-fatmax-mlotowiertarka-udarowa-v20-18v-bezszczotkowa', '', '', '', 'Stanley FatMax Młotowiertarka udarowa V20 18V bezszczotkowa', '', '', '', ''),
(379, 1, 1, 'CMI Młotowiertarka 800 W Młotowiertarka CMI o mocy 800W, prędkości obrotowej 1000 obr/min i sile udaru 2,5J. To wyjątkowo trwałe i mocne urządzenie przeznaczone do ciężkich prac budowlanych pozwala na pewne wiercenie w betonie, stali i aluminium. Liczba i siła udarów gwarantują, że wiercenie nawet w najtwardszym betonie nie sprawia problemu. Funkcja kucia z włącznikiem blokady pozwala na wygodną ciągłą pracę.    Specyfikacja techniczna  Moc: 800W Prędkość obrotowa: 1000 obr/min. Siła udaru: 2,5J Uchwyt wiertarski: SDS Plus Liczba udarów: 5000 ud/min. Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 24 mm  Młotowiertarka CMI posiada regulowany uchwyt, który znacząco poprawia komfort pracy, a także ogranicznik wiercenia, który pozwoli na szybkie i dokładne osiągnięcie zamierzonej głębokości otworu. Pokrycie jękojeści miękkim materiałem w znacznym stopniu zmniejsza drgania przenoszone na przegub dłoni i zwiększa ergonomię urządzenia, co jest niezwykle istotne, zwłaszcza przy długotrwalych i zaawansowanych pracach. Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową, umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dziękijego lekkiej i kompaktowej konstrukcji.  W zestawie znajduje się młotowiertarka, walizka, osłona przeciwpyłowa, uchwyt wiertarski z wieńcem zębatym, zestaw dłut i wierteł oraz szczotki węglowe.', '', 'cmi-mlotowiertarka-800-w', '', '', '', 'CMI Młotowiertarka 800 W', '', '', '', ''),
(380, 1, 1, 'Dedra Młot udarowo-obrotowy 1200W Młot udarowo-obrotowy o mocy 1200W, sile udaru 4J oraz prędkości obrotowej 850 obr/min. Urządzenie przeznaczone jest do wiercenia udarowego w kamieniu, betonie, cegle oraz lżejszych prac związanych z dłutowaniem w materiałach budowlanych. Elektronarzędzie służy także do wiercenia w metalach (wiertłami o odpowiednich wymiarach). Produkt wyposażony jest w udar elektropneumatyczny, który może być wykorzystywany w podkuwaniu. Narzędziem można wiercić bez udaru w drewnie, ceramice i metalu zgodnie z danymi technicznymi.    Specyfikacja techniczna  Moc: 1200W Siła udaru: 4J Prędkość obrotowa: 850 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 4100 ud/min Typ udaru: elektropneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 26 mm  Charakterystyka narzędzia Do podstawowych zalet narzędzia należy system SDS Plus zapewniający szybką i łatwą wymianę wiertła, ergonomiczny kształt uchwytu gwarantujący wygodę i bezpieczeństwo obsługi, włącznik z regulacją prędkości dzięki któremu masz pewność precyzyjnego rozruchu i wiercenia z prędkości odpowiednią dla każdego materiału. Ponadto urządzenie posiada sprzęgło zabezpieczające, zapewniające ochronę na wypadek zakleszczenia się wiertła. Młot udarowo-obrotowy Dedra posiada 3 funkcje: wiercenia z udarem, wiercenie bez udaru, podkuwanie, a także funkcję odłączania udaru do zwykłych operacji wiercenia i wkręcania.  Maksymalna średnica wiercenia w stali: 13mm Maksymalna średnica wiercenia w betonie: 26mm Maksymalna średnica wiercenia w drewnie: 40mm', '', 'dedra-mlot-udarowo-obrotowy-1200w', '', '', '', 'Dedra Młot udarowo-obrotowy 1200W', '', '', '', ''),
(381, 1, 1, 'Bosch Professional Młotowiertarka akumulatorowa GBH 180-LI 18 V- solo Wyjątkowo trwałe, mocne urządzenie do ciężkich prac budowalnych Bosch o sile udaru 2J, prędkości obrotowej 1800 obr/min i uchwycie wiertarskim SDS Plus, który pozwala na szybką wymianę wiertła lub dłuta bez pomocy dodatkowych narzędzi. Wysoka prędkość obrotowa pozwala na pewne wiercenie w betonie, stali, czy aluminium. Z kolei blokada udaru umożliwia wiercenie w drewnie, stali, czy aluminium. UWAGA! Młotowiertarka sprzedawana jest bez akumulatora i ładowarki w zestawie.   Specyfikacja techniczna  Model: GBH 180-Li Napięcie akumulatora: 18V Ilość akumulatorów: 1 Pojemność akumulatora: 4,0 Ahn Rodzaj akumulatora: litowo-jonowy Siła udaru: 2,0J Prędkość obrotowa: 1800 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 5100 ud/min Maksymalna średnica wiercenia w betonie: 20mm   Silnik bezszczotkowy Wydajny mechanizm udarowy 2,0J oraz 3 tryby pracy młota zapewniają wzechstronność działania, ponato dzięki zastosowaniu silnika bezszczotkowego zauważane są mniejsze nakłady na konserwację i dłuższy czas pracy na jednym cyklu ładowania akumulatora. Silnik bezszczotkowy zapewnia również brak iskrzenia oraz mniejszą emisję ciepła podczas pracy.  Funkcja kucia Funkcja kucia umożliwia wykonywanie prac dłutujących w cegle, kamieniu i betonie, a także w dewnie (przy zastosowaniu specjalnego dłuta. System Vario-Lock Blokada Vario-Lock umożliwia zmianę ustawienia dłuta w różnych pozycjach ułatwiając kucie w miejscach trudno dostępnych. Regulowany uchwyt znacząco poprawia komfort pracy. Z kolei ogranicznik wiercenia pozwala na szybkie i dokładne osiągnięcie zamierzonej głębokości otworu.  Ergonomiczna obsługa i łatwość serwisowania Poręczna, optymalnie ukształtowana młotowiertarka zapewnia ergonomiczną obsługę dzięki niskiej wadze i kompaktowej konstrukcji. Rękojeść urządzenia powleczona jest antypoślizgowym, miękkim materiałem SOFTGRIP, co gwarantuje bezpieczeństwo pracy oraz wygodę obsługi.  Chwyt SDS Plus Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dzięki jego lekkiej i kompaktowej konstrukcji.  Pobierz kartę gwarancyjną.', '', 'bosch-professional-mlotowiertarka-akumulatorowa-gbh-180-li-18-v-solo', '', '', '', 'Bosch Professional Młotowiertarka akumulatorowa GBH 180-LI 18 V- solo', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(382, 1, 1, 'Ryobi Zakrętarka udarowa R18ID2-0, 18V  Akumulatorowa zakrętarka udarowa R18ID2-0 świetnie nadaje się do do wkręcania lub odkręcania śrub. Produkt marki Ryobi posiada mocny mechanizm udarowy i uchwyt 1/4\" (6,35 mm) z możliwością szybkiej wymiany akcesoriów.  Brak akumulatora i ładowarki w zestawie (należy dokupić oddzielnie).  Specyfikacja techniczna  Częst. udaru: 0-3600 ud./min. Maks. moment obrotowy: 200 Nm Prędkość bez obciążenia: 0-3200 obr/min. Uchwyt: 6,35 mm Liczba biegów: 1', '', 'ryobi-zakretarka-udarowa-r18id2-0-18v', '', '', '', 'Ryobi Zakrętarka udarowa R18ID2-0, 18V', '', '', '', ''),
(383, 1, 1, 'Einhell Młot udarowo-obrotowy TH-RH 1600 1600 W Młot udarowo-obrotowy Einhell o mocy 1600W, sile udaru 4J oraz prędkości obrotowej 800 obr/min. To niezawodne, wszechstronne i mocne urządzenie z dużą mocą pomaga entuzjastom majsterkowania przy pracach związanych z wierceniem, dłutowaniem i rozbiórką. Młot udarowo-obrotowy wyposażony jest w 4 funkcje potrzebne do uniwersalnego zastosowania, jakimi są wiercenie udarowe, wiercenie i dłutowanie z blokadą dłuta lub bez. Uchwyt SDS Plus umożliwia szybką wymianę wierteł i dłut bez użycia narzędzi. Urządzenie zasilane jest napięciem 220-240V.    Specyfikacja techniczna  Model: TH-RH 1600 Moc: 1600W Siła udaru: 4J Prędkość obrotowa: 800 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 3900 ud/min Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 32 mm', '', 'einhell-mlot-udarowo-obrotowy-th-rh-1600-1600-w', '', '', '', 'Einhell Młot udarowo-obrotowy TH-RH 1600 1600 W', '', '', '', ''),
(384, 1, 1, 'LUX Młot udarowy 1500W LUX Młot udarowy o mocy 1500W, sile udaru 5,5J oraz prędkości obrotowej 850 obr/min. Urządzenie przeznaczone jest do szeroko zakrojonych prac wiertniczych, udarowych i dłutowania. W zależności od materiału wydajność jest pokazana w odpowiedniej średnicy wiercenia. Maksymalna średnica wiercenia dla drewna wynosi 40mm, dla betonu 32mm, a dla stali 13mm. Dodatkowy uchwyt zapewnia wyjątkowo wysoki poziom komfortu podczas pracy, ponadto umozliwia bezpieczną i lekką pracę przy uzyciu dwóch rąk.    Specyfikacja techniczna  Moc: 1500W Siła udaru: 5,5J Prędkość obrotowa: 850 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 4200 ud/min Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 32 mm', '', 'lux-mlot-udarowy-1500w', '', '', '', 'LUX Młot udarowy 1500W', '', '', '', ''),
(385, 1, 1, 'Ryobi Młot udarowo-obrotowy RSDS680-K  Młot udarowo-obrotowy RSDS680-K z uchwytem wiertarskim SDS+ i udarem pneumatycznym świetnie nadaje się wiercenia otworów w kamieniu i betonie. Produkt marki Ryobi posiada 4 tryby (wiertarka udarowa, wiertarka obrotowa, dłuto, ustawienie dłuta) i dysponuje funkcją kucia.  Specyfikacja techniczna Maks. częstotliwość udaru: 0-5,000 ud./min. Maks. zdolność wiercenia w drewnie: 30 mm Maks. zdolność wiercenia w murze: 22 mm Maks. zdolność wiercenia w stali: 13 mm Prędkość bez obciążenia: 0-2,150 obr./min. Typ uchwytu: SDS+', '', 'ryobi-mlot-udarowo-obrotowy-rsds680-k', '', '', '', 'Ryobi Młot udarowo-obrotowy RSDS680-K', '', '', '', ''),
(386, 1, 1, 'Młot udarowo-obrotowy PRWg 26AEO marki Celma  Urządzenie służy do wiercenia w betonie i innych materiałach budowlanych, jak również do wiercenia w metalu i drewnie. Jest przydatne do takich prac jak wiercenie pod zakładanie kotew, kruszenie, żłobienie, wyrównywanie betonu. Idealnie sprawdzi się w pracach montażowych urządzeń grzewczych i sanitarnych, montażu rur, okablowania, w pracach związanych z kanalizacją, oraz innych pracach budowlanych i dekoracyjnych.  Parametry techniczne: Napięcie znamionowe: 230 V, 50 Hz Moc znamionowa: 1000 W Prędkość obrotowa bez obciążenia: 0-1100/min Maksymalna częstotliwość udarów: 4900/min Maksymalna średnica wiercenia w betonie wiertłami krętymi: 26 mm Energia udaru: 3,3 J Klasa ochrony: II System uchwytów narzędzia: SDS-Plus Kabel zasilający: 3 m', '', 'celma-mlot-udarowo-obrotowy-prwg-26aeo', '', '', '', 'Celma Młot udarowo-obrotowy PRWg 26AEO', '', '', '', ''),
(387, 1, 1, 'Graphite Młot udarowy SDS+ 900W z walizką Specjalistyczny 3-funkcyjny młot udarowy SDS+ o mocy 900W, sile udaru 4,2J i prędkości obrotowej 750 obr/min. Urządzenie jest niezastąpione podczas prac instalacyjnych i rozbiórkowych. Posiada udar pneumatyczny, możliwość wiercenia oraz funkcję podkuwania niezwykle przydatną podczas skuwania powierzchni otynkowanych bądź płytek ceramicznych.    Specyfikacja techniczna  Moc: 900W Siła udaru: 4,2J Prędkość obrotowa: 750 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 2800 ud/min Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 26 mm  Charakterystyka produktu Maksymalna energia udaru 4,2 J daje urządzeniu zdecydowaną przewagę podczas starcia z materiałami, takimi jak beton, cegła, czy kamień. Maksymalna częstotliwość udarów przy nominalnej prędkości obrotowej wynosi 2800/min, a maksymalna ilość obrotów podczas wiercenia wynosi 750/min. Mechanizm młota został wewnętrznie zabepieczony ustawionym sprzęgłem przeciążeniowym, chroniącym zarówno użytkownika, jak i urządzenie w przypadku zakleszczenia się narzędzia roboczego. Wrzeciono młoda zatrzymuje się, gdy tylko narzędzie robocze zakleszczy się.    Rękojeść główna z dwupunktowym systemem antywibracyjnym pokryta została materiałem antypoślizgowym. Obudowa przekładni urządzenia została wzmocniona stopem magnezu. Ponadto urządzenie wyposażone zostało w wygodny, dwupalcowy włącznik, kontrolkę informującą o podłączeniu do sieci oraz łatwo dostępny otwór do smarowania mechanizmu udarowego. Konieczność wymiany szczotek węglowych sygnalizowana jest przy pomocy kontrolki, umieszczonej w korpusie. Urządzenie wyposażono w elastyczny i wytrzymały przewód zasilający w powłoce gumowej o długości 4m, dedykowany także do zastosowań profesjonalnych i przemysłowych zarówno wewnątrz jak i na zewnątrz pomieszczeń.  Produkt zgodny jest z europejskimi standardami, co zapewnia certyfikat CE.    W zestawie z młotem znajdują się: wiertło, klucz montażowy, obrotowa rękojeść dodatkowa, osłona przeciwpyłowa, ogranicznik głębokości wiercenia z możliwością beznarzędziowej regulacji długości, zasobnik ze smarem oraz praktyczna walizka.', '', 'graphite-mlot-udarowy-sds-900w-z-walizka', '', '', '', 'Graphite Młot udarowy SDS+ 900W z walizką', '', '', '', ''),
(388, 1, 1, 'Einhell Młotowiertarka TE-HD 18 Li Solo Młotowiertarka akumulatorowa Einhell o napięciu akumulatora 18V (sprzedawana solo, bez akumulatora) i sile udaru 1,2J. Urządzenie marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Jest urządzeniem do wkręcania, wiercenia oraz wiercenia z udarem, niezależnym od zasilania sieciowego. Dzięki udarowi pneumatycznemu doskonale radzi sobie z twardymi podłożami. Elektroniczna kontrola prędkości pozwala dopasować obroty do potrzeb, a zamontowana praktyczna latarka LED doświetla obszar roboczy. Ergonomiczny uchwyt zapewnia wygodną i bezpieczną pracę. Uwaga! Urządzenie dostarczane jest bez akumulatora i ładowarki.    Specyfikacja techniczna  Model: 18V (bez akumulatora) Napięcie akumulatora: 18V Ilość akumulatorów: 0 Prędkość obrotowa: 1100 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 5700 ud/min Siła udaru: 1,2J Maksymalna średnica wiercenia w betonie: 12 mm  System akumulatorowy Power X-Change To ponad 200 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2Ah do 6 Ah) i różnych typów ładowarek.', '', 'einhell-mlotowiertarka-te-hd-18-li-solo', '', '', '', 'Einhell Młotowiertarka TE-HD 18 Li Solo', '', '', '', ''),
(389, 1, 1, 'Einhell Młot udarowo-obrotowy TH-RH 800E 800 W Młot udarowo-obrotowy Einhell o mocy 800W, sile udaru 2,5J oraz prędkości obrotowej 1000 obr/min. To niezawodne urządzenie służy do wiercenia, wiercenia udarowego, a także kucia z obrotem lub bez. blokada pracy ciągłej oraz elektroniczna regulacja prędkości zapewniają, że młot z pneumatycznym udarem można dostosować do wymagań każdego konkretnego materiału. Urządzenie zasilane jest napięciem 220-240V.    Specyfikacja techniczna  Model: TH-RH 800E Moc: 800W Siła udaru: 2,5J Prędkość obrotowa: 1000 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 51800 ud/min Typ udaru: elektropneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 26mm  Elektronarzędzie posiada zintegrowany przełącznik pozycyjny dla wszystkich funkcji i wyłącznik bezpieczeństwa przed przeciążeniem. Do nieskomplikowanej wymiany narzędzi dostępny jest solidny uchwyt narzędziowy SDS Plus z półautomatyczną funkcją. Młot udarowy jest dostarczany w wygodnej walizce transportowej.', '', 'einhell-mlot-udarowo-obrotowy-th-rh-800e-800-w', '', '', '', 'Einhell Młot udarowo-obrotowy TH-RH 800E 800 W', '', '', '', ''),
(390, 1, 1, 'CMI Klucz udarowy 900 W Lekki, elektryczny klucz udarowy CMI o mocy 900W, prędkości obrotowej 2200 obr/min i maksymalnym momencie obrotowym 100Nm. Kupując klucz udarowy otrzymujesz w zestawie 4 końcówki śrubowe: 17 mm, 19 mm, 21 mm oraz 22 mm. Z produktem producenta CMI przykręcanie i odkręcanie nawet mocno zapieczonych śrub nie sprawi nikomu problemu.    Specyfikacja techniczna  Moc: 900W Prędkość obrotowa: 2200 obr/min Maksymalny moment obrotowy: 100Nm Liczba biegów: 1 .', '', 'cmi-klucz-udarowy-900-w', '', '', '', 'CMI Klucz udarowy 900 W', '', '', '', ''),
(391, 1, 1, 'Młot wyburzeniowy TE-DH 32 firmy Einhell przykłada do dłuta moc 1500 W, dzięki czemu osiąga wysoką moc wyburzania wynoszącą 32 dżule indywidualnej siły uderzenia.  Młot wyburzeniowy sprawdza się w trudnych warunkach - przy wyburzaniu i rozbiórce uciążliwych materiałów: kamienia, betonu lub cegły.  Młot wyburzeniowy to produkt zaprojektowany z myślą o trwałości w trudnych warunkach pracy ciągłej: wytrzymały uchwyt narzędziowy SDS-max zapewnia szybką i łatwą wymianę narzędzi. Gumowy kabel o długości 4 m zapewnia najwyższą możliwą mobilność. Wytrzymałość użytkownika jest chroniona dzięki niskiemu poziomowi wibracji podczas pracy z użyciem tłumiącego drgania uchwytu głównego. Ponadto wkładki z miękkim uchwytem tłumią drgania w dodatkowym uchwycie regulowanym w zakresie 180° w pionie / 360° w poziomie. Szczotki węglowe wyłączają się automatycznie i zapobiegają wadliwemu działaniu narzędzia w przypadku przeciążenia.  Młot wyburzeniowy zawiera spiczaste i płaskie dłuto.', '', 'einhell-mlot-wyburzeniowy-te-dh-32', '', '', '', 'Einhell Młot wyburzeniowy TE-DH 32', '', '', '', ''),
(392, 1, 1, 'Dedra Młot wyburzeniowy 1600 W Młot wyburzeniowy Dedra o mocy 1600W, sile udaru 45J i liczbie udarów 2000 ud/min. Wysokiej jakości narzędzie, które świetnie sprawdzi się podczas kucia i dłutowania, a także przy pracach budowalnych, renowacyjnych i remontowych. Dodatkowy uchwyt pokryty gumową okładziną w znacznym stopniu zmniejsza drgania przenoszone na przegub dłoni zwiększając komfort pracy. W komplecie znajduje się dłuto punktowe 30x410mm, klucz oraz metalowa walizka. Duża moc pozwala na pracę przy dużym obciążeniu i w trudnych warunkachm a bardzo wysoka energia udaru na kucie w najtwardzszych materiałach.    Specyfikacja techniczna  Moc: 1600W Siła udaru: 45J Liczba udarów: 2000 ud/min. Uchwyt wiertarski: SDS Hex Funkcja kucia: tak', '', 'dedra-mlot-wyburzeniowy-1600-w', '', '', '', 'Dedra Młot wyburzeniowy 1600 W', '', '', '', ''),
(393, 1, 1, 'CMI Młot wyburzeniowy 1700 W Młot wyburzeniowy CMI o mocy 1700W, sile udaru 45J i liczbie udarów 1800 ud/min. Wysokiej jakości narzędzie, które świetnie sprawdzi się podczas kucia i dłutowania, a także przy pracach budowalnych, renowacyjnych i remontowych. Dodatkowy uchwyt pokryty gumową okładziną w znacznym stopniu zmniejsza drgania przenoszone na przegub dłoni zwiększając komfort pracy. W komplecie znajduje się dłuto punktowe, przecinak oraz zestaw kluczy. Duża moc pozwala na pracę przy dużym obciążeniu i w trudnych warunkachm a bardzo wysoka energia udaru na kucie w najtwardzszych materiałach.    Specyfikacja techniczna  Moc: 1700W Siła udaru: 45J Liczba udarów: 1800 ud/min. Uchwyt wiertarski: SDS Hex 30mm Funkcja kucia: tak', '', 'cmi-mlot-wyburzeniowy-1700-w', '', '', '', 'CMI Młot wyburzeniowy 1700 W', '', '', '', ''),
(394, 1, 1, 'Graphite Młotowiertarka SDS+ 900W z walizką Młotowiertarka Graphite o mocy 900W, prędkości obrotowej 900 obr/min i sile udaru 3,4J. Czterofunkcyjna młotowiertarka z uchwytem SDS Plus posiada funkcje wiercenia z udarem, wiercenia bez udaru, podkuwania oraz możliwość bezstopniowej regulacji kąta ustawienia dłuta do precyzyjnego podkuwania. Duża moc pozwala młotowiertarce na wiercenie otworów do 30mm średnicy w betonie i cegle, 30mm w drewnie i 13mm w stali. Ponadto młotowiertarka posiada możliwość zmiany kierunku obrotu wrzeciona, możliwość stopniowej regulacji prędkości oraz funkcję blokady włącznika do ciągłej pracy.    Specyfikacja techniczna  Moc: 900W Prędkość obrotowa: 900 obr/min. Siła udaru: 3,4J Uchwyt wiertarski: SDS Plus Liczba udarów: 5000 ud/min. Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 30 mm  Podczas wiercenia urządzenie może osiągnąć do 900 obrotów w ciągu minuty, po przełączeniu na udar do 5000 uderzeń na minutę. Energia udaru 3.4J pozwoli młotowiertarce rozprawić się z najbardziej oporną ścianą. W zestawie znajduje się dodatkowe wiertło, uchwyt wiertarski, adapter do uchwytu i wygodna walizka transportowa. Elektronarzędzia, ładowarki oraz akumulatory są objętą 3-letnią gwarancją nie wymagającą rejestracji.  Zgodność z europejskimi standardami zapewnia certyfikat CE.', '', 'graphite-mlotowiertarka-sds-900w-z-walizka', '', '', '', 'Graphite Młotowiertarka SDS+ 900W z walizką', '', '', '', ''),
(395, 1, 1, 'Bosch Professional Młot udarowo-obrotowy GBH 2-28 F 880 W Wyjątkowo trwałe, mocne urządzenie do wszelkich prac budowlanych, renowacyjnych i remontowych Bosch o mocy 880W, sile udaru 3,2J, prędkości obrotowej 900 obr/min i uchwycie wiertarskim SDS Plus, stosowany w młotach udarowo-obrotowych klasy 2-4kg. Urządzenie pozwala na pewne wiercenie w betonie, stali i drewnie.   Specyfikacja techniczna  Model: GBH 2-28 F Moc: 880W Siła udaru: 3,2J Prędkość obrotowa: 900 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 4000 ud/min Typ udaru: pneumatyczny Funkcja kucia: tak Maksymalna średnica wiercenia w betonie: 28mm  Najwyższa wydajność oraz inteligentna funkcja KickBack Control Narzędzie GBH 2-28F Professional zapewnia najszybsze tempo wiercenia i najwyższą wydajność dłutowania w tej klasie urządzeń. Ponadto zapewnia o 25% dłuższą żwytowność niż w przypadku innych młotów udarowo-obrotowych tej klasy i większą ekonomiczność, a także o 27% niższy poziom drgań niż w poprzednim modelu dzięki aktywnemu systemowi tłumienia drgań.  Funkcja regulacji prędkości Młotowiertarka Bosch posiada funkcję regulacji prędkości, co pozwala na łatwą i precyzyjną kontrolę prędkości obrotowej.  Vibration Control Komfortową pracę z urządzeniem zapewnia niski poziom drgań wskutek dodatkowej gumowej/piankowej izolacji rękojeści.  Funkcja dłutowania i sprzęgło przeciążeniowe Młot uniwersalny z funkcją dłutowania. Urządzenie umożliwia prace dłutujące w cegle, kamieniu i betonie. Z kolei sprzęgło przeciążeniowe chroni użytkownika w przypadkiu zablokowania się wiertła.  Chwyt SDS Plus Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dzięki jego lekkiej i kompaktowej konstrukcji.  Zmiana obrotów lewo/prawo zmiana obrotów lewo/prawo do wkręcania i wykręcania śrub i wkrętów z systemem kompensacji mocy, dzięki któremu prędkośc obrotowa jest identyczna.  Walizka z tworzywa sztucznego W zestawie z młotowiertarką znajduje sie walizka wykonana z tworzywa sztucznego gwarantująca bezpieczny transport, a także przechowywanie urządzenia. Walizka odporna jest na uszkodzenia mechaniczne, ponadto posiada wyprofilowane miejsca na sprzęt dodatkowy (nie występujący w zestawie). Tym samym masz pewność, że żaden z elementów wyposażenia nie przemieści się w trakcie transportu.    Wyposażenie W zestawie znajduje się młot udarowo-obrotowy o mocy 880W, walizka wykonana z tworzywa sztucznego, uchwyt wymienny, 3 wiertła do betonu o średnicy 6mm, 8mm, 10mm oraz dłuto.  Maksymalna średnica wiercenia Młotowiertarka zapewnia wiercenie w drewnie, betonie, stali oraz betonie koronkami. Ich maksymalna średnica wiercenia podana jest poniżej.  Maks. średnica wiercenia w stali: 13mm Maks. średnica wiercenia w drewnie: 30mm Maks. średnica wiercenia w betonie: 28mm Maks. średnica wiercenia w betonie koronkami: 68mm  Najważniejsze cechy urządzenia Do najważniejszych cerz młotu udarowo-obrotowego należą:  - blokada obrotów do dłutowania -obrotowy szczotkotrzymacz (taka sama moc przy obrotach w prawo/lewo) -sprzęgło przeciążeniowe chroniące użytkownika i urządzenia -płynna regulacja prędkości obrotowej umożliwiająca czyste nawiercanie -najszybsze tempo wiercenia i najwyższą wydajnośc dłutowania w tej klasie urządzeń  Pobierz kartę gwarancyjną.', '', 'bosch-professional-mlot-udarowo-obrotowy-gbh-2-28-f-880-w', '', '', '', 'Bosch Professional Młot udarowo-obrotowy GBH 2-28 F 880 W', '', '', '', ''),
(396, 1, 1, 'Einhell Zakrętarka udarowa TE-CI 18/1 Li Solo Zakrętarka udarowa o napięciu akumulatora 18V i prędkości obrotowej 0-2300 obr/min. Urządzenie marki Einhell należy do bogatej rodziny narzędzi akumulatorowych w systemie Power X-Change przeznaczonych do domu i ogrodu. Produkt zapewnia wystarczającą moc aby poluzować nawet zakleszczone nakrętki kół. Aluminiowa obudowa i gumowe podkładki chronią urzędzenie . Ponadto Zakrętarka udarowa została wyposażona w solidny uchwyt mocujący nasadki 1/4\" (6,3 mm). Uwaga! Urządzenie dostarczane jest bez akumulatora i ładowarki.    Specyfikacja techniczna  Model: TE-CI 18/1 Li Solo 18V (bez akumulatora) Napięcie akumulatora: 18V &gt;Prędkość obrotowa: 0-2300 obr/min Liczba biegów: 1 Maksymalny moment obrotowy: 140Nm  System akumulatorowy Power X-Change To ponad 200 urządzeń pracujących na jednym typie akumulatora. Posiadając akumulator można dokupić pozostałe urządzenia w wersji SOLO - bez akumulatora i ładowarki. Dodatkowo istnieje możliwość dokupienia akumulatorów o różnej pojemności (od 2Ah do 6 Ah) i różnych typów ładowarek. W akumulatorach zastosowano najlepsze komponenty, jak wysokowydajne ogniwa litowo-jonowe i inteligentna elektronika akumulatorów sterowana procesorem Active Battery Manegment. Zapewniają one bezpieczeństwo, wydajność i niezawodność.', '', 'einhell-zakretarka-udarowa-te-ci-18-1-li-solo', '', '', '', 'Einhell Zakrętarka udarowa TE-CI 18/1 Li Solo', '', '', '', ''),
(397, 1, 1, 'Bosch Młotowiertarka PBH 2000, 550 W Wyjątkowo trwałe, mocne urządzenie do ciężkich prac budowalnych Bosch o mocy 550W, sile udaru 1,7J, prędkości obrotowej 0-2300 obr/min i chwycie SDS Plus, który pozwala na szybką wymianę wiertła lub dłuta bez pomocy dodatkowych narzędzi. Wysoka prędkość obrotowa pozwala na pewne wiercenie w betonie, stali, czy aluminium. Z kolei blokada udaru umożliwia wiercenie w drewnie, stali, czy aluminium.   Specyfikacja techniczna  Model: PBH 2000 RE Moc: 550W Siła udaru: 1,7J Prędkość obrotowa: 0-2300 obr/min Uchwyt wiertarski: SDS Plus Liczba udarów: 5800 ud/min Typ udaru: pneumatyczny Funkcja kucia: tak Max. średnica wiercenia w betonie: 20mm 4 tryby pracy Przełącznik w młotowiertarce Bosch PBH 2000 z wyborem trybu wkręcania, wiercenia, wiercenia udarowego i kucia daje możliwość szybkiego i sprawnego dostosowania urządzenia do charakteru pracy. Funkcja kucia z włącznikiem blokady pozwalającym na wygodną, ciągłą pracę umożliwia wykonuwanie prac dłutujących w kamieniu, cegle i betonie.  System Vario-Lock Blokada Vario-Lock umożliwia zmianę ustawienia dłuta w różnych pozycjach ułatwiając kucie w miejscach trudno dostępnych. Regulowany uchwyt znacząco poprawia komfort pracy. Z kolei ogranicznik wiercenia pozwala na szybkie i dokładne osiągnięcie zamierzonej głębokości otworu.  Ergonomiczna obsługa i łatwość serwisowania Poręczna, optymalnie ukształtowana młotowiertarka zapewnia ergonomiczną obsługę dzięki niskiej wadze i kompaktowej konstrukcji. Rękojeść urządzenia powleczona jest antypoślizgowym, miękkim materiałem SOFTGRIP, co gwarantuje bezpieczeństwo pracy oraz wygodę obsługi.  Chwyt SDS Plus Zastosowanie specjalnego chwytu SDS Plus z osłoną przeciwpyłową umożliwia beznarzędziową i szybką wymianę wierteł i dłut. Komfort obsługi tego urządzenia zapewniony jest dzięki jego lekkiej i kompaktowej konstrukcji.  Pobierz kartę gwarancyjną.', '', 'bosch-mlotowiertarka-pbh-2000-550-w', '', '', '', 'Bosch Młotowiertarka PBH 2000, 550 W', '', '', '', ''),
(398, 1, 1, 'Zestaw marki Dedra składający się z zakrętarki udarowej 18V, akumulatora 2.0Ah 18V Li-Ion i ładowarki 60W  Zakrętarka udarowa idealnie sprawdzi się w pracach remontowo-budowlanych, warsztatach naprawczych, jak i w pracach amatorskich przy wkręcaniu i wykręcaniu nakrętek i śrub.  Odpowiednia moc i duży moment dokręcania pozwalają na używanie zakrętarki przy budowie regałów i rusztowań, a także wielu innych pracach warsztatowych i przemysłowych. Zastosowanie udaru pozwala na wkręcanie i wykręcanie długich śrub w różnych materiałach.  Dane techniczne: Napięcie pracy: 18 V d.c. Akumulator: Li-ion Uchwyt końcówki roboczej: 1/ 4\" Prędkość obrotowa n0: 0-2600 min-1 Max. moment obrotowy: 110 Nm Oświetlenie robocze: LED Waga urządzenia (bez akumulatora): 1,5 kg  Pełen zestaw startowy wraz z akumulatorem litowo-jonowym o pojemności 2.0 Ah oraz ładowarką to natychmiastowa gotowość do pracy.', '', 'dedra-zakretarka-udarowa-z-akumulatorem-i-ladowarka', '', '', '', 'Dedra Zakrętarka udarowa z akumulatorem i ładowarką', '', '', '', ''),
(399, 1, 1, 'Narzędzie wielofunkcyjne 3000-15 marki Dremel. Jest to mocne, precyzyjne urządzenie z wydajnym silnikiem o mocy 130 W. Urządzenie doskonale nadaje się do różnego rodzaju precyzyjnych prac, takich jak: cięcie, grawerowanie, ścieranie itp. Posiada wiele innowacyjnych funkcji, takich jak: blokadę wrzeciona - zabezpieczającą przed zablokowaniem wałka oraz regulację prędkości obrotowej - zapewniającą lepszą sterowalność i kontrolę narzędzia. W celu zwiększenia wygody i komfortu pracy, Dremel wyposażony został w specjalną nakrętkę EZ Twist, dzięki której przy przykręcaniu i odkręcaniu tulei zaciskowej podczas wymiany akcesoriów nie ma potrzeby używania klucza, ponieważ mechanizm dokręcający zintegrowany jest z nakrętką. W skład zestawu oprócz narzędzia, wchodzi 15-elementowy komplet akcesoriów do cięcia, szlifowania, frezowania i ścierania.', '', 'dremel-narzedzie-wielofunkcyjne-3000-15-130-w', '', '', '', 'Dremel Narzędzie wielofunkcyjne 3000-15 130 W', '', '', '', ''),
(400, 1, 1, 'Zestaw mini narzędzi Ellix, 100-częściowy. Przeznaczony dla początkujących majsterkowiczów do prowadzenia niewielkich, prostych prac. W skład zestawu wchodzą narzędzia do cięcia, szlifowania, frezowania i polerowania. Wszystkie elementy spakowane są w praktyczną skrzynkę z drewna.', '', 'ellix-zestaw-mini-narzedzi-100-czesciowy', '', '', '', 'Ellix Zestaw mini narzędzi 100-częściowy', '', '', '', ''),
(401, 1, 1, 'Specjalistyczne narzędzie umożliwiającej wysokowydajną obróbkę różnych materiałów. Przeznaczone do precyzyjnych prac ręcznych z użyciem wielofunkcyjnej multiszlifierki. Umożliwia pracę w takich materiałach jak: cegła, drewno, ceramika, tworzywo sztuczne. Trzpień 3,2 mm pozwala na mocowanie w większości multiszlifierek.', '', 'frez-uniwersalny-32-mm-2-szt', '', '', '', 'Frez uniwersalny 3,2 mm - 2 szt', '', '', '', ''),
(402, 1, 1, 'Tuleja zaciskowa 3,2 mm, LUX-TOOLS. Aluminiowa tuleja zaciskowa służy do mocowania narzędzi do prac precyzyjnych. Gwarantuje pewne, centryczne i stabilne mocowanie.', '', 'lux-tuleja-zaciskowa-aluminiowa-32-mm', '', '', '', 'LUX Tuleja zaciskowa aluminiowa 3,2 mm', '', '', '', ''),
(403, 1, 1, 'Frez okrągły HSS, 9,5 mm, LUX-TOOLS. Specjalistyczne narzędzie z mocnej stali szybkotnącej, umożliwiającej wysokowydajną obróbkę metali. Przeznaczone do precyzyjnego frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz. Trzpień 3,2 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-hss-okragly-95-mm', '', '', '', 'LUX Frez HSS okrągły 9,5 mm', '', '', '', ''),
(404, 1, 1, 'Frez grawerski diamentowy, cylindryczny, 2,3 mm, LUX-TOOLS. Specjalistyczne narzędzie z mocnej stali szybkotnącej, o ostrzach z pokryciem diamentowym, umożliwiającym wysokowydajną obróbkę metali. Przeznaczone do precyzyjnego grawerowania oraz do frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz, srebro, złoto, platyna. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-diamentowy-cylindryczny-23-mm', '', '', '', 'LUX Frez diamentowy cylindryczny 2,3 mm', '', '', '', ''),
(405, 1, 1, 'Tuleja zaciskowa 3,2 mm, LUX-TOOLS. Stalowa tuleja zaciskowa służy do mocowania narzędzi do prac precyzyjnych. Gwarantuje pewne, centryczne i stabilne mocowanie.', '', 'lux-tuleja-zaciskowa-stalowa-32-mm', '', '', '', 'LUX Tuleja zaciskowa stalowa 3,2 mm', '', '', '', ''),
(406, 1, 1, 'Frez grawerski diamentowy, owalny, 1,8 mm, LUX-TOOLS. Specjalistyczne narzędzie z mocnej stali szybkotnącej, o szlifowanych ostrzach z pokryciem diamentowym, umożliwiającym wysokowydajną obróbkę metali. Przeznaczone do precyzyjnego grawerowania oraz do frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz, srebro, złoto, platyna. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-diamentowy-w-ksztalcie-pocisku-18-mm', '', '', '', 'LUX Frez diamentowy w kształcie pocisku 1,8 mm', '', '', '', ''),
(407, 1, 1, 'Frez cylindryczny HM, 2,3 mm, LUX-TOOLS. Narzędzie z hartowanej stali o ostrzach z węglików spiekanych, przeznaczone do obróbki profili w hartowanej stali, stali szlachetnej, mosiądzu, miedzi, drewnie, aluminium i w tworzywach sztucznych.', '', 'lux-frez-hm-w-ksztalcie-cylindra-23-mm', '', '', '', 'LUX Frez HM w kształcie cylindra 2,3 mm', '', '', '', ''),
(408, 1, 1, 'Frez grawerski diamentowy, kulisty, 1,8 mm, LUX-TOOLS. Specjalistyczne narzędzie z mocnej stali szybkotnącej, o ostrzach z pokryciem diamentowym, umożliwiającym wysokowydajną obróbkę metali. Przeznaczone do precyzyjnego grawerowania oraz do frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz, srebro, złoto, platyna. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-diamentowy-w-ksztalcie-kuli-18-mm', '', '', '', 'LUX Frez diamentowy w kształcie kuli 1,8 mm', '', '', '', ''),
(409, 1, 1, 'Uchwyt narzędziowy śrubowy, 2,35 mm, LUX-TOOLS. Służy do przytwierdzania wielu narzędzi do cięcia, szlifowania i polerowania. Gwarantuje pewne i stabilne mocowanie.', '', 'lux-uchwyt-narzedziowy-235-mm', '', '', '', 'LUX Uchwyt narzędziowy 2,35 mm', '', '', '', ''),
(410, 1, 1, 'Ściernica trzpieniowa stożkowa, 5 mm, LUX-TOOLS. Korundowa głowica ścierna o średnicy 5 mm, do mocowania we wszystkich rodzajach wiertarek. Przeznaczona jest do szlifowania mosiądzu, miedzi i stali szlachetnej.', '', 'lux-sciernica-trzpieniowa-stozkowa-5-mm', '', '', '', 'LUX Ściernica trzpieniowa stożkowa 5 mm', '', '', '', ''),
(411, 1, 1, 'Specjalistyczne narzędzie umożliwiającej wysokowydajną obróbkę różnych materiałów. Przeznaczone do precyzyjnych prac ręcznych z użyciem wielofunkcyjnej multiszlifierki. Umożliwia pracę w takich materiałach jak: aluminium, miedź, mosiądz. Trzpień 3,2 mm pozwala na mocowanie w większości multiszlifierek.', '', 'szczotka-mosiezna-19-mm-2-szt', '', '', '', 'Szczotka mosiężna 19 mm - 2 szt', '', '', '', ''),
