(437, 1, 1, '180-częściowy zestaw mini narzędzi to idealny zestaw dla początkujących do miniaturowych obszarów, w których precyzyjne prace są na pierwszym planie. W zestawie wiele narzędzi z zakresu szlifowania, frezowania, polerowania oraz wiercenia.', '', 'zestaw-akcesoriow-do-multiszlifierek-180-szt', '', '', '', 'Zestaw akcesoriów do multiszlifierek - 180 szt', '', '', '', ''),
(438, 1, 1, 'Narzędzie do grawerowania Engraver 290-1 Dremel przeznaczone jest do grawerowania na różnych materiałach, takich jak: metal, szkło, drewno, plastik, ceramika itd. Ruch posuwisto-zwrotny zapewnia pełną kontrolę podczas grawerowania, natomiast regulowana głębokość posuwu umożliwia uzyskanie różnych efektów grawerowania. Wymienne karbidowe dłuto oraz węglikowa końcówka umożliwiają grawerowanie na różnych powierzchniach. Zestaw zawiera także szablon liter i cyfr, służący do ich łatwego odwzorowania.', '', 'dremel-narzedzie-do-grawerowania-engraver-290-1-35-w', '', '', '', 'Dremel Narzędzie do grawerowania Engraver 290-1 35 W', '', '', '', ''),
(439, 1, 1, 'Akcesoria do miniwiertarki VERTO zestaw 100 szt. zawiera komplet wierteł, tarcz tnących, ściernych, frezów i kamieni szlifierskich do stosowania z miniszlifierkami. Wygodne pudełko pozwala łatwo przechowywać wszystkie elementy zestawu. Marka VERTO oferuje asortyment elektronarzędzi i akcesoriów dla każdego majsterkowicza.', '', 'verto-akcesoria-do-miniwiertarki-zestaw-100-szt', '', '', '', 'Verto Akcesoria do miniwiertarki, zestaw 100 szt.', '', '', '', ''),
(440, 1, 1, 'Frez grawerski w kształcie kropli HSS, 7,8 mm, LUX-TOOLS. Specjalistyczne narzędzie z mocnej stali szybkotnącej, umożliwiającej wysokowydajną obróbkę metali. Przeznaczone do precyzyjnego grawerowania oraz do frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz, srebro, złoto, platyna. Trzpień 3,2 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-hss-w-ksztalcie-kropli-78-mm-do-multiszlifierek', '', '', '', 'LUX Frez HSS w kształcie kropli 7,8 mm do multiszlifierek', '', '', '', ''),
(441, 1, 1, 'Wiertło uniwersalne, precyzyjne, 1,2 mm, LUX-TOOLS, 3 sztuki. Specjalistyczne mini wiertło z mocnej stali szybkotnącej, umożliwiające wysokowydajną obróbkę metali. Sposób wykonania wiertła gwarantuje uzyskanie wysokiej dokładności i prostolinijności wierconych otworów. Przeznaczone jest do wiercenia w aluminium, mosiądzu, miedzi, drewnie, a także w pleksiglasie oraz w innych tworzywach sztucznych. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-wiertlo-mikro-12-mm-do-multiszlifierek-3-sztuki', '', '', '', 'LUX Wiertło mikro 1,2 mm do multiszlifierek 3 sztuki', '', '', '', ''),
