(443, 1, 1, 'Ściernica trzpieniowa do ostrzenia łańcucha piły, 4,8 mm, LUX-TOOLS, 2 sztuki. Walec ścierny do szlifowania precyzyjnego. Pozwala na szybkie i dokładne ostrzenie zębów tnących w piłach łańcuchowych. Zapewnia dużą dokładność i niski poziom emisji pyłu. Profesjonalna jakość gwarantuje niskie zużycie i tym samym wysoką trwałość ściernicy.', '', 'lux-sciernica-trzpieniowa-do-ostrzenia-lancucha-pily-48-mm-2-szt', '', '', '', 'LUX Ściernica trzpieniowa do ostrzenia łańcucha piły 4,8 mm 2 szt.', '', '', '', ''),
