(450, 1, 1, 'Szczotka druciana pędzelkowa 4,8 mm, z trzpieniem cylindrycznym, LUX-TOOLS. Służy do usuwania zadziorów i rdzy z metalu oraz do czyszczenia i wygładzania drewna i materiałów drewnopochodnych, tworzyw sztucznych oraz kamienia. Do mocowania we wszystkich typach urządzeń z uchwytem o średnicy 6 mm.', '', 'lux-szczotka-pedzelkowa-48-mm-do-multiszlifierek', '', '', '', 'LUX Szczotka pędzelkowa 4,8 mm do multiszlifierek', '', '', '', ''),
