(463, 1, 1, 'Frez grawerski okrągły 0,8 mm, LUX-TOOLS. Specjalistyczne narzędzie z hartowanej stali o ostrzach z węglików spiekanych, przeznaczone do precyzyjnego grawerowania oraz do frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz, srebro, złoto, platyna. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-do-grawerowania-w-ksztalcie-kuli-08-mm-do-multiszlifierek', '', '', '', 'LUX Frez do grawerowania w kształcie kuli 0,8 mm do multiszlifierek', '', '', '', ''),
(464, 1, 1, 'Frez grawerski cylindryczny HSS, 2 mm, LUX-TOOLS. Specjalistyczne narzędzie z mocnej stali szybkotnącej, umożliwiającej wysokowydajną obróbkę metali. Przeznaczone do precyzyjnego grawerowania oraz do frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz, srebro, złoto, platyna. Trzpień 3,2 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-hss-cylindryczny-2-mm-do-multiszlifierek', '', '', '', 'LUX Frez HSS cylindryczny 2 mm do multiszlifierek', '', '', '', ''),
(465, 1, 1, 'Specjalistyczne narzędzie umożliwiającej wysokowydajną obróbkę różnych materiałów. Przeznaczone do precyzyjnych prac ręcznych z użyciem wielofunkcyjnej multiszlifierki. Umożliwia pracę w takich materiałach jak: drewno, płyty drewnopochodne, tworzywa sztuczne.', '', 'brzeszczot-do-drewna-standardowy-moto-saw-100-mm', '', '', '', 'Brzeszczot do drewna standardowy Moto-Saw 100 mm', '', '', '', ''),
(466, 1, 1, 'Wiertło diamentowe, precyzyjne, 1 mm, LUX-TOOLS. Specjalistyczne mini wiertło z mocnej stali szybkotnącej, o ostrzach z pokryciem diamentowym, umożliwiające wysokowydajną obróbkę metali. Sposób wykonania wiertła gwarantuje uzyskanie wysokiej dokładności i prostolinijności wierconych otworów. Przeznaczone jest do wiercenia w kamieniach półszlachetnych i szlachetnych. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-wiertlo-diamentowe-1-mm-do-multiszlifierek', '', '', '', 'LUX Wiertło diamentowe 1 mm do multiszlifierek', '', '', '', ''),
(467, 1, 1, 'Wiertło diamentowe, precyzyjne, 1,2 mm, LUX-TOOLS. Specjalistyczne mini wiertło z mocnej stali szybkotnącej, o ostrzach z pokryciem diamentowym, umożliwiające wysokowydajną obróbkę metali. Sposób wykonania wiertła gwarantuje uzyskanie wysokiej dokładności i prostolinijności wierconych otworów. Przeznaczone jest do wiercenia w kamieniach półszlachetnych i szlachetnych. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-wiertlo-diamentowe-12-mm-do-multiszlifierek', '', '', '', 'LUX Wiertło diamentowe 1,2 mm do multiszlifierek', '', '', '', ''),
(468, 1, 1, 'Wiertło diamentowe, precyzyjne, 0,8 mm, LUX-TOOLS. Specjalistyczne mini wiertło z mocnej stali szybkotnącej, o ostrzach z pokryciem diamentowym, umożliwiające wysokowydajną obróbkę metali. Sposób wykonania wiertła gwarantuje uzyskanie wysokiej dokładności i prostolinijności wierconych otworów. Przeznaczone jest do wiercenia w kamieniach półszlachetnych i szlachetnych. Trzpień 2,35 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-wiertlo-diamentowe-08-mm-do-multiszlifierek', '', '', '', 'LUX Wiertło diamentowe 0,8 mm do multiszlifierek', '', '', '', ''),
(469, 1, 1, 'Frez stożkowy HSS, 6,4 mm, LUX-TOOLS. Specjalistyczne narzędzie z mocnej stali szybkotnącej, umożliwiającej wysokowydajną obróbkę metali. Przeznaczone do precyzyjnego frezowania i fazowania krawędzi. Umożliwia pracę w takich materiałach jak: tworzywa mineralne, syntetyczne, szklano-epoksydowe, drewno (MDF), aluminium, miedź, mosiądz. Trzpień 3,2 mm pozwala na mocowanie w większości multiszlifierek.', '', 'lux-frez-hss-stozkowy-64-mm', '', '', '', 'LUX Frez HSS stożkowy 6,4 mm', '', '', '', ''),
(470, 1, 1, 'Specjalistyczne narzędzie umożliwiającej wysokowydajną obróbkę różnych materiałów. Przeznaczone do precyzyjnych prac ręcznych z użyciem wielofunkcyjnej multiszlifierki. Umożliwia pracę w takich materiałach jak: aluminium, drewno, srebro, złoto. Zastosowano praktyczny trzpień EZ SpeedClic do szybkiej wymiany akcesoriów.', '', 'trzpien-i-tasmy-ez-speedclic-k60-120-13-mm', '', '', '', 'Trzpień i taśmy EZ SpeedClic K60/120 13 mm', '', '', '', ''),
(471, 1, 1, 'Szczotko-skrobaczka marki Carcommerce to praktyczne narzędzie 2 w 1. Zestaw zawiera szczotkę oraz skrobaczkę. Skrobaczka może służyć do usuwania lodu oraz szronu z szyb samochodu, natomiast szczotka do usuwania śniegu z samochodu. Długość szczotko-skrobaczki to 60 cm, co pozwala na swobodne usuwanie zalegającego na dachu samochodu śniegu. Produkt występuje w miksie kolorystycznym, wskazany zapas sklepu dotyczy wszystkich możliwości kolorystycznych produktu. Zachęcamy do kontaktu z wybranym sklepem w celu ustalenia dostępności konkretnego wariantu.', '', 'szczotko-skrobaczka-z-miekka-raczka', '', '', '', 'Szczotko-skrobaczka z miękką rączką', '', '', '', ''),
(472, 1, 1, 'Płyn do chłodnic Prochem zgodny z wymogami normy G12/G12+ może być stosowany do wszystkich typów układów chłodzących: aluminiowych, żeliwnych i mieszanych. Doskonale zabezpiecza układ chłodzenia silnika przed korozją i kawitacją. Płyn chroni również niemetalowe elementy układu przed szarzeniem.  Produkt jest przyjazny dla środowiska - nie zawiera trujących azotynów, amin i fosforanów.  Latem temperatura wrzenia płynu wynosząca 110°C zapewni sprawne działanie układu chłodzenia i ochronę silnika przed przegrzaniem. Zimą temperatura zamarzania wynosząca -35°C gwarantuje skuteczną ochronę układu przed mrozem.', '', 'prochem-plyn-chlodniczy-rozowy-5l', '', '', '', 'Prochem Płyn chłodniczy różowy 5L', '', '', '', ''),
(473, 1, 1, 'Zmiotka plastikowa z dużą ilością rozdrobnionego włosia, poręczna i ergonomiczna. Idealna o każdej porze roku i do wielu czynności. Produkt Polski. Produkt występuje w mixie kolorystycznym, wskazany zapas sklepu dotyczy wszystkich możliwości kolorystycznych produktu. Zachęcamy do kontaktu z wybranym sklepem w celu ustalenia dostępności konkretnego wariantu kolorystycznego.', '', 'intertec-zmiotka-plastikowa', '', '', '', 'Intertec Zmiotka plastikowa', '', '', '', ''),
(474, 1, 1, 'Neutralizator zapachu 250 ml  Neutralizator zapachu w sprayu o pojemności 250 ml. Pozostawia aromat zielonej herbaty.', '', 'neutralizator-zapachu-250-ml', '', '', '', 'Neutralizator zapachu 250 ml', '', '', '', ''),
(475, 1, 1, 'Skrobaczka E-RASER 28,5cm, firmy Bottari.  Skrobaczka do usuwania szronu i lodu. Służy do oczyszczania szyb auta z lodu i szronu oraz wody. Wyprodukowana z trwałego tworzywa. Wyposażona w zęby do kruszenia lodu. Posiada wygodny piankowy uchwyt dzięki któremu oczyszczanie jest łatwiejsze i wygodniejsze.', '', 'bottari-skrobaczka-e-raser-285cm', '', '', '', 'Bottari Skrobaczka E-RASER 28,5cm', '', '', '', ''),
(476, 1, 1, 'Niewidzialna wycieraczka Clearvue Rain Repel 300 ml  Preparat skutecznie odpycha wodę, brud, śnieg dla lepszej widoczności w czasie jazdy. Unikalna formuła pozostawia niewidzialną barierę ochronną i nadaje diamentowy połysk.', '', 'niewidzialna-wycieraczka-clearvue-rain-repel-300-ml', '', '', '', 'Niewidzialna wycieraczka Clearvue Rain Repel 300 ml', '', '', '', ''),
(477, 1, 1, 'Ściereczki z mikrofibry o uniwersalnym zastosowaniu. 3 sztuki o wymiarach 40x30cm Kolor: niebieski, żółty i różowy. Można prać w 60 ° C', '', 'scierki-z-mikrofibry-rulon-3-szt', '', '', '', 'Ścierki z mikrofibry rulon 3 Szt', '', '', '', ''),
(478, 1, 1, 'NIGRIN Preparat przeciw parowaniu szyb zwiększa bezpieczeństwo jazdy poprzez zapewnienie widoczności w każdych warunkach pogodowych. Bardzo skuteczny zapewnia długotrwały efekt. Nadaje się również do osłon kasku, soczewek, luster, okulraów do pracy, gogli narciarskich oraz pływackich.', '', 'preparat-przeciw-parowaniu-szyb-300-ml', '', '', '', 'Preparat przeciw parowaniu szyb 300 ml', '', '', '', ''),
(479, 1, 1, 'Uniwersalny wosk do lakierów zwykłych i metalicznych. W zestwie gabka do nakładania wosku. Do wypolerowania lakieru zaleca się użycie ścierki z mikrofibry. Odżywia kolor i zabezpiecza przed szkodliwymi warunkami atmosferycznymi.', '', 'wosk-nablyszczajacy', '', '', '', 'Wosk nabłyszczający', '', '', '', ''),
(480, 1, 1, 'Papier celulozowy w rolce 300 arkuszy  Dwuwarstwowy papier celulozowy w rolce.', '', 'papier-celulozowy-w-rolce-300-arkuszy', '', '', '', 'Papier celulozowy w rolce 300 arkuszy', '', '', '', ''),
(481, 1, 1, 'Zestaw 3 szczotek marki LUX-Tools. Szczotki przeznaczone do skutecznego usuwania brudu z felg, podwozia samochodu ale również do czyszczenia innych przedmiotów odpornych na czyszczenie mechaniczne. Szczotki o średnicy: 50/90/100 mm pozwala na dobranie odpowiedniej do konkretnego zadania. Szczotki montowane w uchwycie wiertarskim.', '', 'zestaw-szczotek-3-szt', '', '', '', 'Zestaw szczotek - 3 szt', '', '', '', ''),
(482, 1, 1, 'Płyn do chłodnic Prochem 5L może być stosowany do wszystkich typów układów chłodzących: aluminiowych, żeliwnych i mieszanych. Doskonale zabezpiecza układ chłodzenia silnika przed korozją i kawitacją. Płyn chroni również niemetalowe elementy układu przed szarzeniem.  Produkt jest przyjazny dla środowiska - nie zawiera trujących azotynów, amin i fosforanów.  Latem temperatura wrzenia płynu wynosząca 110°C zapewni sprawne działanie układu chłodzenia i ochronę silnika przed przegrzaniem. Zimą temperatura zamarzania wynosząca -35°C gwarantuje skuteczną ochronę układu przed mrozem.', '', 'prochem-plyn-chlodniczy-niebieski-5l', '', '', '', 'Prochem Płyn chłodniczy niebieski 5L', '', '', '', ''),
(483, 1, 1, 'Płyn do chłodnic Prochem 5L może być stosowany do wszystkich typów układów chłodzących: aluminiowych, żeliwnych i mieszanych. Doskonale zabezpiecza układ chłodzenia silnika przed korozją i kawitacją. Płyn chroni również niemetalowe elementy układu przed szarzeniem.  Produkt jest przyjazny dla środowiska - nie zawiera trujących azotynów, amin i fosforanów.  Latem temperatura wrzenia płynu wynosząca 110°C zapewni sprawne działanie układu chłodzenia i ochronę silnika przed przegrzaniem. Zimą temperatura zamarzania wynosząca -35°C gwarantuje skuteczną ochronę układu przed mrozem.', '', 'prochem-plyn-chlodniczy-zielony-5l', '', '', '', 'Prochem Płyn chłodniczy zielony 5L', '', '', '', ''),
(484, 1, 1, 'Smar towot marki TECMAXX 500 ml Wielofunkcyjny smar o uniwersalnym zastosowaniu do smarowania łożysk ślizgowych i innych części maszyn. Nie tylko zmniejsza tarcie, ale również tworzy na powierzchniach warstwę chroniącą przed wilgocią i zanieczyszczeniami.', '', 'tecmaxx-smar-towot-500-ml', '', '', '', 'TECMAXX Smar towot 500 ml', '', '', '', ''),
(485, 1, 1, 'Wkład do zapachu samochodowego eXc ELITE słodka pomarańcza  Jest to wkład uzupełniający.  eXc ELITE to zamknięte w eleganckiej obudowie intrygujące i przyjemne kompozycje zapachowe.  Montuje się je na kratce nawiewu, co umożliwia regulację intensywności zapachu wraz ze zmniejszaniem i zwiększaniem nawiewu.  Wkłady zapachowe są wymienne, każdorazowo można dokupić inny zapach i wypróbować różne kompozycje.', '', 'exc-elite-wklad-zapachowy-slodka-pomarancza', '', '', '', 'eXc ELITE wkład zapachowy słodka pomarańcza', '', '', '', ''),
(486, 1, 1, 'Ułatwia czyszczenie okien wewnątrz samochodu. Dzięki efektowi przeciwmgielnemu zwiększa bezpieczeństwo jazdy.', '', 'sciereczka-przeciw-parowaniu-28-x-28-cm', '', '', '', 'Ściereczka przeciw parowaniu 28 x 28 cm', '', '', '', ''),
(487, 1, 1, 'Preparat w aerozolu do czyszczenia kokpitu marki Moje Auto. Preparat do czyszczenia, zostawia antystatyczna powłokę na powierzchni plastiku. Nadaje błyszczące wykończenie, opóźnia starzenie plastików.', '', 'moje-auto-kokpit-blyszczacy-cytrynowy-600ml25-gratis', '', '', '', 'Moje Auto Kokpit błyszczący cytrynowy 600ml+25% gratis', '', '', '', ''),
(488, 1, 1, 'Preparat w aerozolu do czyszczenia kokpitu marki Moje Auto. Preparat do czyszczenia, zostawia antystatyczna powłokę na powierzchni plastiku. Nadaje matowe wykończenie, opóźnia starzenie plastików.', '', 'moje-auto-kokpit-matowy-jablko-600ml', '', '', '', 'Moje Auto Kokpit matowy jabłko 600ml', '', '', '', ''),
(489, 1, 1, 'Woska namokro w atomizerze firmy Moje Auto. Najnowsza formuła wosku nabłyszczającego, o potrójnym działaniu. Stosowany na mokry lakier przyśpiesza wysychanie i doskonale nabłyszcza.', '', 'moje-auto-wosk-na-mokro-650-ml', '', '', '', 'Moje Auto Wosk na mokro 650 ml', '', '', '', ''),
(490, 1, 1, 'Preparat w aerozolu do czyszczenia kokpitu marki Moje Auto. Preparat do czyszczenia, zostawia antystatyczna powłokę na powierzchni plastiku. Nadaje błyszczące wykończenie, opóźnia starzenie plastików.', '', 'moje-auto-kokpit-blyszczacy-500-ml-cytryna', '', '', '', 'Moje Auto Kokpit błyszczący 500 ml Cytryna', '', '', '', ''),
