(492, 1, 1, 'Odświeżacz powietrza do zastosowania w samochodzie, domu i biurze. W woreczku zamknięte są granulki nasączone wysokiej jakości perfumami, które stopniowo uwalniają unikalny zapach.', '', 'moje-auto-zapach-woreczek-insenti-vanilla', '', '', '', 'Moje Auto Zapach Woreczek Insenti Vanilla', '', '', '', ''),
(493, 1, 1, 'Ochronny wosk do lakieru NIGRIN trwale zabezpiecza lakiery nowe lub wyczyszczone za pomocą czyszczącej politury do lakieru NIGRIN. Dzięki połączeniu naturalnych i syntetycznych wosków wysokogatunkowych ochronny wosk do lakieru NIGRIN tworzy trwałe, odporne na działanie wody i zabrudzenia zabezpieczenie lakieru. Utrzymujący się do 6 miesięcy efekt perlenia, znacznie zmniejsza nakład pracy przy kolejnym myciu. Warstwa ochronnego wosku do lakieru NIGRIN jest wysoce skuteczna, odporna na warunki pogodowe i działanie szamponu. Dzięki temu zapobiega powstawaniu mikroszkód na powierzchni lakieru, wzmacnia kolory, przywraca brylantowy wysoki połysk oraz zapewnia nowy wygląd pojazdu. Nadaje się również do lakierów metalicznych oraz do zastosowania z maszynami polerującymi.', '', 'nigrin-twardy-wosk-ochronny-300ml', '', '', '', 'Nigrin Twardy wosk ochronny 300ml', '', '', '', ''),
(494, 1, 1, 'Najważniejszym walorem drzewek Wunder Baum to ich wydajność - utrzymujący się do ośmiu tygodni aromat, skutecznie neutralizujący nieprzyjemne zapachy np. dymu tytoniowego, wilgoci oraz bogata paleta zapachów. Wygodna i estetycznie wygladająca zawieszka, nie tylko zapewni zapach ale tez może być ozdobą.', '', 'wunder-baum-zapach-choinka-jungle-fever', '', '', '', 'Wunder Baum Zapach choinka Jungle Fever', '', '', '', ''),
(495, 1, 1, 'Spray nabłyszczający Plak 750 mix aromatów  Spray zabezpieczający przed wilgocią i ponownym osiadaniem się kurzu. Przywraca oraz utrzymuje błyszczący efekt czyszczonej powierzchni. Nabłyszcza, odświeża kolor i pozostawia przyjemny zapach. Mix aromatów: wiśnia, wanilia, truskawka, cytryna, lawenda.', '', 'spray-nablyszczajacy-plak-750-mix-aromatow', '', '', '', 'Spray nabłyszczający Plak 750 mix aromatów', '', '', '', ''),
(496, 1, 1, 'Zestaw ściereczek z mikrowłókniny 3 szt.  Zestaw trzech ściereczek z mikrowłókniny.', '', 'zestaw-sciereczek-z-mikrowlokniny-3-szt', '', '', '', 'Zestaw ściereczek z mikrowłókniny 3 szt.', '', '', '', ''),
(497, 1, 1, 'Mikrofibra Moje Auto Detailer XL o gramaturze 800g/m2  Dwustronna ścierka z mikrofibry w rozmiarze 60x90 cm z solidnym czarnym obszyciem jest miękka, nie strzępi się i nie pozostawia włókien na czyszczonych powierzchniach.  Mikrofibra o gramaturze 800g/m jest puszysta, chłonna i łatwa do utrzymania w czystosci. Produkt należy prać w temperaturze 40°C.  Doskonale sprawdzi się przy wszelkich pracach związanych z pielęgnacją samochodu, zarówno podczas czyszczenia wnętrza, jak i przy docieraniu wosku.', '', 'moje-auto-mikrofibra-dwustronna-60x90-cm', '', '', '', 'Moje Auto Mikrofibra dwustronna 60x90 cm', '', '', '', ''),
(498, 1, 1, 'Wosk w płynie marki Turtle Wax o pojemności 500 ml Uniwersalny wosk samochodowy, który dzięki swojej konsystencji łatwo się rozprowadza i szybko nadaje intensywny połysk lakierowanym powierzchniom. Wosk Turtle Wax delikatnie czyści karoserię oraz chroni ją przed szkodliwymi czynnikami zewnętrznymi. Nie rysuje lakieru.', '', 'turtle-wax-wosk-w-plynie-500-ml', '', '', '', 'Turtle Wax Wosk w płynie 500 ml', '', '', '', ''),
(499, 1, 1, 'Politura ze ścierką i gąbką Brilliant marki Nigrin  Zestaw do pielęgnacji samochodu składający się z delikatnej politury, ściereczki z mikrofibry oraz gąbki.  Wysokiej jakości produkt nadaje powierzchniom intensywny połysk i wydobywa głębię koloru karoserii.  Politura jest wyjątkowo delikatna, dzięki czemu nie rysuje lakieru.', '', 'politura-300-ml-ze-scierka-i-gabka-brilliant', '', '', '', 'Politura 300 ml ze ścierką i gąbką Brilliant', '', '', '', ''),
(500, 1, 1, 'Karta zapachowa do samochodu eXc CARD strawberry  Prosta w formie i użyciu karta zapachowa do zawieszenia w samochodzie. Wystarczy wyjąć kartę z folii, by cieszyć się zapachem.  Karty zapachowe eXc mogą wypełnić zapachem nie tylko auto, ale również biuro, mieszkanie i inne pomieszczenia.  Należy uważać, aby produkt nie dotykał tapicerki, ubrań, tworzyw sztucznych.', '', 'exc-karta-zapachowa-strawberry', '', '', '', 'eXc Karta zapachowa strawberry', '', '', '', ''),
