(522, 1, 1, 'Zapach Insenti Wood Lemon Mint 8ml, marki Moje Auto.  Jest to zapach do samochodu w butelce z drewnianym korkiem, w której zamknięty został zapach cytryny i mięty. Ten dyskretny odświeżacz samochodowy ozdobi i wypełni subtelną nutą każde wnętrze, dając energię i pomagając skupić się na drodze. Intensywna nuta delikatnego zapachu stopniowo roznosi się z subtelnej buteleczki po całej kabinie samochodu bądź domu czy biura, gdzie również mogą być stosowane. Objętość: 8 ml.', '', 'moje-auto-zapach-insenti-wood-lemon-mint-8ml', '', '', '', 'Moje Auto Zapach Insenti Wood Lemon Mint 8ml', '', '', '', ''),
(523, 1, 1, 'Mikrofibra Moje Auto Detailer o gramaturze 600g/m2  Szara ścierka z mikrofibry w rozmiarze 60x40 cm z solidnym czarnym obszyciem jest miękka, nie strzępi się i nie pozostawia włókien na czyszczonych powierzchniach.  Mikrofibra o gramaturze 600g/m jest chłonna i łatwa do utrzymania w czystosci. Produkt należy prać w temperaturze 40°C.  Doskonale sprawdzi się przy wszelkich pracach związanych z pielęgnacją samochodu, zarówno podczas czyszczenia wnętrza, jak i przy docieraniu wosku.', '', 'moje-auto-mikrofibra-premium-60x40-cm-szara', '', '', '', 'Moje Auto Mikrofibra Premium 60x40 cm szara', '', '', '', ''),
(524, 1, 1, 'Wosk twardy 300 ml z politurą marki Nigrin  Zestaw przeznaczony do renowacji zmatowionej karoserii samochodu składający się z twardego wosku z politurą, ściereczki z mikrofibry oraz gąbki.  Wysokiej jakości produkt oczyszcza i konserwuje powierzchnie nadając im intensywny połysk i wydobywając głębię koloru karoserii, bez konieczności długotrwałego polerowania.', '', 'wosk-twardy-300-ml-z-politura', '', '', '', 'Wosk twardy 300 ml z politurą', '', '', '', ''),
(525, 1, 1, 'Wkład do zapachu samochodowego eXc ELITE real man  Jest to wkład uzupełniający.  eXc ELITE to zamknięte w eleganckiej obudowie intrygujące i przyjemne kompozycje zapachowe.  Montuje się je na kratce nawiewu, co umożliwia regulację intensywności zapachu wraz ze zmniejszaniem i zwiększaniem nawiewu.  Wkłady zapachowe są wymienne, każdorazowo można dokupić inny zapach i wypróbować różne kompozycje.', '', 'exc-elite-wklad-zapachowy-real-man', '', '', '', 'eXc ELITE wkład zapachowy real man', '', '', '', ''),
(526, 1, 1, 'Wkład do zapachu samochodowego eXc ELITE real woman  Jest to wkład uzupełniający.  eXc ELITE to zamknięte w eleganckiej obudowie intrygujące i przyjemne kompozycje zapachowe.  Montuje się je na kratce nawiewu, co umożliwia regulację intensywności zapachu wraz ze zmniejszaniem i zwiększaniem nawiewu.  Wkłady zapachowe są wymienne, każdorazowo można dokupić inny zapach i wypróbować różne kompozycje.', '', 'exc-elite-wklad-zapachowy-real-woman', '', '', '', 'eXc ELITE wkład zapachowy real woman', '', '', '', ''),
