(530, 1, 1, 'Wkład do zapachu samochodowego eXc ELITE zielona herbata  Jest to wkład uzupełniający.  eXc ELITE to zamknięte w eleganckiej obudowie intrygujące i przyjemne kompozycje zapachowe.  Montuje się je na kratce nawiewu, co umożliwia regulację intensywności zapachu wraz ze zmniejszaniem i zwiększaniem nawiewu.  Wkłady zapachowe są wymienne, każdorazowo można dokupić inny zapach i wypróbować różne kompozycje.', '', 'exc-elite-wklad-zapachowy-zielona-herbata', '', '', '', 'eXc ELITE wkład zapachowy zielona herbata', '', '', '', ''),
(531, 1, 1, 'Karta zapachowa do samochodu eXc CARD exotic fruits  Prosta w formie i użyciu karta zapachowa do zawieszenia w samochodzie. Wystarczy wyjąć kartę z folii, by cieszyć się zapachem.  Karty zapachowe eXc mogą wypełnić zapachem nie tylko auto, ale również biuro, mieszkanie i inne pomieszczenia.  Należy uważać, aby produkt nie dotykał tapicerki, ubrań, tworzyw sztucznych.', '', 'exc-karta-zapachowa-exotic-fruits', '', '', '', 'eXc Karta zapachowa exotic fruits', '', '', '', ''),
(532, 1, 1, 'Karta zapachowa do samochodu eXc CARD green tea &amp; lime  Prosta w formie i użyciu karta zapachowa do zawieszenia w samochodzie. Wystarczy wyjąć kartę z folii, by cieszyć się zapachem.  Karty zapachowe eXc mogą wypełnić zapachem nie tylko auto, ale również biuro, mieszkanie i inne pomieszczenia.  Należy uważać, aby produkt nie dotykał tapicerki, ubrań, tworzyw sztucznych.', '', 'exc-karta-zapachowa-green-tea-lime', '', '', '', 'eXc Karta zapachowa green tea & lime', '', '', '', ''),
(533, 1, 1, 'Karta zapachowa do samochodu eXc CARD new car  Prosta w formie i użyciu karta zapachowa do zawieszenia w samochodzie. Wystarczy wyjąć kartę z folii, by cieszyć się zapachem.  Karty zapachowe eXc mogą wypełnić zapachem nie tylko auto, ale również biuro, mieszkanie i inne pomieszczenia.  Należy uważać, aby produkt nie dotykał tapicerki, ubrań, tworzyw sztucznych.', '', 'exc-karta-zapachowa-new-car', '', '', '', 'eXc Karta zapachowa new car', '', '', '', ''),
(534, 1, 1, 'Preparat w aerozolu do czyszczenia kokpitu marki Moje Auto. Preparat do czyszczenia, zostawia antystatyczna powłokę na powierzchni plastiku. Nadaje błyszczące wykończenie, opóźnia starzenie plastików.', '', 'moje-auto-kokpit-blyszczacy-waniliowy-600ml25-gratis', '', '', '', 'Moje Auto Kokpit błyszczący waniliowy 600ml+25% gratis', '', '', '', ''),
(535, 1, 1, 'Osłona przedniej szyby w samochodzie, aluminiowa, marki OBI. Służy do ochrony szyby w zimie i w lecie. W zimie przeciwdziała zaszronieniu szyby i przymarzaniu do niej wycieraczek. W lecie chroni przed słońcem i nadmiernym nagrzaniem wnętrza. Łatwa w montażu. Jest uniwersalna, nadaje się do wszystkich samochodów osobowych.', '', 'obi-oslona-przedniej-szyby-samochodowej', '', '', '', 'OBI Osłona przedniej szyby samochodowej', '', '', '', ''),
(536, 1, 1, 'Skrobak do lodu OBI posiada ergonomiczny uchwyt wykonany z 2 komponentów i jest wygodny w użyciu. Z przodu posiada mocne zęby do zrywania grubszych warstw lodu i szeroką krawędź zeskrobującą do jego szybkiego usuwania.', '', 'obi-skrobak-do-lodu-z-miekkim-uchwytem-na-rece', '', '', '', 'OBI Skrobak do lodu z miękkim uchwytem na ręce', '', '', '', ''),
(537, 1, 1, 'Gąbka uniwersalna OBI o dwóch różnych powierzchniach roboczych - do mycia i osuszania. Nadaje się znakomicie do gruntownego mycia samochodu. Szorstka strona gąbki usuwa przylegające zanieczyszczenia, natomiast strona wykonana z syntetycznej skóry osusza powierzchnie pojazdu.', '', 'obi-gabka-samochodowa-2-w-1', '', '', '', 'OBI Gąbka samochodowa 2 w 1', '', '', '', ''),
(538, 1, 1, 'MOJE AUTO Odmrażacz do zamków 50ml 25-013 Błyskawicznie odmraża, smaruje, konserwuje oraz zapobiega ponownemu zamarzaniu. Posiada właściwości antykorozyjne. Sposób użycia: Niewielką ilość preparatu wstrzyknąć do wnętrza odmrażanego zamka lub innego zamarzniętego mechanizmu.', '', 'moje-auto-odmrazacz-do-zamkow-25-013-50ml', '', '', '', 'MOJE AUTO Odmrażacz do zamków 25-013 50ml', '', '', '', ''),
(539, 1, 1, 'Mały i poręczny odkurzacz zasilany z 12 V gniazdka zapalniczki samochodowej. W komplecie wąską końcówka ułatwiająca dostęp do trudno dostepnych miejsc. Dzięki zastosowaniu systemu bezworkowego szybko opróżnisz pojemnik ze śmieci i nie martwisz się o późniejsze koszta eksploatacyjne.', '', 'carcommerce-odkurzacz-samochodowy-12v', '', '', '', 'CarCommerce Odkurzacz samochodowy 12V', '', '', '', ''),
(540, 1, 1, 'Szczotka do mycia samochodu marki Carcommerce to niezwykle praktyczne udogodnienie dla osób dbających o wygląd swojego pojazdu. Dzięki możliwości bezpośredniego połączenia z wężem z wodą, pielęgnacja i czyszczenie samochodu jest wygodniejsze i efektywniejsze. Włosie o odpowiedniej miękkości gwarantuje skuteczne usuwanie zabrudzeń, jednocześnie nie rysując lakieru.', '', 'carcommerce-szczotka-do-mycia-samochodu', '', '', '', 'Carcommerce Szczotka do mycia samochodu', '', '', '', ''),
(541, 1, 1, 'Środek do usuwania zadrapań NIGRIN usuwa punktowe i drobno powierzchniowe defekty ze wszystkich kolorowych i metalicznych lakierów, tworzyw sztucznych, szkła, metalu, w tym chromu, zapewniając tym samym zachowanie wartości pojazdu i jego nowego wyglądu.', '', 'pasta-do-usuwania-rys-w-tubie-150g-g-uniwersalna', '', '', '', 'Pasta do usuwania rys w tubie 150G g. Uniwersalna', '', '', '', ''),
(542, 1, 1, 'Pasta do usuwania rys marki Nigrin w opakowaniu o pojemności 150g, w kolorze czarnym  Wysokiej jakości produkt do pielęgnacji samochodu przeznaczony do usuwania lekkich rys i zadrapań ze wszystkich czarnych lakierów. Wygładza i usuwa niewielkie punktowe wady karoserii.', '', 'pasta-do-usuwania-rys-150g-czarna', '', '', '', 'Pasta do usuwania rys 150g czarna', '', '', '', ''),
(543, 1, 1, 'Bezpieczniki przeznaczone do stosowania w autach z napięceim 12V. 1x5Amp / 1x7Amp / 2x10Amp / 2x15Amp / 2x20Amp / 1x25Amp / 1x30Amp', '', 'bezpieczniki-plytkowe-10-szt', '', '', '', 'Bezpieczniki Płytkowe 10 Szt', '', '', '', ''),
(544, 1, 1, 'Uniwersalny rozgałęziacz gniazda zapalniczki 12V i 24V Daje możliwość na podłączenie większej ilości urządzeń elektrycznych, jak telefon i nawigacja.', '', 'rozgaleziacz-samochodwy-2-wejsciowy', '', '', '', 'Rozgałęziacz samochodwy 2-wejściowy', '', '', '', ''),
(545, 1, 1, 'Uchwyt do telefonu , smatfona , mocowany na przyssawkę. Regulowane ustawienie ramienia w kilku płaszczyznach.', '', 'uchwyt-uniwersalny-na-telefon', '', '', '', 'Uchwyt uniwersalny na telefon', '', '', '', ''),
(546, 1, 1, 'Uniwersalny uchwyt na plastikowe butelki lub puszki', '', 'uchwyt-na-napoje', '', '', '', 'Uchwyt na napoje', '', '', '', ''),
(547, 1, 1, 'Uchwyt na telefon z regulacja kąta nachylenia, mocowany na przyssawkę. Rozwierane ramiona uchwytu szybko dopasowują się do wielkości urządzenia.', '', 'unitec-uchwyt-na-telefon-na-przyssawke', '', '', '', 'Unitec Uchwyt na telefon na przyssawkę', '', '', '', ''),
(548, 1, 1, 'dywanik do bagażnika 120x80cm wielofunkcyjny CARGO-MAT', '', 'bottari-dywanik-do-bagaznika-120-x-80-cm', '', '', '', 'Bottari Dywanik do bagażnika 120 x 80 cm', '', '', '', ''),
(549, 1, 1, 'Dywanik do bagażnika 85x90cm antypoślizgowy Wykonany z gumy dywanik antypoślizgowy.', '', 'dywanik-do-bagaznika-85x90cm-antyposlizgowy', '', '', '', 'Dywanik do bagażnika 85x90cm antypoślizgowy', '', '', '', ''),
(550, 1, 1, 'Uniwersalny zasilacz samochodowy z 2 gniazdami USB do ładowania smartfonów, tabletó, nawigacji GPS, odtwarzaczy MP3 itp. Napięcie wejściowe: DC 12-24 V. Napięcie wyjściowe: DC 5V. Prąd wyjąciowy: max. 2,1 A (dla obu gniazd). Kolor: biały.', '', 'dpm-zasilacz-samochodowy-2-x-usb', '', '', '', 'DPM Zasilacz samochodowy 2 x USB', '', '', '', ''),
(551, 1, 1, 'Dywanik do bagażnika 50x90cm antypoślizgowy Wykonany z gumy dywanik antypoślizgowy.', '', 'dywanik-do-bagaznika-50x90cm-antyposlizgowy', '', '', '', 'Dywanik do bagażnika 50x90cm antypoślizgowy', '', '', '', ''),
(552, 1, 1, 'Uniwersalny rozgałęziacz gniazda zapalniczki 12V i 24V Daje możliwość na podłączenie większej ilości urządzeń elektrycznych, jak telefon i nawigacja. Dodatkowo wyposażony w wejście USB 500mA.', '', 'rozgaleziacz-samochodowy-3-wyjsciowyusb', '', '', '', 'Rozgałęziacz samochodowy 3-wyjściowy+USB', '', '', '', ''),
(553, 1, 1, 'Dywaniki samochodowe 4 sztuki  Komplet 4 dywaników samochodowych wykonanych z gumy.', '', 'dywaniki-samochodowe-4-sztuki', '', '', '', 'Dywaniki samochodowe 4 sztuki', '', '', '', ''),
(554, 1, 1, 'Mata do bagażnika XXL antypoślizgowa  Uniwersalna mata antypoślizgowa do bagażnika. Zastosowana dwustronna powłoka nie przepuszcza brudu oraz wilgoci.', '', 'dywanik-do-bagaznika-xxl-antyposlizgowy', '', '', '', 'Dywanik do bagażnika XXL antypoślizgowy', '', '', '', ''),
(555, 1, 1, 'Dywanik do bagażnika 70x90cm antypoślizgowy Wykonany z gumy dywanik antypoślizgowy.', '', 'dywanik-do-bagaznika-70x90cm-antyposlizgowy', '', '', '', 'Dywanik do bagażnika 70x90cm antypoślizgowy', '', '', '', ''),
(556, 1, 1, '<p>Rura wykonana z PVC to specjalnie przystosowana rura do wody zimnej, która służy do przesyłania wody do spożycia oraz na potrzeby gospodarcze. Rurę z powodzeniem można wykorzystać w instalacjach grzewczych, a także w przemysłowych obiegach wody.</p>', '<div class=\"overview__details\">\n<ul class=\"overview__detail-list normal black\">\n<li>Max ciśnienie robocze: 2,5 MPa</li>\n<li>Max temperatura pracy:+120C</li>\n</ul>\n</div>\n<p></p>', 'rura-pvc-12-pn16-3m', '', '', '', 'Rura PVC 1/2\" PN16 3m', '', '', '', '');
